(257, 6, 6000000, 112, NULL, 'tt0110771', b'0', 'en', 'Henry Hackett is the editor of a New York City tabloid. He is a workaholic who loves his job, but the long hours and low pay are leading to discontent. Also, publisher Bernie White faces financial straits, and has hatchetman Alicia Clark, Henry\'s nemesis, impose unpopular cutbacks.', 4, 'https://image.tmdb.org/t/p/w500/3FMfcgvjwgmyoT6Pp89wALzSUHT.jpg', '2064-03-19', 'Released', 'The Paper', 40),
(258, 6, 0, 100, NULL, 'tt0112714', b'0', 'fr', 'The year is 1952, in Quebec City. Rachel (16), unmarried and pregnant, works in the church. Filled with shame, she unburdens her guilt to a young priest, under the confidentiality of the confessional. In the present year of 1989, Pierre Lamontagne has returned to Quebec to attend his father\'s funeral. He meets up with his adopted brother, Marc, who has begun questioning his identity and has embarked on a quest for his roots that would lead them to the Quebec of the 1950s. Past and present converge in a complex web of intrigue where the answer to the mystery lies.', 0, 'https://image.tmdb.org/t/p/w500/8RCRrSAY8e3Qn5p9cNv188ogmZQ.jpg', '2065-09-30', 'Released', 'Le confessionnal', 2),
(259, 6, 11500000, 99, NULL, 'tt0110950', b'0', 'en', 'A small circle of friends suffering from post-collegiate blues must confront the hard truth about life, love and the pursuit of gainful employment. As they struggle to map out survival guides for the future, the Gen-X quartet soon begins to realize that reality isn\'t all it\'s cracked up to be.', 6, 'https://image.tmdb.org/t/p/w500/gbi7dmxPNVqJQpKnHOpZ9dmeWAO.jpg', '2064-02-20', 'Released', 'Reality Bites', 180),
(260, 6, 8000000, 98, NULL, 'tt0105226', b'0', 'en', 'When a promised job for Texan Michael fails to materialise in Wyoming, Mike is mistaken by Wayne to be the hitman he hired to kill his unfaithful wife, Suzanne. Mike takes full advantage of the situation, collects the money and runs. During his getaway, things go wrong, and soon get worse when he runs into the real hitman, Lyle.', 5, 'https://image.tmdb.org/t/p/w500/d1TwyCjnJMKIgMw0CgH2nQsKZAN.jpg', '2063-07-10', 'Released', 'Red Rock West', 71),
(261, 5, 45000000, 96, NULL, 'tt0113419', b'0', 'en', 'A nine-year-old boy gets a plastic Indian and a cupboard for his birthday and finds himself involved in adventure when the Indian comes to life and befriends him.', 10, 'https://image.tmdb.org/t/p/w500/l16BtfILyWxYwSqzofL3V1rMSwe.jpg', '2065-07-15', 'Released', 'The Indian in the Cupboard', 136),
(262, 5, 40000000, 95, NULL, 'tt0110989', b'0', 'en', 'Billionaire heir Richie Rich has it all, including Reggie Jackson as a batting coach and Claudia Schiffer as a personal trainer -- but no playmates. What\'s more, scoundrel Laurence Van Dough is scheming to take over the family empire. Uh-oh! Enter faithful butler Cadbury to save the day.', 6, 'https://image.tmdb.org/t/p/w500/hbNmaqJcjg4ChZ5vvfQpNzizoiR.jpg', '2064-12-20', 'Released', 'RiÂ¢hie RiÂ¢h', 426),
(263, 4, 0, 98, NULL, 'tt0111054', b'0', 'en', 'A mother with seven sons feels like she\'s losing control of her life and her family. But personal...', 4, 'https://image.tmdb.org/t/p/w500/3t8zDeD29iqjhz6k8OuvRizu8h.jpg', '2064-12-02', 'Released', 'Safe Passage', 7),
(264, 6, 45000000, 111, NULL, 'tt0110997', b'0', 'en', 'While on a family vacation,  rafting expert Gail takes on a pair of armed killers while navigating a spectacularly violent river.', 10, 'https://image.tmdb.org/t/p/w500/8NFAQxZud5Kisw1sd9WxfBG54.jpg', '2064-10-01', 'Released', 'The River Wild', 214),
(265, 6, 30000000, 116, NULL, 'tt0111257', b'0', 'en', 'Los Angeles SWAT cop Jack Traven is up against bomb expert Howard Payne, who\'s after major ransom money. First it\'s a rigged elevator in a very tall building. Then it\'s a rigged bus--if it slows, it will blow, bad enough any day, but a nightmare in LA traffic. And that\'s still not the end.', 10, 'https://image.tmdb.org/t/p/w500/bDLiyoxdK8mZHaeYVOxMZj7WGkb.jpg', '2064-06-10', 'Released', 'Speed', 1814),
(266, 6, 35000000, 140, NULL, 'tt0107426', b'0', 'en', 'Little Buddha is a movie about the life of Siddhartha starring Keanu Reeves and Bridget Fonda and directed by Bernardo Bertolucci.', 5, 'https://image.tmdb.org/t/p/w500/lXbIlZEisZs2V44YGA6yr4PBHZs.jpg', '2063-12-03', 'Released', 'Little Buddha', 76),
(267, 5, 20000000, 101, NULL, 'tt0116260', b'0', 'en', 'It\'s fire and brimstone time as grieving mother Karen McCann takes justice into her own hands when a kangaroo court in Los Angeles fails to convict Robert Doob, the monster who raped and murdered her 17-year-old daughter.', 4, 'https://image.tmdb.org/t/p/w500/y2lZSdJ1o0VvLegTw3ad6KFtxra.jpg', '2066-01-13', 'Released', 'Eye for an Eye', 65),
(268, 5, 0, 99, NULL, 'tt0111256', b'0', 'en', 'A romantic comedy. Michael Keaton and Geena Davis are speechwriters for competing political campaigns. Witty and amusing for the political junkies amongst us.', 2, 'https://image.tmdb.org/t/p/w500/nN5BPaG720jhkNf29Pogm1O1mq4.jpg', '2064-12-17', 'Released', 'Speechless', 24),
(269, 6, 0, 137, NULL, 'tt0113862', b'0', 'en', 'In 1965, passionate musician Glenn Holland takes a day job as a high school music teacher, convinced it\'s just a small obstacle on the road to his true calling: writing a historic opus. As the decades roll by with the composition unwritten but generations of students inspired through his teaching, Holland must redefine his life\'s purpose.', 7, 'https://image.tmdb.org/t/p/w500/jYEKdpVvRV3KdyHMUVYyg0KTVSY.jpg', '2065-12-30', 'Released', 'Mr. Holland\'s Opus', 115),
