(271, 8, 45000000, 89, 'http://movies.disney.com/the-lion-king', 'tt0110357', b'0', 'en', 'A young lion cub named Simba can\'t wait to be king. But his uncle craves the title for himself and will stop at nothing to get it.', 21, 'https://image.tmdb.org/t/p/w500/bKPtXn9n4M4s8vvZrbw40mYsefB.jpg', '2064-06-24', 'Released', 'The Lion King', 5520),
