(273, 6, 115000000, 141, NULL, 'tt0111503', b'0', 'en', 'Harry Tasker is a secret agent for the United States Government. For years, he has kept his job from his wife, but is forced to reveal his identity and try to stop nuclear terrorists when he and his wife are kidnapped by them.', 11, 'https://image.tmdb.org/t/p/w500/mTAHr5h5i64hTLqo0cW2X2083Cx.jpg', '2064-07-15', 'Released', 'True Lies', 1138),
(274, 6, 0, 126, NULL, 'tt0111693', b'0', 'en', 'An airline pilot and his wife are forced to face the consequences of her alcoholism when her addictions threaten her life and their daughter\'s safety. While the woman enters detox, her husband must face the truth of his enabling behavior.', 4, 'https://image.tmdb.org/t/p/w500/n3B7MBFwyKj9OaTscDZlfJt8Ayy.jpg', '2064-04-30', 'Released', 'When a Man Loves a Woman', 71),
(275, 6, 0, 127, NULL, 'tt0110478', b'0', 'en', 'Maverick is a gambler who would rather con someone than fight them. He needs an additional three thousand dollars in order to enter a Winner Take All poker game that begins in a few days. He tries to win some, tries to collect a few debts, and recover a little loot for the reward. He joins forces with a woman gambler with a marvelous southern accent as the two both try and enter the game.', 15, 'https://image.tmdb.org/t/p/w500/oGSiAJTT9BxN3sxrg4Fyfc8ElGg.jpg', '2064-05-21', 'Released', 'Maverick', 490),
(276, 6, 63000000, 191, NULL, 'tt0111756', b'0', 'en', 'Covering the life and times of one of the West\'s most iconic heroes Wyatt Earp weaves an intricate tale of Earp and his friends and family. With a star studded cast, sweeping cinematography and authentic costumes Wyatt Earp led the way during the Western revival in the 90\'s.', 9, 'https://image.tmdb.org/t/p/w500/zSGDgcWHqmQxmX4mLJZgT5UgLjj.jpg', '2064-06-25', 'Released', 'Wyatt Earp', 203),
(277, 6, 0, 96, NULL, 'tt0111048', b'0', 'en', 'An alienated and misanthropic teenager gains sudden and unwanted celebrity status after he\'s taken hostage by terrorists where his indifference to their threats to kill him makes news headlines.', 2, 'https://image.tmdb.org/t/p/w500/2o9zTDKdC4MHNIYBLgFMpO5ik9o.jpg', '2064-09-16', 'Released', 'S.F.W.', 22),
(278, 4, 0, 108, NULL, 'tt0112443', b'0', 'en', 'Nelson Crowe is a CIA operative under the thumb of the Company for a disputed delivery of $50,000 in gold. They blackmail him into working for the Grimes Organization, which is set up as a private company for hire, to blackmail prominent individuals. Crowe, working with Margaret Wells (another former Covert Operations operative), blackmails and bribes a State Supreme Court judge, but the deal sours. One of Crowe\'s co-workers, Tod Stapp, discovers Crowe\'s current CIA involvement in a plot to overthrow Grimes, and blackmails him to be cut in on the deal. More blackmail occurs as Wells manipulates Crowe to kill Grimes, then the CIA uses that discovery to blackmail Wells into killing Crowe. Who can you trust???', 0, 'https://image.tmdb.org/t/p/w500/tq9dJtuOAMhBjXTaJ7WrD0mEWHe.jpg', '2065-01-21', 'Released', 'Bad Company', 12),
(279, 4, 0, 96, NULL, 'tt0118002', b'0', 'en', 'Frank O\'Brien, a petty thief, and his 7-year-long girlfriend Roz want to put an end to their unsteady lifestyle and just do that last job, which involves stealing a valuable painting. Frank takes Roz to an island on the coast of New England, where he wants to sell the painting and also hopes that their sagging relationship will get a positive push back up. Not everything goes as planned.', 2, 'https://image.tmdb.org/t/p/w500/e0iwJJiLjk8Z6A9TuL3neX504H3.jpg', '2066-01-13', 'Released', 'Two If by Sea', 14),
(280, 6, 10000000, 100, NULL, 'tt0110399', b'0', 'en', 'A black detective becomes embroiled in a web of danger while searching for a fortune in missing drug money. During the course of his investigation, he encounters various old connections, ultimately confronting the criminal responsible for Shame\'s expulsion from the force. He must also deal with two women, Angela, a beautiful old flame, and Peaches, his energetic but annoying sidekick.', 3, 'https://image.tmdb.org/t/p/w500/2R1vC1krfvX4U7ObdOCtQak2mgY.jpg', '2064-11-24', 'Released', 'A Low Down Dirty Shame', 31),
(281, 2, 0, 91, NULL, 'tt0112570', b'0', 'en', 'Each of the three short films in this collection presents a young gay man at the threshold of adulthood. In \"Pool Days,\" Justin is a 17-year old Bethesda lad, hired as the evening life guard at a fitness center. In the course of the summer, he realizes and embraces that he\'s gay. In \"A Friend of Dorothy,\" Winston arrives from upstate for his freshman year at NYU. He has to figure out, with some help from Anne, a hometown friend, how to build a social life as a young gay man in the city. In \"The Disco Years,\" Tom looks back on 1978, the year in high school that he came out of the closet after one joyful and several painful encounters', 0, 'https://image.tmdb.org/t/p/w500/dyzCRoZCjb2Rafmiws8ySGMt56T.jpg', '2064-10-01', 'Released', 'Boys Life: Three Stories of Love, Lust, and Liberation', 1),
(282, 4, 15000000, 88, NULL, 'tt0115683', b'0', 'en', 'Bud and Doyle are two losers who are doing nothing with their lives. Both of their girlfriends are actively involved in saving the environment, but the two friends couldn\'t care less about saving the Earth. One day, when a group of scientists begin a mission to live inside a \"Bio-Dome\" for a year without outside contact, Bud and Doyle mistakenly become part of the project themselves.', 6, 'https://image.tmdb.org/t/p/w500/1bAUaipv3gDU1pATGwziyq1VTwZ.jpg', '2066-01-13', 'Released', 'Bio-Dome', 110),
(283, 6, 0, 89, NULL, 'tt0116126', b'0', 'en', 'When Ashtray (Shawn Wayans) moves to South Central L.A. to live with his father (who appears to be the same age he is) and grandmother (who likes to talk tough and smoke reefer), he falls in with his gang-banging cousin Loc Dog (Marlon Wayans), who along with the requisite pistols and Uzi carries a thermo-nuclear warhead for self-defense. Will Ashtray be able to keep living the straight life?', 11, 'https://image.tmdb.org/t/p/w500/l6D9f9WbxdI4tyCmJGs56y8tQla.jpg', '2066-01-13', 'Released', 'Don\'t Be a Menace to South Central While Drinking Your Juice in the Hood', 192),
(284, 5, 0, 110, NULL, 'tt0109454', b'0', 'fr', 'Colonel Chabert has been severely wounded in the French-Russian Napoleonic war to the point that the medical examiner has signed his death certificate. When he regains his health and memory, he goes back to Paris, where his \"widow\", Anne has married the Count Ferraud and is financing his rise to power using Chabert\'s money. Chabert hires a lawyer to help him get back his money and his honor.', 0, 'https://image.tmdb.org/t/p/w500/rzfli2FuCuE2n3b5FNQ6RmJCMEl.jpg', '2064-01-03', 'Released', 'Le colonel Chabert', 9),
(285, 6, 45000, 83, NULL, 'tt0059170', b'0', 'en', 'Three strippers seeking thrills encounter a young couple in the desert. After dispatching the boyfriend, they take the girl hostage and begin scheming on a crippled old man living with his two sons in the desert, reputedly hiding a tidy sum of cash. They become house guests of the old man and try and seduce the sons in an attempt to locate the money, not realizing that the old man has a few sinister intentions of his own.', 4, 'https://image.tmdb.org/t/p/w500/u0YrGkpjL5H190qqEsQavZ2WrV5.jpg', '2035-08-08', 'Released', 'Faster, Pussycat! Kill! Kill!', 59),
(286, 5, 7000000, 119, NULL, 'tt0110186', b'0', 'en', 'The story of a young man who must confront his own fears about love as well as his relationships with family and friends.', 0, 'https://image.tmdb.org/t/p/w500/3dYMkjzABC2KRvyHvBjhEg4gaBj.jpg', '2064-09-29', 'Released', 'Jason\'s Lyric', 9),
(287, 7, 0, 61, NULL, 'tt0108069', b'0', 'en', 'A boy born the size of a small doll is kidnapped by a genetic lab and must find a way back to his father in this inventive adventure filmed using stop motion animation techniques.', 0, 'https://image.tmdb.org/t/p/w500/1X9xCx8onIKeW9yMO6zDFf3KHZg.jpg', '2063-12-12', 'Released', 'The Secret Adventures of Tom Thumb', 8),
(288, 6, 0, 99, NULL, 'tt0110455', b'0', 'en', 'Alfie Byrne is a middle-aged bus conductor in Dublin in 1963. He would appear to live a life of quiet desperation: he\'s gay, but firmly closeted, and his sister is always trying to find him \"the right girl\". His passion is Oscar Wilde, his hobby is putting on amateur theatre productions in the local church hall. We follow him as he struggles with temptation, friendship, disapproval, and the conservative yet oddly lyrical world of Ireland in the early 1960s.', 0, 'https://image.tmdb.org/t/p/w500/l3APcL3lgn5KztIOe1BQ6mKQFKB.jpg', '2064-12-23', 'Released', 'A Man of No Importance', 2),
(289, 0, 0, 97, NULL, 'tt0112849', b'0', 'en', 'Jackie and Eugene are joined by a mystical wind tunnel which enables them to speak across a 500-mile desert. Believed by the Indians to be an omen of good luck, the wind inspires both characters to face their fears and follow their hearts.', 0, 'https://image.tmdb.org/t/p/w500/taQ3WgPtiGT9bVPTlQ4caxFlvUA.jpg', '2068-01-02', 'Released', 'Desert Winds', 0),
(290, 2, 0, 92, NULL, 'tt0116839', b'0', 'en', 'Jobe is resuscitated by Jonathan Walker. He wants Jobe to create a special computer chip that would connect all the computers in the world into one network, which Walker would control and use. But what Walker doesn\'t realize is a group of teenage hackers are on to him and out to stop his plan.', 2, 'https://image.tmdb.org/t/p/w500/i0hBsWBLw64XRehFzCL44PaCs1y.jpg', '2066-01-13', 'Released', 'Lawnmower Man 2: Beyond Cyberspace', 32),
(291, 7, 0, 89, NULL, 'tt0113104', b'0', 'en', 'Before computer graphics, special effects wizardry, and out-of-this world technology, the magic of animation flowed from the pencils of two of the greatest animators The Walt Disney Company ever produced -- Frank Thomas and Ollie Johnston. Frank and Ollie, the talent behind BAMBI, PINOCCHIO, LADY AND THE TRAMP, THE JUNGLE BOOK, and others, set the standard for such modern-day hits as THE LION KING. It was their creative genius that helped make Disney synonymous with brilliant animation, magnificent music, and emotional storytelling. Take a journey with these extraordinary artists as they share secrets, insights, and the inspiration behind some of the greatest animated movies the world has ever known!', 0, 'https://image.tmdb.org/t/p/w500/7ZtlUAC0Uazg3i1U2ha318EOV2P.jpg', '2065-10-21', 'Released', 'Frank and Ollie', 4),
(292, 4, 35000000, 102, NULL, 'tt0111301', b'0', 'en', 'Col. Guile and various other martial arts heroes fight against the tyranny of Dictator M. Bison and his cohorts.', 13, 'https://image.tmdb.org/t/p/w500/1Q5YdK91oJBXJcbCuZhKXeY4vP1.jpg', '2064-12-23', 'Released', 'Street Fighter', 330),
(293, 6, 0, 88, NULL, 'tt0113014', b'0', 'en', 'Three young men decide to plan a mock kidnapping, but everything goes wrong because a real bank robbery was already planned by two other guys.', 1, 'https://image.tmdb.org/t/p/w500/zCdFbHgOPgxkVikuPvUKYlakXuf.jpg', '2065-05-14', 'Released', 'Fall Time', 6),
