(463, 5, 0, 99, NULL, 'tt0112364', b'0', 'en', 'A ten year old girl named Angela leads her six year old sister, Ellie, through various regimens of \'purification\' in an attempt to rid themselves of their evil, which she believes to be the cause of their mother\'s mental illness. Precocious, to say the least, Angela has visions of Lucifer coming to take her and her sister away, and one of her remedies for this is for them to remain within a circle of their dolls and toys until they see a vision of the virgin Mary come to them. But such thinking can only lead to an ending befitting of her own mental state.', 2, 'https://image.tmdb.org/t/p/w500/dw5RWgSSDV5h3ZKS0oSzPe6A26p.jpg', '2065-01-02', 'Released', 'Angela', 9),
