(467, 0, 0, 87, NULL, 'tt0114500', b'0', 'en', 'Within days after the release of Negativland\'s clever parody of U2 and Casey Kasem, recording industry giant Island Records descended upon the band with a battery of lawyers intent on erasing the piece from the history of rock music.  Craig \"Tribulation 99\" Baldwin follows this and other intellectual property controversies across the contemporary arts scene. Playful and ironic, his cut-and-paste collage-essay surveys the prospects for an \"electronic folk culture\" in the midst of an increasingly commodified corporate media landscape.', 0, 'https://image.tmdb.org/t/p/w500/wU4NBvZdP1wTAq142OR5knnhfG5.jpg', '2065-08-02', 'Released', 'Sonic Outlaws', 0),
(468, 5, 0, 92, NULL, 'tt0116130', b'0', 'en', 'Bumbling Navy lieutenant Tom Dodge has been given one last chance to clean up his record. But Admiral Graham, his nemesis, assigns Dodge to the Stingray, a submarine that can barely keep afloat. To add insult to injury, the Stingray is to be the enemy flagship in the upcoming war games â¦ and to make matters even worse, Dodge\'s crew is a band of idiots even more incompetent that he is!', 5, 'https://image.tmdb.org/t/p/w500/q6JEjedx4LoZRig8U1R5sJqBfti.jpg', '2066-03-03', 'Released', 'Down Periscope', 110),
(469, 6, 0, 97, NULL, 'tt0113125', b'0', 'en', 'Mark Rappaport\'s creative bio-pic about actress Jean Seberg is presented in a first-person, autobiographical format (with Seberg played by Mary Beth Hurt). He seamlessly interweaves cinema, politics, American society and culture, and film theory to inform, entertain, and move the viewer. Seberg\'s many marriages, as well as her film roles, are discussed extensively. Her involvement with the Black Panther Movement and subsequent investigation by the FBI is covered. Notably, details of French New Wave cinema, Russian Expressionist (silent) films, and the careers of Jane Fonda, Vanessa Redgrave, and Clint Eastwood are also intensively examined. Much of the film is based on conjecture, but Rappaport encourages viewers to re-examine their ideas about women in film with this thought-provoking picture.', 0, 'https://image.tmdb.org/t/p/w500/wfPHta8Wxm4LQVHU8tRhL8GCyIz.jpg', '2065-09-09', 'Released', 'From the Journals of Jean Seberg', 2),
(470, 3, 0, 86, NULL, 'tt0113756', b'0', 'en', 'First-time director Dirk Shafer also penned this raucous \"mockumentary,\" a blend of fact and fiction that re-creates his 1992 reign as Playgirl magazine\'s Centerfold of the Year. When Shafer chooses to keep the fact that he\'s gay a secret from the magazine\'s editors, he finds himself living the ultimate lie -- and incapable of giving female readers what they really want. Will he succumb to his lover\'s pressures to come out of the closet?', 0, 'https://image.tmdb.org/t/p/w500/nKYRDhGlbvQpXJnyMm7fcFDtm6P.jpg', '2065-09-16', 'Released', 'Man of the Year', 2),
(471, 7, 0, 91, NULL, 'tt0113952', b'0', 'en', 'While on a train, a teenage boy thinks about his life and the flamboyant aunt whose friendship acted as an emotional shield from his troubled family. This film evokes the haunting quality of memory while creating a heartfelt portrait of a boy\'s life in a rural 1940s Southern town.', 0, 'https://image.tmdb.org/t/p/w500/wpaZXRvhdNhmaedy8BMytuOXvGO.jpg', '2065-08-24', 'Released', 'The Neon Bible', 5),
(472, 5, 60000000, 119, NULL, 'tt0118055', b'0', 'en', 'Tally Atwater has a dream: to be a prime-time network newscaster. She pursues this dream with nothing but ambition, raw talent and a homemade demo tape. Warren Justice is a brilliant, hard edged, veteran newsman. He sees Tally has talent and becomes her mentor. Tallyâs career takes a meteoric rise and she and Warren fall in love. The romance that results is as intense and revealing as television news itself. Yet, each breaking story, every videotaped crisis that brings them together, also threatens to drive them apart...', 3, 'https://image.tmdb.org/t/p/w500/bxRJQjCsJu6j4lvphjVJ5knNebs.jpg', '2066-03-03', 'Released', 'Up Close & Personal', 51),
