(485, 6, 2000000, 83, 'http://miramax.com/movie/blue-in-the-face/', 'tt0112541', b'0', 'en', 'Auggie runs a small tobacco shop in Brooklyn, New York. The whole neighborhood comes to visit him to buy cigarettes and have some small talk. During the movie Lou Reed tries to explain why he has to have a cut on his health insurance bill if he keeps smoking and Madonna acts as a Singing Telegram.', 11, 'https://image.tmdb.org/t/p/w500/qa9yf3OlfXbYBb0af0mpawGB6TI.jpg', '2065-09-16', 'Released', 'Blue in the Face', 28),
(486, 6, 0, 100, NULL, 'tt0112495', b'0', 'en', 'Patricia Arquette stars as American widow Laura Bowman, a young doctor who\'s unwittingly drawn into political turmoil while vacationing in Burma in the late 1980s, in this fictionalized drama based on actual events. Bowman initially left San Francisco with her sister (Frances McDormand) in an attempt to escape painful memories of her husband and son\'s violent deaths. But her fight to escape to Thailand could prove just as harrowing.', 2, 'https://image.tmdb.org/t/p/w500/5CQgpLITPo33AEN1jULsyiHxSDJ.jpg', '2065-05-25', 'Released', 'Beyond Rangoon', 21),
(487, 6, 50000000, 100, NULL, 'tt0112642', b'0', 'en', 'Furious that her late father only willed her his gloomy-looking mansion rather than his millions, Carrigan Crittenden is ready to burn the place to the ground when she discovers a map to a treasure hidden in the house. But when she enters the rickety mansion to seek her claim, she is frightened away by a wicked wave of ghosts. Determined to get her hands on this hidden fortune, she hires afterlife therapist Dr. James Harvey to exorcise the ghosts from the mansion. Harvey and his daughter Kat move in, and soon Kat meets Casper, the ghost of a young boy who\'s \"the friendliest ghost you know.\" But not so friendly are Casper\'s uncles--Stretch, Fatso and Stinkie--who are determined to drive all \"fleshies\" away.', 12, 'https://image.tmdb.org/t/p/w500/cpMbvFDD2C21pqMNXVPhSWGQBR9.jpg', '2065-05-27', 'Released', 'Casper', 1045),
(488, 5, 11000000, 91, NULL, 'tt0109370', b'0', 'en', 'Canadian Bacon is the only fictitious film from Director Michael Moore. This comedy is about an American president who decides to go to war to bring the publicâs opinion of him up during election time. Canadian Bacon is actor John Candyâs last film.', 5, 'https://image.tmdb.org/t/p/w500/qnKARYBofUzHkBY8x9GWSNSoota.jpg', '2065-06-09', 'Released', 'Canadian Bacon', 57),
(489, 5, 50000000, 109, NULL, 'tt0112715', b'0', 'en', 'Eight people embark on an expedition into the Congo, a mysterious expanse of unexplored Africa where human greed and the laws of nature have gone berserk. When the thrill-seekers -- some with ulterior motives -- stumble across a race of killer apes.', 7, 'https://image.tmdb.org/t/p/w500/wjeQaiAApgzdipkNXhQnBrqjBY9.jpg', '2065-06-10', 'Released', 'Congo', 214),
(490, 6, 25000000, 128, NULL, 'tt0112688', b'0', 'en', 'Strike is a young city drug pusher under the tutelage of drug-lord Rodney Little.When a night man at a fast-food restaurant is found with four bullets in his body, Strike\'s older brother turns himself in as the killer. Det. Rocco Klein doesn\'t buy the story, however, and sets out to find the truth, and it seems that all the fingers point toward Strike &amp; Rodney.', 4, 'https://image.tmdb.org/t/p/w500/ugGhvQoGBrefqmkeBvBgT4YVCRk.jpg', '2065-09-16', 'Released', 'Clockers', 69),
(491, 7, 53000000, 116, NULL, 'tt0112740', b'0', 'en', 'On a US nuclear missile sub, a young first officer stages a mutiny to prevent his trigger happy captain from launching his missiles before confirming his orders to do so.', 8, 'https://image.tmdb.org/t/p/w500/oDJyDX11HW4j565vUjmFagKxDTQ.jpg', '2065-05-13', 'Released', 'Crimson Tide', 508),
(492, 7, 0, 119, NULL, 'tt0109508', b'0', 'en', 'This movie chronicles the life and times of R. Crumb. Robert Crumb is the cartoonist/artist who drew Keep On Truckin\', Fritz the Cat, and played a major pioneering role in the genesis of underground comix. Through interviews with his mother, two brothers, wife, and ex-girlfriends, as well as selections from his vast quantity of graphic art, we are treated to a darkly comic ride through one man\'s subconscious mind.', 3, 'https://image.tmdb.org/t/p/w500/yzK39sdkGoiSyKZEWT6HQzaC0BX.jpg', '2064-09-11', 'Released', 'Crumb', 71),
(493, 6, 31000000, 117, NULL, 'tt0115685', b'0', 'en', 'A gay cabaret owner and his drag queen companion agree to put up a false straight front so that their son can introduce them to his fiancÃ©\'s right-wing moralistic parents.', 6, 'https://image.tmdb.org/t/p/w500/wRTkvqRTB05gcGInsnGqVgLkb3t.jpg', '2066-03-10', 'Released', 'The Birdcage', 303),
(494, 5, 100000000, 121, NULL, 'tt0112462', b'0', 'en', 'The Dark Knight of Gotham City confronts a dastardly duo: Two-Face and the Riddler. Formerly District Attorney Harvey Dent, Two-Face believes Batman caused the courtroom accident which left him disfigured on one side. And Edward Nygma, computer-genius and former employee of millionaire Bruce Wayne, is out to get the philanthropist; as The Riddler. Former circus acrobat Dick Grayson, his family killed by Two-Face, becomes Wayne\'s ward and Batman\'s new partner Robin.', 13, 'https://image.tmdb.org/t/p/w500/eTMrHEhlFPHNxpqGwpGGTdAa0xV.jpg', '2065-06-17', 'Released', 'Batman Forever', 1529),
(495, 6, 0, 98, NULL, 'tt0112585', b'0', 'en', 'Deals with the lives of the three Irish Catholic McMullen brothers from Long Island, New York, over three months, as they grapple with basic ideas and values â love, sex, marriage, religion and family â in the 1990s. Directed, written, produced by and starring Edward Burns.', 2, 'https://image.tmdb.org/t/p/w500/8YlwQ2BBH6PY3Tl0bOf0fLep31h.jpg', '2065-08-10', 'Released', 'The Brothers McMullen', 23),
(496, 5, 0, 80, NULL, 'tt0112887', b'0', 'en', 'Jordan White and Amy Blue, two troubled teens, pick up an adolescent drifter, Xavier Red. Together, the threesome embark on a sex and violence-filled journey through an America of psychos and quickiemarts.', 7, 'https://image.tmdb.org/t/p/w500/6ZwsSedjyzR0poDrKlJaYWoseaH.jpg', '2065-10-28', 'Released', 'The Doom Generation', 57),
(497, 6, 27000000, 102, NULL, 'tt0112857', b'0', 'en', 'In late 1940s Los Angeles, Easy Rawlins is an unemployed black World War II veteran with few job prospects. At a bar, Easy meets DeWitt Albright, a mysterious white man looking for someone to investigate the disappearance of a missing white woman named Daphne Monet, who he suspects is hiding out in one of the city\'s black jazz clubs. Strapped for money and facing house payments, Easy takes the job, but soon finds himself in over his head.', 4, 'https://image.tmdb.org/t/p/w500/z0Boi5LktVxDMFnpyAqQEnYfPtM.jpg', '2065-09-16', 'Released', 'Devil in a Blue Dress', 88),
(498, 6, 90000000, 128, NULL, 'tt0112864', b'0', 'en', 'New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought he\'d seen it all, until a genius named Simon engages McClane, his new \"partner\" -- and his beloved city -- in a deadly game that demands their concentration.', 15, 'https://image.tmdb.org/t/p/w500/ivpXGcsPZglyYrN65THWSD7JM3q.jpg', '2065-05-20', 'Released', 'Die Hard: With a Vengeance', 2094),
(499, 0, 0, 116, NULL, 'tt0113044', b'0', 'en', 'After an abandoned young woman in late 19th Century England is taken in by a rural couple with three handsome sons, tragic consequences result.', 0, 'https://image.tmdb.org/t/p/w500/ntXzazC3ZaWy9GjkFzZGtJFLCZp.jpg', '2065-10-13', 'Released', 'Feast of July', 0),
(500, 6, 7000000, 104, NULL, 'tt0112851', b'0', 'en', 'A gunslinger is embroiled in a war with a local drug runner.', 6, 'https://image.tmdb.org/t/p/w500/7eVo5DbP7gcsDzHcpRCTA6JAuF2.jpg', '2065-08-26', 'Released', 'Desperado', 898);

