INSERT INTO `movie` (`movie_id`, `average_votes`, `budget`, `duration`, `homepage_link`, `imdb_id`, `is_adult`, `main_language`, `overview`, `popularity`, `poster_url`, `release_date`, `status`, `title`, `total_votes`) VALUES
(1, 6, 65000000, 104, NULL, 'tt0113497', b'0', 'en', 'When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who\'s been trapped inside the game for 26 years -- into their living room. Alan\'s only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.', 17, 'https://image.tmdb.org/t/p/w500/vzmL6fP7aPKNKPRTFnZmiUfciyV.jpg', '2065-12-16', 'Released', 'Jumanji', 2413),
(2, 7, 30000000, 81, 'http://toystory.disney.com/toy-story', 'tt0114709', b'0', 'en', 'Led by Woody, Andy\'s toys live happily in his room until Andy\'s birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy\'s heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.', 21, 'https://image.tmdb.org/t/p/w500/rhIRbceoE9lR4veEXuwCC2wARtG.jpg', '2065-10-31', 'Released', 'Toy Story', 5415),
(3, 5, 0, 106, NULL, 'tt0113041', b'0', 'en', 'Just when George Banks has recovered from his daughter\'s wedding, he receives the news that she\'s pregnant ... and that George\'s wife, Nina, is expecting too. He was planning on selling their home, but that\'s a plan that -- like George -- will have to change with the arrival of both a grandchild and a kid of his own.', 8, 'https://image.tmdb.org/t/p/w500/e64sOI48hQXyru7naBFyssKFxVd.jpg', '2065-02-11', 'Released', 'Father of the Bride Part II', 173),
(4, 6, 0, 101, NULL, 'tt0113228', b'0', 'en', 'A family wedding reignites the ancient feud between next-door neighbors and fishing buddies John and Max. Meanwhile, a sultry Italian divorcÃ©e opens a restaurant at the local bait shop, alarming the locals who worry she\'ll scare the fish away. But she\'s less interested in seafood than she is in cooking up a hot time with Max.', 11, 'https://image.tmdb.org/t/p/w500/6ksm1sjKMFLbO7UY2i6G1ju9SML.jpg', '2065-12-23', 'Released', 'Grumpier Old Men', 92),
(5, 6, 16000000, 127, NULL, 'tt0114885', b'0', 'en', 'Cheated on, mistreated and stepped on, the women are holding their breath, waiting for the elusive \"good man\" to break a string of less-than-stellar lovers. Friends and confidants Vannah, Bernie, Glo and Robin talk it all out, determined to find a better way to breathe.', 3, 'https://image.tmdb.org/t/p/w500/16XOMpEaLWkrcPqSQqhTmeJuqQl.jpg', '2065-12-23', 'Released', 'Waiting to Exhale', 34),
(6, 7, 60000000, 170, NULL, 'tt0113277', b'0', 'en', 'Obsessive master thief, Neil McCauley leads a top-notch crew on various insane heists throughout Los Angeles while a mentally unstable detective, Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.', 17, 'https://image.tmdb.org/t/p/w500/zMyfPUelumio3tiDKPffaUpsQTD.jpg', '2065-12-16', 'Released', 'Heat', 1886),
(7, 5, 0, 95, NULL, 'tt0113114', b'0', 'en', 'Jesse becomes reunited with Willy three years after the whale\'s jump to freedom as the teenager tries to rescue the killer whale and other orcas from an oil spill.', 7, 'https://image.tmdb.org/t/p/w500/yLyyjm4m3fSvbazyFv4RtUnb2uQ.jpg', '2065-07-20', 'Released', 'Free Willy 2 - The Adventure Home', 130),
(8, 6, 20000000, 107, NULL, 'tt0113243', b'0', 'en', 'Along with his new friends, a teenager who was arrested by the US Secret Service and banned from using a computer for writing a computer virus discovers a plot by a nefarious hacker, but they must use their computer skills to find the evidence while being pursued by the Secret Service and the evil computer genius behind the virus.', 14, 'https://image.tmdb.org/t/p/w500/uu62T87qkLkapeuu7ArlnQ6tAap.jpg', '2065-09-15', 'Released', 'Hackers', 406),
(9, 5, 55000000, 134, NULL, 'tt0113071', b'0', 'en', 'The timeless tale of King Arthur and the legend of Camelot are retold in this passionate period drama. Arthur is reluctant to hand the crown to Lancelot, and Guinevere is torn between her loyalty to her husband and her growing love for his rival. But Lancelot must balance his loyalty to the throne with the rewards of true love.', 15, 'https://image.tmdb.org/t/p/w500/8SRi8laZyPBdigx9qn7m3mriiRQ.jpg', '2065-07-08', 'Released', 'First Knight', 319),
(10, 5, 90000000, 96, NULL, 'tt0113492', b'0', 'en', 'In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.', 8, 'https://image.tmdb.org/t/p/w500/r17S4XlQ3Jq5U1KRovFUwU8P4aG.jpg', '2065-07-01', 'Released', 'Judge Dredd', 643),
(11, 4, 0, 88, NULL, 'tt0113500', b'0', 'en', 'When jobless Tommy Collins discovers that sequestered jurors earn free room and board as well as $5-a-day, he gets himself assigned to a jury in a murder trial. Once there, he does everything he can to prolong the trial and deliberations and make the sequestration more comfortable for himself.', 3, 'https://image.tmdb.org/t/p/w500/fOKuWVHR2M4xPjRwYl0bLHsdRHu.jpg', '2065-04-13', 'Released', 'Jury Duty', 34),
(12, 6, 0, 92, NULL, 'tt0113464', b'0', 'en', 'Jeffery, a young gay man in New York, decides that sex is too much and decided to become celibate. He immediately meets the man of his dreams and must decide whether or not love is worth the danger of a boyfriend dying.', 3, 'https://image.tmdb.org/t/p/w500/mdQd6vgt2sr8gCIVUucwxus29j1.jpg', '2065-08-19', 'Released', 'Jeffrey', 19),
(13, 7, 500000, 89, NULL, 'tt0113677', b'0', 'en', 'Film about filmmaking. It takes place during one day on set of non-budget movie. Ultimate tribute to all independent filmmakers.', 10, 'https://image.tmdb.org/t/p/w500/sWWb7tX3eEX7M0B7t89Gh9rDctX.jpg', '2065-01-21', 'Released', 'Living in Oblivion', 64),
(14, 5, 0, 119, NULL, 'tt0113690', b'0', 'en', 'During a routine case in L.A., NY private investigator Harry D\'Amour stumbles over members of a fanatic cult who are preparing for the resurrection of their leader Nix, a powerful magician who was killed 13 years earlier.', 4, 'https://image.tmdb.org/t/p/w500/9pwdoUes8V8ntTetsKtv2ThGeIm.jpg', '2065-08-26', 'Released', 'Lord of Illusions', 87),
(15, 6, 58000000, 127, NULL, 'tt0114319', b'0', 'en', 'An ugly duckling having undergone a remarkable change, still harbors feelings for her crush: a carefree playboy, but not before his business-focused brother has something to say about it.', 6, 'https://image.tmdb.org/t/p/w500/jQh15y5YB7bWz1NtffNZmRw0s9D.jpg', '2065-12-16', 'Released', 'Sabrina', 141),
(16, 6, 1500000, 91, NULL, 'tt0113540', b'0', 'en', 'A controversial portrayal of teens in New York City which exposes a deeply disturbing world of sex and substance abuse. The film focuses on a sexually reckless, freckle-faced boy named Telly, whose goal is to have sex with as many different girls as he can. When Jenny, a girl who has had sex only once, tests positive for HIV, she knows she contracted the disease from Telly. When Jenny discovers that Telly\'s idea of \"safe sex\" is to only have sex with virgins, and is continuing to pass the disease onto other unsuspecting girls, Jenny makes it her business to try to stop him.', 4, 'https://image.tmdb.org/t/p/w500/gMuV7ORN8rRfQPMImby8KRGihO2.jpg', '2065-07-29', 'Released', 'Kids', 280),
(17, 7, 0, 100, NULL, 'tt0107447', b'0', 'en', 'Dreary urban landscape of an anonymous Canadian city. Dark comedy about a group of twentysomethings looking for love and meaning in the \'90s. The film focuses on roommates David, a gay waiter who has has given up on his acting career, and Candy, a book reviewer who is also David\'s ex-lover. David and Candy\'s lives are entangled with those of David\'s friends and Candy\'s dates.', 0, 'https://image.tmdb.org/t/p/w500/wuCyRk9eult77MXmRnE9gkSjUnt.jpg', '2063-05-22', 'Released', 'Love & Human Remains', 7),
(18, 5, 0, 95, NULL, 'tt0113729', b'0', 'en', 'Matt falls for Casey, the new girl in school. She\'s fun-loving and eccentric, but there\'s a darkness to her whimsy that Matt can\'t begin to comprehend. When Casey attempts to commit suicide, her parents place her in a mental institution. Matt springs her out, and together the young lovers head on a road trip. They believe their love can \"cure\" Casey\'s problems. Matt starts to wonder, though, if are they inspired or misguided.', 2, 'https://image.tmdb.org/t/p/w500/yLq2bns665GyK5UcMXKUJmItm7F.jpg', '2065-05-27', 'Released', 'Mad Love', 27),
(19, 5, 0, 97, NULL, 'tt0112302', b'0', 'en', 'A mischievous young boy, Tom Sawyer, witnesses a murder by the deadly Injun Joe. Tom becomes friends with Huckleberry Finn, a boy with no future and no family. Tom has to choose between honoring a friendship or honoring an oath because the town alcoholic is accused of the murder. Tom and Huck go through several adventures trying to retrieve evidence.', 2, 'https://image.tmdb.org/t/p/w500/sGO5Qa55p7wTu7FJcX4H4xIVKvS.jpg', '2065-12-23', 'Released', 'Tom and Huck', 45),
(20, 5, 15000000, 92, 'http://www.powerrangers.com/', 'tt0113820', b'0', 'en', 'Power up with six incredible teens who out-maneuver and defeat evil everywhere as the Mighty Morphin Power Ranger, But this time the Power Rangers may have met their match, when they face off with the most sinister monster the galaxy has ever seen.', 7, 'https://image.tmdb.org/t/p/w500/A3ijhraMN0tvpDnPoyVP7NulkSr.jpg', '2065-07-01', 'Released', 'Mighty Morphin Power Rangers: The Movie', 153),
(21, 6, 6000000, 94, NULL, 'tt0113749', b'0', 'en', 'Both dumped by their girlfriends, two best friends seek refuge in the local mall.', 8, 'https://image.tmdb.org/t/p/w500/4saVIltqkhq9is5NmD7N87Q40M.jpg', '2065-10-21', 'Released', 'Mallrats', 400),
(22, 5, 0, 100, NULL, 'tt0113851', b'0', 'en', 'Four women who discover untapped strength within themselves when they finally let go of what divides them', 1, 'https://image.tmdb.org/t/p/w500/wLwkTj5DRVNUnKSsNHdoka4QPLF.jpg', '2065-09-30', 'Released', 'Moonlight and Valentino', 10),
(23, 5, 35000000, 106, NULL, 'tt0114576', b'0', 'en', 'International action superstar Jean Claude Van Damme teams with Powers Boothe in a Tension-packed, suspense thriller, set against the back-drop of a Stanley Cup game.Van Damme portrays a father whose daughter is suddenly taken during a championship hockey game. With the captors demanding a billion dollars by game\'s end, Van Damme frantically sets a plan in motion to rescue his daughter and abort an impending explosion before the final buzzer...', 5, 'https://image.tmdb.org/t/p/w500/eoWvKD60lT95Ss1MYNgVExpo5iU.jpg', '2065-12-23', 'Released', 'Sudden Death', 174),
(24, 5, 25000000, 97, NULL, 'tt0113481', b'0', 'en', 'A data courier, literally carrying a data package inside his head, must deliver it before he dies from the burden or is killed by the Yakuza.  In a dystopian 2021, Johnny (Keanu Reeves) is a data trafficker who has an implant that allows him to securely store data too sensitive for regular computer networks. On one delivery run, he accepts a package that not only exceeds the implant\'s safety limits - and will kill him if the data is not removed in time - but also contains information far more important and valuable than he had ever imagined. On a race against time, he must avoid the assassins sent to kill him and remove the data before it, too, ends his life.', 11, 'https://image.tmdb.org/t/p/w500/s9LyQtKhfUcQlZEw8hJLP6XqroO.jpg', '2065-05-27', 'Released', 'Johnny Mnemonic', 380),
(25, 5, 0, 93, NULL, 'tt0110620', b'0', 'en', 'This ultra-hip, post-modern vampire tale is set in contemporary New York City. Members of a dysfunctional family of vampires are trying to come to terms with each other, in the wake of their father\'s death. Meanwhile, they are being hunted by Dr. Van Helsing and his hapless nephew. As in all good vampire movies, forces of love are pitted against forces of destruction.', 7, 'https://image.tmdb.org/t/p/w500/bRz2J0jlMgczJptX0Atzo9l70Bd.jpg', '2064-09-14', 'Released', 'Nadja', 12),
(26, 5, 0, 103, NULL, 'tt0113986', b'0', 'en', 'When he finds out his longtime girlfriend is pregnant, a commitment-phobe realizes he might have to change his lifestyle for better or much, much worse.', 8, 'https://image.tmdb.org/t/p/w500/aYavA2TOqpWVcxQZ31mMlYKqoFM.jpg', '2065-07-13', 'Released', 'Nine Months', 171),
(27, 5, 22000000, 114, NULL, 'tt0113957', b'0', 'en', 'Angela Bennett is a freelance software engineer who lives in a world of computer technology. When a cyber friend asks Bennett to debug a new game, she inadvertently becomes involved in a conspiracy that will soon turn her life upside down. While on vacation in Mexico, her purse is stolen. She soon finds that people and events may not be what they seem as she becomes the target of an assassination. Her vacation is ruined.  She gets a new passport at the U.S. Embassy in Mexico but it has the wrong name, Ruth Marx. When she returns to the U.S. to sort things out, she discovers that Ruth Marx has an unsavory past and a lengthy  police record. To make matters worse, another person has assumed her real identity ...', 13, 'https://image.tmdb.org/t/p/w500/gKDNaAFzT21cSVeKQop7d1uhoSp.jpg', '2065-07-29', 'Released', 'The Net', 359),
(28, 5, 150000, 94, NULL, 'tt0114095', b'0', 'en', 'Although Mary has little income, she still finds ways to spend her nights at clubs. After being arrested for throwing an illegal rave, she asks her aunt Judy for bail money. Judy then finds Mary a job at her library so that Mary can repay her. Initially, Mary finds the job as a clerk boring and stifling, and prefers to get to know a street food vendor whom she likes. However, Mary must refocus her life once she loses her job and apartment.', 1, 'https://image.tmdb.org/t/p/w500/iYM0EdHrcbu8rhkDKVBkDcZEo8t.jpg', '2065-06-10', 'Released', 'Party Girl', 14),
(29, 6, 8, 98, NULL, 'tt0114194', b'0', 'en', 'The angel Gabriel comes to Earth to collect a soul which will end the stalemated war in Heaven, and only a former priest and a little girl can stop him.', 10, 'https://image.tmdb.org/t/p/w500/A3aYGp8LLxuFdzG2ETnhfbWPk7h.jpg', '2065-09-02', 'Released', 'The Prophecy', 139),
(30, 6, 62000000, 106, NULL, 'tt0112346', b'0', 'en', 'Widowed U.S. president Andrew Shepherd, one of the world\'s most powerful men, can have anything he wants -- and what he covets most is Sydney Ellen Wade, a Washington lobbyist. But Shepherd\'s attempts at courting her spark wild rumors and decimate his approval ratings.', 6, 'https://image.tmdb.org/t/p/w500/lymPNGLZgPHuqM29rKMGV46ANij.jpg', '2065-11-18', 'Released', 'The American President', 199),
(31, 5, 0, 88, NULL, 'tt0112896', b'0', 'en', 'When a lawyer shows up at the vampire\'s doorstep, he falls prey to his charms and joins him in his search for fresh blood. Enter Dr. van Helsing, who may be the only one able to vanquish the count.', 5, 'https://image.tmdb.org/t/p/w500/xve4cgfYItnOhtzLYoTwTVy5FGr.jpg', '2065-12-23', 'Released', 'Dracula: Dead and Loving It', 210),
(32, 10, 0, 91, NULL, 'tt0114241', b'0', 'en', 'On Christmas eve, a relentlessly cheerful woman escapes from the killers hired by her husband, and embarks on a series of strange encounters.', 0, 'https://image.tmdb.org/t/p/w500/mIEtFo5z8G6b0r2mxHjfIWT7vy7.jpg', '2065-11-18', 'Released', 'Reckless', 1),
(33, 7, 0, 119, NULL, 'tt0114323', b'0', 'en', 'Carol, a typical upper middle-class housewife, begins to complain of vague symptoms of illness. She \"doesn\'t feel right,\" has unexplained headaches, congestion, a dry cough, nosebleeds, vomiting, and trouble breathing. Her family doctor treats her concerns dismissively and suggests a psychiatrist. Eventually, an allergist tells her that she has Environmental Illness.', 8, 'https://image.tmdb.org/t/p/w500/ihX2udk636JMAAaWDIMj6n5ejhb.jpg', '2065-06-24', 'Released', 'Safe', 62),
(34, 5, 50000000, 135, NULL, 'tt0114345', b'0', 'en', 'Set in puritanical Boston in the mid 1600s, the story of seamstress Hester Prynne, who is outcast after she becomes pregnant by a respected reverend. She refuses to divulge the name of the father, is \"convicted\" of adultery and forced to wear a scarlet \"A\" until an Indian attack unites the Puritans and leads to a reevaluation of their laws and morals.', 6, 'https://image.tmdb.org/t/p/w500/g46rChf49Qgq28RJ22iWwvsK7nO.jpg', '2065-10-14', 'Released', 'The Scarlet Letter', 111),
(35, 5, 0, 93, NULL, 'tt0114435', b'0', 'en', 'A documentary about the culture of hip-hop. Through interviews with some of hip-hops biggest names, the film makers attempt to find out why it has become so popular.', 0, 'https://image.tmdb.org/t/p/w500/qUlVaRYuiMvr1R3ZBW6hpS9QB4h.jpg', '2065-08-26', NULL, 'The Show', 2),
(36, 7, 7000000, 112, NULL, 'tt0114478', b'0', 'en', 'Writer Paul Benjamin is nearly hit by a bus when he leaves Auggie Wren\'s smoke shop. Stranger Rashid Cole  saves his life, and soon middle-aged Paul tells homeless Rashid that he wouldn\'t mind a short-term housemate. Still grieving over his wife\'s murder, Paul is moved by both Rashid\'s quest to reconnect with his father and Auggie\'s discovery that a woman who might be his daughter is about to give birth.', 5, 'https://image.tmdb.org/t/p/w500/dku3aLprH3j1ilSsubW9Pbgfe0y.jpg', '2065-06-10', 'Released', 'Smoke', 115),
(37, 4, 45000000, 128, NULL, 'tt0114436', b'0', 'en', 'A young drifter named Nomi arrives in Las Vegas to become a dancer and soon sets about clawing and pushing her way to become a top showgirl.', 17, 'https://image.tmdb.org/t/p/w500/7O2SxrsXYaGFZ5cZgJF0Ab5SV5J.jpg', '2065-09-23', 'Released', 'Showgirls', 261),
(38, 6, 2, 95, NULL, 'tt0110604', b'0', 'en', 'Billy is mute, but it hasn\'t kept her from becoming a successful makeup artist. While in Russia, working on a film directed by her sister\'s boyfriend, Andy, Billy finds herself trapped in the studio one night and is horrified to see a snuff film being made. Billy escapes and, with the help of her sister, Kate, alerts authorities about what she saw. Unfortunately, in doing so, she makes an enemy of the Russian mafia, who funded the snuff film.', 2, 'https://image.tmdb.org/t/p/w500/1AJujK1IjuyxvIG8pjmef9qJsnQ.jpg', '2065-09-29', 'Released', 'Mute Witness', 36),
(39, 5, 0, 106, NULL, 'tt0114496', b'0', 'en', 'In one of her best-ever roles, Julia Roberts is Grace, whose reaction to the infidelities of Eddie (Dennis Quaid) turns the lives and loves of the people around her into something like falling dominoes. Robert Duvall, Gena Rowlands, Kyra Sedgwick and others in \"the year\'s best ensemble of characters\" (Jack Matthews, \'Newsday\') co-star in this juicy, truthful story written by Callie Khouri', 3, 'https://image.tmdb.org/t/p/w500/p9qioRaQblGXemFRQSwo8TpikVJ.jpg', '2065-08-05', 'Released', 'Something to Talk About', 60),
(40, 6, 58000000, 130, 'http://www.mgm.com/view/movie/757/Goldeneye/', 'tt0113189', b'0', 'en', 'James Bond must unmask the mysterious head of the Janus Syndicate and prevent the leader from utilizing the GoldenEye weapons system to inflict devastating revenge on Britain.', 14, 'https://image.tmdb.org/t/p/w500/5c0ovjT41KnYIHYuF4AWsTe3sKh.jpg', '2065-11-17', 'Released', 'GoldenEye', 1194),
(41, 6, 0, 109, NULL, 'tt0114534', b'0', 'en', 'The setting is early America during the oil boom. An elderly, down on his luck \'oil man\', Mr. Cox finds himself in the town of Henrietta. Using unconventional methods, he convinces himself and local Don Day that there is oil on Day\'s land. The financially strapped Day puts everything into finding oil...but at what cost?', 0, 'https://image.tmdb.org/t/p/w500/5mkH38tcztyLy6CeAWHD1FC8ozC.jpg', '2065-09-16', 'Released', 'The Stars Fell on Henrietta', 6),
(42, 6, 42000000, 145, 'http://www.strange-days.com', 'tt0114558', b'0', 'en', 'Set in the year 1999 during the last days of the old millennium, the movie tells the story of Lenny Nero, an ex-cop who now deals with data-discs containing recorded memories and emotions. One day he receives a disc which contains the memories of a murderer killing a prostitute. Lenny investigates and is pulled deeper and deeper in a whirl of blackmail, murder and rape. Will he survive and solve the case?', 11, 'https://image.tmdb.org/t/p/w500/rXvy5hG9OeVmgnv9w4IhQxhqEKD.jpg', '2065-10-14', 'Released', 'Strange Days', 334),
(43, 6, 0, 115, NULL, 'tt0114663', b'0', 'en', 'While Jane Holman (Mastrantonio) is driving with her two sons, she accidentally runs into a drifter, Jack McCloud (Swayze), who breaks his leg. Being responsible,  Jane invites Jack, and his dog, to stay at her home until his leg has healed.  Jack struggles to adapt their lifestyle, and finds himself loved by the family. He starts teaching baseball to Tom, who misses his father, who was lost in the Korean war. Jack and Tom develop a strong bond of friendship. Meanwhile, Gunny believes that there is more to Jack and Betty Jane than meets the eye...  We learn that Jack, is Jack McCloud, a Star White Socks baseball player in 1941, who dropped out of the league, after his first season, and; \"was never heard from again\" ...  A wonderful story.  We witness magic between a boy\'s imagination, and Jack\'s dog, and are never sure if we are witnessing imagination or magic by the dog.  A story of friendship, family, and learning that life isn\'t always as cut and dried as we often believe.', 11, 'https://image.tmdb.org/t/p/w500/ub79b63JJV4oeHwomSy5OS5fVsr.jpg', '2065-10-28', 'Released', 'Three Wishes', 18),
(44, 7, 44000000, 192, NULL, 'tt0113987', b'0', 'en', 'An all-star cast powers this epic look at American President Richard M. Nixon, a man carrying the fate of the world on his shoulders while battling the self-destructive demands within. Spanning his troubled boyhood in California to the shocking Watergate scandal that would end his presidency.', 5, 'https://image.tmdb.org/t/p/w500/cICkmCEiXRhvZmbuAlsA5D9B2rK.jpg', '2065-12-23', 'Released', 'Nixon', 72),
(45, 6, 0, 111, NULL, 'tt0114702', b'0', 'en', 'Young, wild poet Arthur Rimbaud and his mentor Paul Verlaine engage in a fierce, forbidden romance while feeling the effects of a hellish artistic lifestyle.', 4, 'https://image.tmdb.org/t/p/w500/BTGFfPHySJtw2qBoLysz3ercDB.jpg', '2065-11-03', 'Released', 'Total Eclipse', 112),
(46, 7, 0, 78, NULL, 'tt0112453', b'0', 'en', 'An outcast half-wolf risks his life to prevent a deadly epidemic from ravaging Nome, Alaska.', 12, 'https://image.tmdb.org/t/p/w500/gV5PCAVCPNxlOLFM1bKk50EqLXO.jpg', '2065-12-23', 'Released', 'Balto', 423),
(47, 7, 0, 91, NULL, 'tt0058450', b'0', 'fr', 'This simple romantic tragedy begins in 1957. Guy Foucher, a 20-year-old French auto mechanic, has fallen in love with 17-year-old GeneviÃ¨ve Emery, an employee in her widowed mother\'s chic but financially embattled umbrella shop. On the evening before Guy is to leave for a two-year tour of combat in Algeria, he and GeneviÃ¨ve make love. She becomes pregnant and must choose between waiting for Guy\'s return or accepting an offer of marriage from a wealthy diamond merchant.', 8, 'https://image.tmdb.org/t/p/w500/ju5W8qvWfjXXGaR7wd9wSyuYXhS.jpg', '2034-02-20', 'Released', 'Les parapluies de Cherbourg', 119),
(48, 6, 0, 105, NULL, 'tt0114682', b'0', 'en', 'Three New York drag queens on their way to Hollywood for a beauty pageant get stranded in a small Midwestern town for the entire weekend when their car breaks down. While waiting for parts for their Cadillac convertible, the flamboyant trio shows the local homophobic rednecks that appearing different doesn\'t mean they don\'t have humanity in common.', 7, 'https://image.tmdb.org/t/p/w500/xIDEoG9FQGmMCh5XsbkvSuD8WrW.jpg', '2065-09-08', 'Released', 'To Wong Foo, Thanks for Everything! Julie Newmar', 117),
(49, 5, 60000000, 100, NULL, 'tt0114781', b'0', 'en', 'A passenger train has been hijacked by an electronics expert and turned into an untraceable command center for a weapons satellite. He has planned to blow up Washington DC and only one man can stop him, former Navy SEAL Casey Ryback.', 7, 'https://image.tmdb.org/t/p/w500/6Z1p71nkm45cYuIZWOx5JSCYc0o.jpg', '2065-07-14', 'Released', 'Under Siege 2: Dark Territory', 217),
(50, 5, 98000000, 119, NULL, 'tt0112760', b'0', 'en', 'Morgan Adams and her slave, William Shaw, are on a quest to recover the three portions of a treasure map. Unfortunately, the final portion is held by her murderous uncle, Dawg. Her crew is skeptical of her leadership abilities, so she must complete her quest before they mutiny against her. This is made yet more difficult by the efforts of the British crown to end her pirate raids.', 7, 'https://image.tmdb.org/t/p/w500/odM9973kIv9hcjfHPp6g6BlyTIJ.jpg', '2065-12-23', 'Released', 'Cutthroat Island', 137),
