(53, 5, 175000000, 135, NULL, 'tt0114898', b'0', 'en', 'In a futuristic world where the polar ice caps have melted and made Earth a liquid planet, a beautiful barmaid rescues a mutant seafarer from a floating island prison. They escape, along with her young charge, Enola, and sail off aboard his ship. But the trio soon becomes the target of a menacing pirate who covets the map to \'Dryland\' â which is tattooed on Enola\'s back.', 16, 'https://image.tmdb.org/t/p/w500/yordVJcPLh3VNRL7bXzFIBEhXRr.jpg', '2065-07-29', 'Released', 'Waterworld', 1017),
