(55, 5, 8000000, 89, NULL, 'tt0114928', b'0', 'en', 'The story takes place in alternative America where the blacks are members of social elite, and whites are inhabitants of inner city ghettos. Louis Pinnock is a white worker in a chocolate factory, loving husband and father of two children. While delivering a package for black CEO Thaddeus Thomas, he is mistaken for a voyeur and, as a result, loses his job, gets beaten by black cops and his family gets evicted from their home. Desperate Pinnock takes a gun and kidnaps Thomas, demanding justice.', 1, 'https://image.tmdb.org/t/p/w500/aaFpmILNyNSReVgzKGFu8iKNYzi.jpg', '2065-12-02', 'Released', 'White Man\'s Burden', 25),
(56, 5, 35000000, 108, NULL, 'tt0114508', b'0', 'en', 'In 1993, the Search for Extra Terrestrial Intelligence Project receives a transmission detailing an alien DNA structure, along with instructions on how to splice it with human DNA. The result is Sil, a sensual but deadly creature who can change from a beautiful woman to an armour-plated killing machine in the blink of an eye.', 13, 'https://image.tmdb.org/t/p/w500/94P6kzKH8aPmQmPr9yZjgy7BtQQ.jpg', '2065-07-08', 'Released', 'Species', 457),
(57, 7, 16500000, 136, NULL, 'tt0114388', b'0', 'en', 'Rich Mr. Dashwood dies, leaving his second wife and her daughters poor by the rules of inheritance. Two daughters are the titular opposites.', 10, 'https://image.tmdb.org/t/p/w500/lA9HTy84Bb6ZwNeyoZKobcMdpMc.jpg', '2065-12-14', 'Released', 'Sense and Sensibility', 364),
(58, 5, 30000000, 98, NULL, 'tt0114938', b'0', 'en', 'Biopic about famous gunslinger Wild Bill Hickock. The early career of legendary lawman is telescoped and culminates in his relocation in Deadwood and a reunion with Calamity Jane.', 8, 'https://image.tmdb.org/t/p/w500/qIgslXL0NDtSlcHxISACLwWbkRJ.jpg', '2065-12-02', 'Released', 'Wild Bill', 27),
(59, 4, 0, 90, NULL, 'tt0112602', b'0', 'en', 'A inept courier realises he has been used by criminals to deliver money. On the run from both the criminals and police, he poses as a Scout leader and leads a scout group on a hike through the mountains.', 3, 'https://image.tmdb.org/t/p/w500/A4UQ0y2kj4ZXrBP0MXYazd69xp2.jpg', '2065-08-05', 'Released', 'Bushwhacked', 29),
(60, 6, 0, 93, NULL, 'tt0114798', b'0', 'en', 'Steven Lidz, unhappy with his home life since his mother got sick, goes and lives with his two crazy Uncles. There he changes and gets closer to his Uncles, but his parents want him home even though he is finally happy and popular. Written by Todd Weiser', 2, 'https://image.tmdb.org/t/p/w500/puMRjRJYE5TX1ffwuqoLXW9iLqq.jpg', '2065-09-16', 'Released', 'Unstrung Heroes', 9),
(61, 6, 0, 97, NULL, 'tt0109340', b'0', 'en', 'Andrew Crocker-Harris is an embittered and disliked teacher of Greek and Latin at a British prep school. After nearly 20 years of service, he is being forced to retire on the pretext of his health, and perhaps may not even be given a pension. The boys regard him as a Hitler, with some justification. His wife Laura is unfaithful, and lives to wound him any way she can. Andrew must come to terms with his failed life and regain at least his own self-respect.', 3, 'https://image.tmdb.org/t/p/w500/xjWc2uWrcGLwC87JN2CbxseGKQ.jpg', '2064-10-13', 'Released', 'The Browning Version', 11),
(62, 6, 2800000, 135, NULL, 'tt0111579', b'0', 'ru', 'Russia, 1936: revolutionary hero Colonel Kotov is spending an idyllic summer in his dacha with his young wife and six-year-old daughter Nadia and other assorted family and friends. Things change dramatically with the unheralded arrival of Cousin Dmitri from Moscow, who charms the women and little Nadia with his games and pianistic bravura. But Kotov isn\'t fooled: this is the time of Stalin\'s repression, with telephone calls in the middle of the night spelling doom - and he knows that Dmitri isn\'t paying a social call...', 2, 'https://image.tmdb.org/t/p/w500/e7bE9BiLyKaZtNF3Q2ro8gVCEQA.jpg', '2064-05-02', 'Released', 'Ð£ÑÐ¾Ð¼Ð»ÑÐ½Ð½ÑÐµ ÑÐ¾Ð»Ð½ÑÐµÐ¼', 35),
(63, 6, 0, 73, NULL, 'tt0114805', b'0', 'en', 'Using a variety of cinematographic techniques, the world of high- profile fashion designer Issac Mizrahi is portrayed as being driven by excitement and creativity, despite the concomitant chaos and cacophony. Mizrahi\'s frenzied genius and rollercoaster emotions paint a humorous and personal portrait of a brilliant designer. Famous \"SuperModels\", actors, and actresses populate Issac\'s rarified world, but Douglas Keeve\'s cameras capture the stress and turbulence beneath the placid coolness of glamour. Written by Tad Dibbern', 0, 'https://image.tmdb.org/t/p/w500/5fY5iN8mUBLdd4fmcXwdTqAZ9Sx.jpg', '2065-08-12', 'Released', 'Unzipped', 6),
(64, 4, 0, 90, NULL, 'tt0112438', b'0', 'en', 'Jennifer (Alicia Silverstone) is a lovely teen who has been hired to baby-sit the kids of Harry Tucker (J.T. Walsh) and his wife, Dolly (Lee Garlington). The Tuckers go to a party and proceed to get inebriated, with Mr. Tucker fantasizing about his beautiful baby sitter. Meanwhile, Jack (Jeremy London), her boyfriend, and Mark (Nicky Katt), another guy interested in her, decide to spy on Jennifer at the Tucker house, with each young man also fixated on her.', 2, 'https://image.tmdb.org/t/p/w500/hUfKMTLCIK7OwLYX58TfY8APwRm.jpg', '2065-10-18', 'Released', 'The Babysitter', 27),
(65, 6, 21000000, 115, NULL, 'tt0112571', b'0', 'en', 'After breaking up with her girlfriend, a nightclub singer, Jane, answers a personal ad from Robin, a real estate agent with AIDS, seeking a cross-country travel partner. On their journey from New York City to Los Angeles, the two stop by Pittsburgh to pick up Robin\'s friend Holly, who is trying to escape an abusive relationship. With three distinct personalities, the women must overcome their differences to help one another.', 3, 'https://image.tmdb.org/t/p/w500/dcgbt8FkRLvQjaheVlylPSQeTKC.jpg', '2065-02-04', 'Released', 'Boys on the Side', 48),
(66, 6, 10000000, 89, NULL, 'tt0112508', b'0', 'en', 'Billy Madison is the 27 year-old son of Bryan Madison, a very rich man who has made his living in the hotel industry. Billy stands to inherit his father\'s empire but only if he can make it through all 12 grades, 2 weeks per grade, to prove that he has what it takes to run the family business.', 6, 'https://image.tmdb.org/t/p/w500/5mP8F0NYSVrwrlWRCSD4uywMNnX.jpg', '2065-02-11', 'Released', 'Billy Madison', 464),
(67, 7, 0, 97, NULL, 'tt0112757', b'0', 'en', 'Dexter, age 11, who has AIDS, and his next door neighbor Eric, a little older and much bigger, become best friends. Eric also becomes closer to Dexter\'s mother than to his own, who is neglectful and bigoted and violently forbids their friendship upon learning of it. Dexter and Erik start the journey to find \"The Cure\" they had read about in the local newspaper.', 2, 'https://image.tmdb.org/t/p/w500/keUrRrUsmALR7kOTSdrOIDcO67z.jpg', '2065-04-22', 'Released', 'The Cure', 58),
(68, 5, 0, 95, NULL, 'tt0112643', b'0', 'en', 'John has inherited a castle and Italy and he moves there with his wife Susan and their blind daughter Rebecca. What they don\'t realize is that there is somebody else in the castle. An abused child left to die in the basement who has now become the castle freak and is out to wreak havoc.', 2, 'https://image.tmdb.org/t/p/w500/eeO3BIHJoI3sabtkqfYOStdbOwm.jpg', '2065-08-05', 'Released', 'Castle Freak', 40),
(69, 6, 0, 103, NULL, 'tt0112679', b'0', 'en', '\'Circle Of Friends\' is set in 1950\'s Ireland. The movie focuses on Benny Hogan and her best friend, Eve Malone. The story centers around Benny and Eve as they enter student life at University College, Dublin. Here Benny and Eve reunite with their childhood friend, the ice-cool Nan Mahon, the \'college belle\'. They also encounter the handsome and charming Jack Foley, whom Benny quickly falls for.', 2, 'https://image.tmdb.org/t/p/w500/6T3hCdOWU49Y0hmuzceARU5yS5x.jpg', '2065-03-17', 'Released', 'Circle of Friends', 30),
(70, 7, 27000, 92, 'http://www.miramax.com/movie/clerks/', 'tt0109445', b'0', 'en', 'Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.', 10, 'https://image.tmdb.org/t/p/w500/dmNytzvQTjylI83qrgDoS1KQ0ev.jpg', '2064-09-14', 'Released', 'Clerks', 769),
(71, 6, 30000000, 90, NULL, 'tt0112281', b'0', 'en', 'Summoned from an ashram in Tibet, Ace finds himself on a perilous journey into the jungles of Africa to find Shikaka, the missing sacred animal of the friendly Wachati tribe. He must accomplish this before the wedding of the Wachati\'s Princess to the prince of the warrior Wachootoos. If Ace fails, the result will be a vicious tribal war.', 8, 'https://image.tmdb.org/t/p/w500/wRlGnJhEzcxBjvWtvbjhDSU1cIY.jpg', '2065-11-11', 'Released', 'Ace Ventura: When Nature Calls', 1128),
(72, 5, 55000000, 123, NULL, 'tt0109635', b'0', 'en', 'A computer specialist is sued for sexual harassment by a former lover turned boss who initiated the act forcefully, which threatens both his career and his personal life.', 11, 'https://image.tmdb.org/t/p/w500/qbwcjmHnXkeE8l7wNBsdnlrp3J4.jpg', '2064-12-10', 'Released', 'Disclosure', 217),
(73, 6, 25000000, 97, NULL, 'tt0112883', b'0', 'en', 'John Arnold DeMarco is a man who believes he is Don Juan, the greatest lover in the world. Clad in a cape and mask, DeMarco undergoes psychiatric treatment with Dr. Jack Mickler to cure him of his apparent delusion. But the psychiatric sessions have an unexpected effect on the psychiatric staff and, most profoundly, Dr Mickler, who rekindles the romance in his complacent marriage.', 7, 'https://image.tmdb.org/t/p/w500/fe0TuYz9jCKUba2Omj48K8bWJ8z.jpg', '2064-10-02', 'Released', 'Don Juan DeMarco', 184),
(74, 5, 60000000, 103, NULL, 'tt0113845', b'0', 'en', 'A vengeful New York transit cop decides to steal a trainload of subway fares; his foster brother, a fellow cop, tries to protect him.', 7, 'https://image.tmdb.org/t/p/w500/jSozzzVOR2kfXgTUuGnbgG2yRFi.jpg', '2065-11-22', 'Released', 'Money Train', 224),
(75, 7, 0, 113, NULL, 'tt0110882', b'0', 'en', 'The circularity of violence seen in a story that circles on itself. In Macedonia, during war in Bosnia, Christians hunt an ethnic Albanian girl who may have murdered one of their own. A young monk who\'s taken a vow of silence offers her protection. In London, a photographic editor who\'s pregnant needs to talk it out with her estranged husband and chooses a toney restaurant.', 3, 'https://image.tmdb.org/t/p/w500/aIll5MvOZmUCmiwuGWMlaHRj2gj.jpg', '2064-06-10', 'Released', 'Before the Rain', 45),
