(77, 5, 45000000, 101, NULL, 'tt0109676', b'0', 'en', 'A team of skydiving crooks led by DEA-agent-turned-bad Ty Moncrief (Busey) specialize in landing on police roofs and breaking in so their evil computer nerd can steal undercover agents\' files and sell them to drug lords. Federal Marshal Pete Nessip (Snipes) lost a brother to this crew and learns skydiving with the help of tough-but-lovable instructor Jessie Crossmann (Butler) so he can track them down.', 9, 'https://image.tmdb.org/t/p/w500/pVgdUHeIVEILyRISE4ysA8I6a8T.jpg', '2064-12-09', 'Released', 'Drop Zone', 91),
