(79, 6, 30250000, 105, NULL, 'tt0113161', b'0', 'en', 'Chili Palmer is a Miami mobster who gets sent by his boss, the psychopathic \"Bones\" Barboni, to collect a bad debt from Harry Zimm, a Hollywood producer who specializes in cheesy horror films. When Chili meets Harry\'s leading lady, the romantic sparks fly. After pitching his own life story as a movie idea, Chili learns that being a mobster and being a Hollywood producer really aren\'t all that different.', 12, 'https://image.tmdb.org/t/p/w500/vWtDUUgQAsVyvRW4mE75LBgVm2e.jpg', '2065-10-21', 'Released', 'Get Shorty', 305),
(80, 6, 16000000, 107, NULL, 'tt0109686', b'0', 'en', 'Lloyd and Harry are two men whose stupidity is really indescribable. When Mary, a beautiful woman, loses an important suitcase with money before she leaves for Aspen, the two friends (who have found the suitcase) decide to return it to her. After some \"adventures\" they finally get to Aspen where, using the lost money they live it up and fight for Mary\'s heart.', 9, 'https://image.tmdb.org/t/p/w500/3PEAkZHa8ehfUkuKbzmQNRTTAAs.jpg', '2064-12-17', 'Released', 'Dumb and Dumber', 1894),
(81, 7, 0, 132, NULL, 'tt0109642', b'0', 'en', 'Dolores Claiborne was accused of killing her abusive husband twenty years ago, but the court\'s findings were inconclusive and she was allowed to walk free. Now she has been accused of killing her employer, Vera Donovan, and this time there is a witness who can place her at the scene of the crime. Things look bad for Dolores when her daughter Selena, a successful Manhattan magazine writer, returns to cover the story.', 5, 'https://image.tmdb.org/t/p/w500/ewmVWV0TP8LTlYZ4OzCcguwC9d1.jpg', '2065-03-25', 'Released', 'Dolores Claiborne', 183),
(82, 6, 0, 124, NULL, 'tt0112722', b'0', 'en', 'An agoraphobic psychologist and a female detective must work together to take down a serial killer who copies serial killers from the past.', 10, 'https://image.tmdb.org/t/p/w500/80czeJGSoik22fhtUM9WzyjUU4r.jpg', '2065-10-28', 'Released', 'Copycat', 199),
(83, 7, 0, 123, NULL, 'tt0111797', b'0', 'zh', 'The film tells the story of a retired and widowed Chinese master chef Chu (Si Hung Lung) and his family living in modern day Taipei, Taiwan. At the start of the film, he lives with his three attractive daughters, all of whom are unattached. As the film progresses, each of the daughters encounters new men in their lives. When these new relationships blossom, the stereotypes are broken and the living situation within the family changes.. The film features several scenes displaying the techniques and artistry of gourmet Chinese cooking. Since the family members have difficulty expressing their love for each other, the intricate preparation of banquet quality dishes for their Sunday dinners is the surrogate for their familial feelings.', 4, 'https://image.tmdb.org/t/p/w500/jGjSu9zlR2I8t6OE54uxSJ7M25p.jpg', '2064-08-04', 'Released', 'é£²é£ç·å¥³', 76),
(84, 5, 0, 0, NULL, 'tt0112854', b'0', 'it', 'Johnny Destiny burns into Las Vegas in his hot Plymouth RoadRunner, stopping only to pick up a stranger stranded in the desert. But then, things aren\'t always as they seem. Anything can happen in that town of many possibilities...especially since there\'s been some weird electrical disturbances. As the stranger, fresh out of prison, tries to put his life back together--to recover his money from an old bank heist and the girl he lost in doing the job--something keeps interfering with his plans. Is it fate...or just Destiny?', 0, 'https://image.tmdb.org/t/p/w500/9iczUcmMLnOZ4Ltx3X3AEpbxTt4.jpg', '2065-04-29', 'Released', 'Destiny Turns on the Radio', 9),
(85, 6, 50000000, 132, NULL, 'tt0112401', b'0', 'en', 'Assassin Robert Rath arrives at a funeral to kill a prominent mobster, only to witness a rival hired gun complete the job for him -- with grisly results. Horrified by the murder of innocent bystanders, Rath decides to take one last job and then return to civilian life. But finding his way out of the world of contract killing grows ever more dangerous as Rath falls for his female target and becomes a marked man himself.', 11, 'https://image.tmdb.org/t/p/w500/xAx5MP7Dg4y85pyS7atX6eWk4Qd.jpg', '2065-10-07', 'Released', 'Assassins', 394),
(86, 7, 0, 103, NULL, 'tt0109579', b'0', 'en', 'A political activist is convinced that her guest is a man who once tortured her for the government.', 5, 'https://image.tmdb.org/t/p/w500/3p1K153ZbRV7FNyi4DNnzHfxJZa.jpg', '2064-05-05', 'Released', 'Death and the Maiden', 92),
(87, 4, 0, 113, NULL, 'tt0109758', b'0', 'en', 'Elliot is going to the island of Eden to live out his submissive fantasies, but inadvertently photographs diamond smugglers at work. Smugglers, and detectives, follow him to the island, where they try to retrieve the film. Elliot begins falling in love with Lisa, the head mistress of the island, and Lisa must evaluate her feelings about Elliot and her own motivations.', 4, 'https://image.tmdb.org/t/p/w500/9oIEKFVPhgVEzbcbRPDXCdkUgRN.jpg', '2064-10-15', 'Released', 'Exit to Eden', 28),
(88, 6, 4000000, 98, NULL, 'tt0113101', b'0', 'en', 'It\'s Ted the Bellhop\'s first night on the job...and the hotel\'s very unusual guests are about to place him in some outrageous predicaments. It seems that this evening\'s room service is serving up one unbelievable happening after another.', 9, 'https://image.tmdb.org/t/p/w500/eQs5hh9rxrk1m4xHsIz1w11Ngqb.jpg', '2065-12-10', 'Released', 'Four Rooms', 539),
(89, 6, 0, 111, NULL, 'tt0114168', b'0', 'en', 'Harassed by classmates who won\'t accept his shocking appearance, a shy young man known as \"Powder\" struggles to fit in. But the cruel taunts stop when Powder displays a mysterious power that allows him to do incredible things. This phenomenon changes the lives of all those around him in ways they never could have imagined.', 12, 'https://image.tmdb.org/t/p/w500/1uRKsxOCtgz0xVqs9l4hYtp4dFm.jpg', '2065-10-28', 'Released', 'Powder', 143),
(90, 6, 0, 111, NULL, 'tt0113117', b'0', 'en', 'French Kiss is director Kasdanâs best film since the Bodyguard. The plot involves a couple in love and one womanâs attempt to fly to Paris to get her lover back from a business trip and marry him. On the way she unknowingly smuggles something of value that has a petty thief chasing her across France as she chases after her future husband.', 9, 'https://image.tmdb.org/t/p/w500/bZqvonwVru1XtnniQZgZRa3Znyk.jpg', '2065-05-06', 'Released', 'French Kiss', 179),
(91, 7, 18000000, 127, NULL, 'tt0109707', b'0', 'en', 'The mostly true story of the legendary \"worst director of all time\", who, with the help of his strange friends, filmed countless B-movies without ever becoming famous or successful.', 11, 'https://image.tmdb.org/t/p/w500/9qBe2sUDyY2dFH1iHq0SZb1G4QG.jpg', '2064-09-28', 'Released', 'Ed Wood', 639),
(92, 6, 0, 101, NULL, 'tt0113097', b'0', 'en', 'Mickey Gordon is a basketball referee who travels to France to bury his father. Ellen Andrews is an American living in Paris who works for the airline he flies on. They meet and fall in love, but their relationship goes through many difficult patches. The story is told in flashback by their friends at a restaurant waiting for them to arrive.', 16, 'https://image.tmdb.org/t/p/w500/l8lq77bNqJY94JCMPI731jwtDsE.jpg', '2065-05-20', 'Released', 'Forget Paris', 38),
(93, 5, 0, 87, NULL, 'tt0113028', b'0', 'en', 'Teenager Angus adopts a stray dog and names him Yellow. Several days later, while travelling along the coast of British Columbia with Angus\'s father, John, the boy and dog become stranded when turbulent waters capsize their boat. Angus\'s parents relentlessly badger rescue teams. Angus, schooled by his father in wilderness survival skills, and assisted by the intelligent Yellow Dog, tries to attract rescuers.', 2, 'https://image.tmdb.org/t/p/w500/oDufYQrDhdAsJlwQUnjY9wHRWgL.jpg', '2065-01-14', 'Released', 'Far from Home: The Adventures of Yellow Dog', 27),
