(95, 6, 0, 96, NULL, 'tt0113089', b'0', 'en', 'Workaholic Thomas Johnson dies in an auto accident and comes back to life as a dog. Remembering some of who he was, he returns to his wife and son to protect them from the man who caused his accident. But, as time goes by, he remembers more of his life, and realizes he wasn\'t such a good husband and father.', 4, 'https://image.tmdb.org/t/p/w500/W9QVHIH4n8X8OLWyEqbzBTfhfD.jpg', '2065-06-03', 'Released', 'Fluke', 48),
(96, 6, 0, 103, NULL, 'tt0109759', b'0', 'en', 'In the upscale Toronto strip club Exotica, dancer Christina is visited nightly by the obsessive Francis, a depressed tax auditor. Her ex-boyfriend, the club\'s MC, Eric, still jealously pines for her even as he introduces her onstage, but Eric is having his own relationship problems with the club\'s owner, Zoe. Meanwhile Thomas, a mysterious pet-shop owner, is about to become unexpectedly involved in their lives. Gradually, connections between the traumatic pasts of these characters are revealed.', 5, 'https://image.tmdb.org/t/p/w500/oIwrh7QhwUNxejsvgKtFG4V0gaQ.jpg', '2064-09-25', 'Released', 'Exotica', 64),
(97, 5, 15000000, 103, NULL, 'tt0113303', b'0', 'en', 'Hatch Harrison, his wife, Lindsey, and their daughter, Regina, are enjoying a pleasant drive when a car crash leaves wife and daughter unharmed but kills Hatch. However, an ingenious doctor, Jonas Nyebern, manages to revive Hatch after two lifeless hours. But Hatch does not come back unchanged. He begins to suffer horrible visions of murder -- only to find out the visions are the sights of a serial killer.', 8, 'https://image.tmdb.org/t/p/w500/oVaurD05v55CklwT62uZwENXDw1.jpg', '2065-03-04', 'Released', 'Hideaway', 24),
(98, 5, 0, 77, NULL, 'tt0113234', b'0', 'en', 'The band is back together! Gumby reunites with The Clayboys to perform at a concert benefiting local farmers. But things take an unexpected turn when Gumby s dog, Lowbelly, reacts to the music by crying tears of real pearl! Fortune turns into disaster as Gumby s archenemies, the Blockheads, devise an elaborate scheme to dognap Lowbelly and harvest her pearls for themselves. When the Blockheads initial plan fails, they kidnap The Clayboys as well...and replace them with clones! The battle between Clayboys and clones is filled with trains and planes, knights and fights, thrills and spills. True to classic Gumby adventures, Gumby: The Movie takes viewers in and out of books, to Toyland, Camelot, outer space and beyond!', 0, 'https://image.tmdb.org/t/p/w500/mv8yiGImY2fxyvN2k8Grpg9NCL8.jpg', '2065-12-02', 'Released', 'Gumby: The Movie', 2),
(99, 5, 0, 109, NULL, 'tt0109906', b'0', 'en', 'J.J. is a rookie in the Sheriff\'s Department and the first black officer at that station. Racial tensions run high in the department as some of J.J.\'s fellow officers resent his presence. His only real friend is the other new trooper, the first female officer to work there, who also suffers similar discrimination in the otherwise all-white-male work environment. When J.J. becomes increasingly aware of police corruption during the murder trial of Teddy Woods, whom he helped to arrest, he faces difficult decisions and puts himself into grave personal danger in the service of justice.', 1, 'https://image.tmdb.org/t/p/w500/qD2B53sG1yhPyRANr2fnQerePas.jpg', '2064-09-17', 'Released', 'The Glass Shield', 9);
INSERT INTO `movie` (`movie_id`, `average_votes`, `budget`, `duration`, `homepage_link`, `imdb_id`, `is_adult`, `main_language`, `overview`, `popularity`, `poster_url`, `release_date`, `status`, `title`, `total_votes`) VALUES
(100, 6, 0, 78, NULL, 'tt0113198', b'0', 'en', 'Though Goofy always means well, his amiable cluelessness and klutzy pratfalls regularly embarrass his awkward adolescent son, Max. When Max\'s lighthearted prank on his high-school principal finally gets his longtime crush, Roxanne, to notice him, he asks her on a date. Max\'s trouble at school convinces Goofy that he and the boy need to bond over a cross-country fishing trip like the one he took with his dad when he was Max\'s age, which throws a kink in his son\'s plans to impress Roxanne.', 10, 'https://image.tmdb.org/t/p/w500/bycmMhO3iIoEDzP768sUjq2RV4T.jpg', '2065-04-08', 'Released', 'A Goofy Movie', 404),
(101, 6, 10500000, 113, NULL, 'tt0110066', b'0', 'en', 'In hot water with the mob over an unpaid debt, a con man poses as a family friend in an affluent Pennsylvania suburb.', 2, 'https://image.tmdb.org/t/p/w500/hJ1t3dz51ZirOZVzse9LpmW5Mnw.jpg', '2065-01-07', 'Released', 'Houseguest', 17),
(102, 7, 3600000, 112, 'http://www.mgm.com/title_title.do?title_star=LEAVINGL', 'tt0113627', b'0', 'en', 'Ben Sanderson, an alcoholic Hollywood screenwriter who lost everything because of his drinking, arrives in Las Vegas to drink himself to death. There, he meets and forms an uneasy friendship and non-interference pact with prostitute Sera.', 10, 'https://image.tmdb.org/t/p/w500/37qHRJxnSh5YkuaN9FgfNnMl3Tj.jpg', '2065-10-28', 'Released', 'Leaving Las Vegas', 365),
(103, 6, 5000000, 99, 'http://www.miramax.com/movie/heavenly-creatures', 'tt0110005', b'0', 'en', 'Based on the true story of Juliet Hulme and Pauline Parker, two close friends who share a love of fantasy and literature, who conspire to kill Pauline\'s mother when she tries to end the girls\' intense and obsessive relationship.', 9, 'https://image.tmdb.org/t/p/w500/5ek49TUeqStPmKwNdxrCSUAdXNe.jpg', '2064-09-03', 'Released', 'Heavenly Creatures', 299),
(104, 7, 700000, 171, NULL, 'tt0110057', b'0', 'en', 'This documentary follows two inner-city Chicago residents, Arthur Agee and William Gates, as they follow their dreams of becoming basketball superstars. Beginning at the start of their high school years, and ending almost 5 years later, as they start college, we watch the boys mature into men, still retaining their \"Hoop Dreams\".', 9, 'https://image.tmdb.org/t/p/w500/g5yIxuzZ3LFRxDa8SBQybJJhXng.jpg', '2064-09-13', 'Released', 'Hoop Dreams', 91),
(105, 6, 0, 100, NULL, 'tt0110006', b'0', 'en', 'Camp Hope is a summer retreat for overweight boys run by a kindly couple who make the campers feel comfortable with their extra pounds. But when tyrannical fitness guru Tony buys the camp, he puts the kids on a cruel regimen that goes too far. Sick of the endless weeks of \"all work and no play,\" the kids stage a coup and reclaim their summer of fun.', 9, 'https://image.tmdb.org/t/p/w500/j6bhaWGuhL5nyRK0FdpnRIBDlp3.jpg', '2065-02-18', 'Released', 'Heavyweights', 97),
(106, 7, 0, 123, NULL, 'tt0114057', b'0', 'en', 'The evil Iago pretends to be friend of Othello in order to manipulate him to serve his own end in the film version of this Shakespeare classic.', 1, 'https://image.tmdb.org/t/p/w500/qM0BXEQjmnAzlkDZ0tYmV6twqMX.jpg', '2065-12-16', 'Released', 'Othello', 33),
(107, 6, 0, 106, NULL, 'tt0113360', b'0', 'en', 'A businessman on a trip to Tokyo ends up in the middle of a centuries old feud between a criminal Ninja cult and a Samurai when he witnesses a assassination performed by the Ninja-cult leader.', 2, 'https://image.tmdb.org/t/p/w500/llu5wgQGYyMVDnz4p8ds8Um3lUa.jpg', '2065-02-25', 'Released', 'The Hunted', 25),
(108, 5, 25000000, 100, NULL, 'tt0110099', b'0', 'en', 'Albert Einstein helps a young man who\'s in love with Einstein\'s niece to catch her attention by pretending temporarily to be a great physicist.', 5, 'https://image.tmdb.org/t/p/w500/kAYymfWcktoHSjQJEtfEIeByZR9.jpg', '2064-12-25', 'Released', 'I.Q.', 112),
(109, 7, 60000000, 123, NULL, 'tt0110148', b'0', 'en', 'A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.', 11, 'https://image.tmdb.org/t/p/w500/hldXwwViSfHJS0kIJr07KBGmHJI.jpg', '2064-11-12', 'Released', 'Interview with the Vampire', 1558),
(110, 5, 14000000, 139, NULL, 'tt0113463', b'0', 'en', 'His wife having recently died, Thomas Jefferson accepts the post of United States ambassador to pre-revolutionary France, though he finds it difficult to adjust to life in a country where the aristocracy subjugates an increasingly restless peasantry. In Paris, he becomes smitten with cultured artist Maria Cosway, but, when his daughter visits from Virginia accompanied by her attractive slave, Sally Hemings, Jefferson\'s attentions are diverted.', 1, 'https://image.tmdb.org/t/p/w500/qKr3Mgo1HB3HkGTAVoVEpOSWlp2.jpg', '2065-04-01', 'Released', 'Jefferson in Paris', 10),
(111, 6, 12000000, 100, NULL, 'tt0114011', b'0', 'en', 'Waxing nostalgic about the bittersweet passage from childhood to puberty in this tender coming-of-age tale, four childhood girlfriends -- Teeny, Chrissy, Samantha and Roberta -- recall the magical summer of 1970. During their walk down memory lane, they reconcile experiences with boys, secrets, bullies and more.', 8, 'https://image.tmdb.org/t/p/w500/wD6rLdD2Ix3u9YLgE3Do8GyCHoz.jpg', '2065-10-21', 'Released', 'Now and Then', 91),
(112, 4, 0, 82, NULL, 'tt0110189', b'0', 'en', 'When two unemployed telephone pranksters decide to use their vocal \"talents\" to impersonate a Chicago mob boss and curry favor with organized crime in New York, the trouble begins. It isn\'t long before Johnny and Kamal (the \"Jerky Boys\" of crank call fame) are wanted by the local mafia, the police, and their neighbor.', 0, 'https://image.tmdb.org/t/p/w500/lXu3oa1mQzI2sDsFcKuyJYLziLK.jpg', '2065-02-04', 'Released', 'The Jerky Boys', 10),
(113, 6, 120, 121, NULL, 'tt0110116', b'0', 'en', 'The life and death of the legendary Ludwig van Beethoven. Beside all the work he is known for, the composer once wrote a famous love letter to a nameless beloved and the movie tries to find out who this beloved was. Not easy as Beethoven has had many women in his life.', 7, 'https://image.tmdb.org/t/p/w500/meRFVzGpBJiObWfdtOoNr0UPsP4.jpg', '2064-12-17', 'Released', 'Immortal Beloved', 90),
(114, 6, 0, 102, NULL, 'tt0113501', b'0', 'en', 'Bobby Earl is facing the electric chair for the murder of a young girl. Eight years after the crime he calls in Paul Armstrong, a professor of law, to help prove his innocence. Armstrong quickly uncovers some overlooked evidence to present to the local police, but they aren\'t interested - Bobby was their killer.', 9, 'https://image.tmdb.org/t/p/w500/tPQ8kT5HVxfyKXVeoiC6NkF5gsu.jpg', '2065-02-18', 'Released', 'Just Cause', 124),
(115, 3, 0, 90, NULL, 'tt0113199', b'0', 'en', 'A talking pig named Gordy becomes involved in a quest to save his family from the slaughterhouse.', 0, 'https://image.tmdb.org/t/p/w500/xKGu7MQz9lxK3JGDFqQxxzMyfGH.jpg', '2065-05-13', 'Released', 'Gordy', 4),
(116, 7, 0, 104, NULL, 'tt0114117', b'0', 'en', 'This film adaptation of Jane Austen\'s last novel follows Anne Elliot, the daughter of a financially troubled aristocratic family, who is persuaded to break her engagement to Frederick Wentworth, a young sea captain of meager means. Years later, money troubles force Anne\'s father to rent out the family estate to Admiral Croft, and Anne is again thrown into company with Frederick -- who is now rich, successful and perhaps still in love with Anne.', 2, 'https://image.tmdb.org/t/p/w500/si8911IezMvAnQFDvyg1nKzDlD.jpg', '2065-09-28', 'Released', 'Persuasion', 36),
(117, 4, 0, 89, NULL, 'tt0113538', b'0', 'en', 'A Southern California kid named Calvin Fuller is magically transported to the medieval kingdom of Camelot through a crack in the ground caused by an earthquake. Once there, he learns he was summoned by the wizard Merlin, who needs Calvin to save Camelot. Using dazzling modern inventions, can Calvin help King Arthur retain his crown and thwart the evil Lord Belasco?', 5, 'https://image.tmdb.org/t/p/w500/iklPPdF1TQFPmRyVu0SH0yF1gdt.jpg', '2065-08-12', 'Released', 'A Kid in King Arthur\'s Court', 40),
(118, 5, 40000000, 101, NULL, 'tt0113552', b'0', 'en', 'Jimmy Kilmartin is an ex-con living in Astoria in the New York City borough of Queens, trying to stay clean and raising a family with his wife Bev. But when his cousin Ronnie causes him to take a fall for driving an illegal transport of stolen cars, a police officer named Calvin Hart is injured and Jimmy lands back in prison. In exchange for an early release, he is asked to help bring down a local crime boss named Little Junior Brown.  Jimmy remarries and attempts to renew a relationship with his child. But he is sent undercover by Detective Hart to work with Junior and infiltrate his operations. As soon as Little Junior kills an undercover federal agent with Jimmy watching, the unscrupulous district attorney and the feds further complicate his life. He must take down Junior or face the consequences.', 7, 'https://image.tmdb.org/t/p/w500/uQjFpAEF6GUIKW46sbndWtsEQSl.jpg', '2065-04-22', 'Released', 'Kiss of Death', 83),
(119, 7, 18000000, 115, NULL, 'tt0110367', b'0', 'en', 'With their father away as a chaplain in the Civil War, Jo, Meg, Beth and Amy grow up with their mother in somewhat reduced circumstances. They are a close family who inevitably have their squabbles and tragedies. But the bond holds even when, later, male friends start to become a part of the household.', 9, 'https://image.tmdb.org/t/p/w500/tD9YDE8pjtSvvKUpkmooE6YDSm8.jpg', '2064-12-22', 'Released', 'Little Women', 222),
(120, 7, 17000000, 97, NULL, 'tt0113670', b'0', 'en', 'When her father enlists to fight for the British in WWI, young Sara Crewe goes to New York to attend the same boarding school her late mother attended. She soon clashes with the severe headmistress, Miss Minchin, who attempts to stifle Sara\'s creativity and sense of self- worth.', 7, 'https://image.tmdb.org/t/p/w500/a7LslH4Ofdvi1oam9Bbhb2UyMR2.jpg', '2065-05-11', 'Released', 'A Little Princess', 207),
(121, 6, 0, 108, NULL, 'tt0115012', b'0', 'zh', 'A provincial boy related to a Shanghai crime family is recruited by his uncle into cosmopolitan Shanghai in the 1930s to be a servant to a ganglord\'s mistress.', 1, 'https://image.tmdb.org/t/p/w500/qcoOCoN7viOhboGwhYXyApdDuiq.jpg', '2065-05-01', 'Released', 'æåæï¼æå°å¤å©æ¡¥', 17),
(122, 7, 0, 101, NULL, 'tt0110296', b'0', 'en', 'This Ken Loach docu-drama relates the story of a British woman\'s fight with Social Services over the care of her children. Maggie has a history of bouncing from one abusive relationship to another. She has four children, of four different fathers, who came to the attention of Social Services when they were injured in a fire. Subsequently, Maggie was found to be an \"unfit mother\" and her children were removed from her care. She finally meets the man of her dreams, a Paraguayan expatriate, and they start a family together. Unfortunately, Social Services seems unwilling to accept that her life has changed and rends them from their new children. She and Jorge together, and separately, fight Social Services, Immigration, and other government bureaucrats in a desperate battle to make their family whole again.', 0, 'https://image.tmdb.org/t/p/w500/9YgIxxPsWMwoIFrBgNxHgGn0y29.jpg', '2064-02-20', 'Released', 'Ladybird Ladybird', 14),
(123, 7, 30000000, 133, NULL, 'tt0110322', b'0', 'en', 'An epic tale of three brothers and their father living in the remote wilderness of 1900s USA and how their lives are affected by nature, history, war, and love.', 12, 'https://image.tmdb.org/t/p/w500/uh0sJcx3SLtclJSuKAXl6Tt6AV0.jpg', '2064-12-17', 'Released', 'Legends of the Fall', 636),
(124, 6, 10000000, 100, NULL, 'tt0109731', b'0', 'fr', 'Paul, an irritable and stressed-out hotel manager, begins to gradually develop paranoid delusions about his wife\'s infidelity...', 1, 'https://image.tmdb.org/t/p/w500/9ACPvC1XFRta8SXA816C0my32TG.jpg', '2064-02-18', 'Released', 'L\'Enfer', 22),
(125, 8, 11000000, 121, 'http://www.starwars.com/films/star-wars-episode-iv-a-new-hope', 'tt0076759', b'0', 'en', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.', 42, 'https://image.tmdb.org/t/p/w500/btTdmkgIvOi0FFip1sPuZI2oQG6.jpg', '2047-05-27', 'Released', 'Star Wars', 6778),
(126, 6, 2000000, 105, 'http://www.miramax.com/movie/like-water-for-chocolate/', 'tt0103994', b'0', 'es', 'Tita is passionately in love with Pedro, but her controlling mother forbids her from marrying him. When Pedro marries her sister, Tita throws herself into her cooking and discovers she can transfer her emotions through the food she prepares, infecting all who eat it with her intense heartbreak.', 4, 'https://image.tmdb.org/t/p/w500/3nU4id8Ul2pEGVfIWl1r9wSzBeC.jpg', '2062-04-18', 'Released', 'Como agua para chocolate', 70),
(127, 6, 0, 95, NULL, 'tt0110443', b'0', 'en', 'Major Benson Winifred Payne is being discharged from the Marines. Payne is a killin\' machine, but the wars of the world are no longer fought on the battlefield. A career Marine, he has no idea what to do as a civilian, so his commander finds him a job - commanding officer of a local school\'s JROTC program, a bunch of ragtag losers with no hope.', 9, 'https://image.tmdb.org/t/p/w500/tCgBOpglqgg478AIy9wYfZ7choY.jpg', '2065-03-25', 'Released', 'Major Payne', 164),
(128, 6, 0, 98, NULL, 'tt0110365', b'0', 'en', 'The film follows the personal relationship between a father and his two sons, one of whom is a hit-man for the Russian mafia in Brooklyn.', 1, 'https://image.tmdb.org/t/p/w500/9BQrTWQodxm0G349yruhRuJV38q.jpg', '2064-10-28', 'Released', 'Little Odessa', 31),
(129, 7, 18000000, 108, NULL, 'tt0112682', b'0', 'fr', 'A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.', 9, 'https://image.tmdb.org/t/p/w500/eVo6ewq4akfyJYy3GXkMsLNzEJc.jpg', '2065-05-17', 'Released', 'La CitÃ© des Enfants Perdus', 308),
(130, 5, 0, 92, NULL, 'tt0107566', b'0', 'en', 'Mousie and Sad Girl are childhood best friends in a contemporary Los Angeles poor Hispanic neighborhood. But when Sad Girl becomes pregnant by Mousie\'s boyfriend, a drug dealer named Ernesto, the two become bitter enemies. While their dispute escalates towards violence, the violence of the world around them soon also impacts their lives.', 1, 'https://image.tmdb.org/t/p/w500/uEzbxMuT2d1KNR0KEfQncN7IUq2.jpg', '2064-06-09', 'Released', 'Mi Vida Loca', 9),
(131, 6, 17000000, 106, NULL, 'tt0113691', b'0', 'en', 'Khaila Richards, a crack-addicted single mother, accidentally leaves her baby in a dumpster while high and returns the next day in a panic to find he is missing. In reality, the baby has been adopted by a warm-hearted social worker, Margaret Lewin, and her husband, Charles. Years later, Khaila has gone through rehab and holds a steady job. After learning that her child is still alive, she challenges Margaret for the custody.', 7, 'https://image.tmdb.org/t/p/w500/h0IjNfD1D7WVR70JpvMMWhNVx4N.jpg', '2065-03-18', 'Released', 'Losing Isaiah', 28),
(132, 4, 60000000, 108, NULL, 'tt0110391', b'0', 'en', 'Ex-football star Mike Gambril meets Terry McKay on a flight to Sydney, which is forced to land on a small atoll. They become romantic on board a ship sent to take them to a larger island. They agree to meet in New York three months later to see if the attraction is real. One shows up but the other doesn\'t. However, a chance meeting brings them together again.', 3, 'https://image.tmdb.org/t/p/w500/mQMCPf0GUaOjKYFTdmL8w8udnJX.jpg', '2064-10-22', 'Released', 'Love Affair', 11),
(133, 6, 0, 107, NULL, 'tt0110428', b'0', 'en', 'Nicholas Hytnerâs much awarded 1994 drama, based on Alan Bennett\'s West End play. George III\'s erratic behaviour leads to a plot in Parliament to have him declared insane and removed from the throne.', 4, 'https://image.tmdb.org/t/p/w500/Apgj4j73aUyMkNaPoSuQ7DJbt1M.jpg', '2064-12-29', 'Released', 'The Madness of King George', 67),
(134, 5, 0, 96, NULL, 'tt0113755', b'0', 'en', 'Ben Archer is not happy. His mother, Sandy, has just met a man, and it looks like things are pretty serious. Driven by a fear of abandonment, Ben tries anything and everything to ruin the \"love bubble\" which surrounds his mom. However, after Ben and Jack\'s experiences in the Indian Guides, the two become much closer.', 2, 'https://image.tmdb.org/t/p/w500/6bnOhhrrrq6RZhMgz4aGyqbJ9Wf.jpg', '2065-03-04', 'Released', 'Man of the House', 40),
(135, 5, 0, 108, NULL, 'tt0110516', b'0', 'en', 'Three young boys pool their money and pay V, a kindhearted prostitute, to strip for them. Afterward, she drives them home to the suburbs -- but then her car breaks down. It\'s just as well, though, because a mobster named Waltzer is after her, and V realizes the suburbs are the perfect place to hide. But things get a lot more complicated when V falls in love with Tom, a single father who is unaware of her real profession.', 3, 'https://image.tmdb.org/t/p/w500/94AgmLpD2NtCSwJ13rof6Bn5mfN.jpg', '2064-09-01', 'Released', 'Milk Money', 49),
(136, 5, 15000000, 97, NULL, 'tt0110538', b'0', 'en', 'The events focus around a crisis hotline business on one crazy night during the Christmas holidays.', 2, 'https://image.tmdb.org/t/p/w500/q4kYWVXsPhD23XhGCBaWHoEITHC.jpg', '2064-12-22', 'Released', 'Mixed Nuts', 37),
(137, 6, 0, 114, NULL, 'tt0110527', b'0', 'en', 'A little girl discovers dreams can come true if you really believe. Six-year-old Susan Walker has doubts about childhood\'s most enduring miracle - Santa Claus. Her mother told her the \'secret\' about Santa a long time ago. But after meeting a special department store Santa who\'s convinced he\'s the real thing, Susan is given the most precious gift of all something to believe in.', 5, 'https://image.tmdb.org/t/p/w500/iuI31j8DM4TOxJTZeumG0S4npPU.jpg', '2064-11-19', 'Released', 'Miracle on 34th Street', 199),
(138, 5, 6, 95, NULL, 'tt0113808', b'0', 'en', 'Gwyn Marcus has always wanted a marriage like her parents. She has just accepted the proposal of her boyfriend Matt, but she has misgivings about their future together. Her fear of commitment grows as she learns of the various affairs that her family is having. With her sister getting married and her brother already married, her mother is growing concerned about Gwyn\'s being the last single person in the family. But the more she thinks about marriage, the more she must search for the balance between career, marriage and family.', 1, 'https://image.tmdb.org/t/p/w500/jn2kmqCgRcloNYr121BB4BmgSRu.jpg', '2065-01-28', 'Released', 'Miami Rhapsody', 7),
(139, 6, 45000000, 123, NULL, 'tt0109836', b'0', 'en', 'Based on Mary Shelley\'s novel, \"Frankenstein\" tells the story of Victor Frankenstein, a promising young doctor who, devastated by the death of his mother during childbirth, becomes obsessed with bringing the dead back to life. His experiments lead to the creation of a monster, which Frankenstein has put together with the remains of corpses. It\'s not long before Frankenstein regrets his actions.', 14, 'https://image.tmdb.org/t/p/w500/uG0YLHdiBuWBv99MLwthucsvKLZ.jpg', '2064-11-05', 'Released', 'Frankenstein', 272),
(140, 7, 29500000, 129, NULL, 'tt0114746', b'0', 'en', 'In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earth\'s population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, he\'s arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.', 12, 'https://image.tmdb.org/t/p/w500/6Sj9wDu3YugthXsU0Vry5XFAZGg.jpg', '2065-12-30', 'Released', 'Twelve Monkeys', 2470),
(141, 6, 0, 122, NULL, 'tt0113870', b'0', 'en', 'Inspired by a true story. A petty criminal sent to Alcatraz in the 1930s is caught attempting to make an escape. As punishment he is put in solitary confinement. The maximum stay is supposed to be 19 days, but Henri spends years alone, cold and in complete darkness, only to emerge a madman and soon to be a murderer. The story follows a rookie lawyer attempting to prove that Alcatraz was to blame.', 9, 'https://image.tmdb.org/t/p/w500/jPbBDALAjTQFzCl21ZKmhjSjEmD.jpg', '2065-01-21', 'Released', 'Murder in the First', 140),
(142, 7, 5500000, 128, NULL, 'tt0113896', b'0', 'en', 'Traces over three generations an immigrant family\'s trials, tribulations, tragedies, and triumphs. Maria and Jose, the first generation, come to Los Angeles, meet, marry, face deportation all in the 1930\'s. They establish their family in East L.A., and their children Chucho, Paco, Memo, Irene, Toni, and Jimmy deal with youth culture and the L.A. police in the 50\'s. As the second generation become adults in the 60\'s, the focus shifts to Jimmy, his marriage to Isabel (a Salvadorian refugee), their son, and Jimmy\'s journey to becoming a responsible parent.', 3, 'https://image.tmdb.org/t/p/w500/wDV4MCBmmTdgNQTv2tYbQg5diaB.jpg', '2065-05-04', 'Released', 'My Family', 11),
(143, 7, 0, 110, NULL, 'tt0110684', b'0', 'en', 'Sully is a rascally ne\'er-do-well approaching retirement age. While he is pressing a worker\'s compensation suit for a bad knee, he secretly works for his nemesis, Carl, and flirts with Carl\'s young wife Toby. Sully\'s long- forgotten son and family have moved back to town, so Sully faces unfamiliar family responsibilities. Meanwhile, Sully\'s landlady\'s banker son plots to push through a new development and evict Sully from his mother\'s life.', 2, 'https://image.tmdb.org/t/p/w500/3mbJyBFsryL6wcSuEwHXvpzdOYa.jpg', '2064-12-24', 'Released', 'Nobody\'s Fool', 56),
(144, 6, 0, 99, NULL, 'tt0112792', b'0', 'en', 'Former Marine Louanne Johnson lands a gig teaching in a pilot program for bright but underachieving teens at a notorious inner-city high school. After having a terrible first day, she decides she must throw decorum to the wind. When Johnson returns to the classroom, she does so armed with a no-nonsense attitude informed by her military training and a fearless determination to better the lives of her students -- no matter what the cost.', 9, 'https://image.tmdb.org/t/p/w500/y5Jee3QmYOlpqfaPPbfvtdVc5wj.jpg', '2065-08-12', 'Released', 'Dangerous Minds', 249),
