(146, 6, 30000000, 89, NULL, 'tt0112431', b'0', 'en', 'Babe is a little pig who doesn\'t quite know his place in the world. With a bunch of odd friends, like Ferdinand the duck who thinks he is a rooster and Fly the dog he calls mom, Babe realizes that he has the makings to become the greatest sheep pig of all time, and Farmer Hogget knows it. With the help of the sheep dogs Babe learns that a pig can be anything that he wants to be.', 14, 'https://image.tmdb.org/t/p/w500/gN6X3fwPya8pLffk9OEWV3DqBnE.jpg', '2065-07-19', 'Released', 'Babe', 756),
(147, 6, 0, 121, NULL, 'tt0112637', b'0', 'en', 'The story of the relationship between painter Dora Carrington and author Lytton Strachey in a World War One England of cottages and countryside. Although platonic due to Strachey\'s homosexuality, the relationship was nevertheless a deep and complicated one. When Carrington did develop a more physical relationship with soldier Ralph Partridge, Strachey was able to welcome him as a friend, although Partridge remained somewhat uneasy, not so much with Strachey\'s lifestyle and sexual orientation as with the fact that he was a conscientious objector.', 1, 'https://image.tmdb.org/t/p/w500/a7w6rPdTBgWAx6lnhwHemPx9pEw.jpg', '2065-11-09', 'Released', 'Carrington', 16),
(148, 0, 0, 93, NULL, 'tt0117169', b'0', 'en', 'Allegedly based on a true story, this film follows the life of Toshi, a Japanese man living in America and working with the New York City police. After being recommended for undercover work, Toshi decides to go after a gang lead by Hawk. Hawk and Toshi soon become friends, although Hawk\'s second-in-command, Tito, is suspicious of the newcomer. Will Toshi be able to bring the gang down, or will his cover be blown before he can finish the assignment?', 0, 'https://image.tmdb.org/t/p/w500/hGJ3YlibjHNd9xP6rOIDTgh90eC.jpg', '2063-08-16', 'Released', 'New York Cop', 0),
