(150, 7, 11000000, 122, NULL, 'tt0112818', b'0', 'en', 'A justice drama based on a true story about a man on death row who in his last days forms a strong relationship with a nun who teaches him forgiveness and gives him spirituality as she accompanies him to his execution. Susan Sarandon won an Oscar for best female actress for her convincing portrayal of Sister Helen Prejean.', 6, 'https://image.tmdb.org/t/p/w500/y19uRkAHXOHLeySuBVMqnvVnsrA.jpg', '2065-12-30', 'Released', 'Dead Man Walking', 350),
(151, 4, 0, 83, NULL, 'tt0113948', b'0', 'en', 'It has been 73 years since Alex failed and the Humans lost the Cyborg Wars. Since then, the Humans have been enslaved. Scientists have developed a new DNA strain, which could signal the end of the Cyborgs, and they inject it into a volunteer. When the Cyborgs learn of the woman and the baby they list both for termination.', 1, 'https://image.tmdb.org/t/p/w500/mY7SX6aBDumSweQMTCdfrIbMLAa.jpg', '2065-09-27', 'Released', 'Nemesis 2 - Nebula', 10),
(152, 7, 0, 100, NULL, 'tt0110671', b'0', 'en', 'Laura San Giacomo stars in this sexy comedy about adultery. When Nina\'s (San Giacomo) husband goes out of town for several weeks on a business trip, Nina hooks up with a photographer. Told from a reporter\'s point of view, his interviews with Nina and the photographer provide comic insights. Stars Laura San Giacomo, Paul Rhys, Michael O\'Keefe, Fisher Stevens and more.', 0, 'https://image.tmdb.org/t/p/w500/24f1paDywuI9FVEmT313Ze8oVHX.jpg', '2065-03-04', 'Released', 'Nina Takes a Lover', 4),
