(161, 6, 11000000, 113, NULL, 'tt0114113', b'0', 'en', 'In the midst of the Mariel boat lift -- a hurried exodus of refugees from Cuba going to America -- an immigration clerk accidentally presumes that dissident Juan Raul Perez and Dorita Evita Perez are married. United by their last name and a mutual resolve to emigrate, Dorita and Juan agree to play along. But it gets complicated when the two begin falling for each other just as Juan reunites with his wife, Carmela, whom he hasn\'t seen in decades.', 1, 'https://image.tmdb.org/t/p/w500/paSbLkZL35t2fmdxoQNHv6ckVjw.jpg', '2065-05-13', 'Released', 'The Perez Family', 9),
