(163, 7, 0, 94, NULL, 'tt0114210', b'0', 'en', 'A pastry boy and the son of a hair-piece mogul become involved in an arson scandal. Sergio is offered a bribe in exchange for taking the blame for the fire that destroys his workplace. Garet, the real arsonist, is apalled that someone else would try to take credit for his act of love. Before long, Sergio and Garet become entangled in a zany love-quadrangle involving Hattie and Stephanie. Written by Brian Whiting', 0, 'https://image.tmdb.org/t/p/w500/leJcOavVPUrYodUJteBOl7pRFuU.jpg', '2065-04-29', 'Released', 'A Pyromaniac\'s Love Story', 2),
(164, 3, 0, 51, NULL, 'tt0112286', b'0', 'en', 'A young Russian boy, Thomas Minton, travels to New York as a passenger on a Russian freighter. Close to Ellis Island he gets off and thus starts his journey to America the same way as all immigrants in former times. Thomas is searching for the family of one of his ancestors, who had emigrated decades ago, but once sent a letter home together with a sample of his new profession: 3D-Photography. The boy follows his relative\'s traces by counter-checking the old 3D-Photographs of New York (using an antique viewer) with the same places and how they look today. This way, the audience gets to see the Big Apple in former times as well as today.', 0, 'https://image.tmdb.org/t/p/w500/lKOAyy098yjoot8cutYsStVO1WS.jpg', '2065-10-21', 'Released', 'Across the Sea of Time', 2),
(165, 6, 12000000, 97, NULL, 'tt0112697', b'0', 'en', 'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school\'s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.', 9, 'https://image.tmdb.org/t/p/w500/i8gEHh2sszB6YWLC0jl559sxAeN.jpg', '2065-07-20', 'Released', 'Clueless', 828),
