(190, 8, 25000000, 142, NULL, 'tt0111161', b'0', 'en', 'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', 51, 'https://image.tmdb.org/t/p/w500/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg', '2064-09-24', 'Released', 'The Shawshank Redemption', 8358),
(191, 5, 18000000, 101, NULL, 'tt0113855', b'0', 'en', 'For nine generations an evil sorcerer has been victorious in hand-to-hand battle against his mortal enemies. If he wins a tenth Mortal Kombat tournament, desolation and evil will reign over the multiverse forever. To save Earth, three warriors must overcome seemingly insurmountable odds, their own inner demons, and superhuman foes in this action/adventure movie based on one of the most popular video games of all time.', 10, 'https://image.tmdb.org/t/p/w500/bdXWixjWVA7Y03PvW74xufrROiJ.jpg', '2065-08-19', 'Released', 'Mortal Kombat', 452),
(192, 7, 0, 108, NULL, 'tt0106966', b'0', 'es', 'Havana, Cuba, 1979. Flamboyantly gay artist Diego (Jorge PerugorrÃ­a) attempts to seduce the straight and strait-laced David, an idealistic young communist, and fails dismally. But David conspires to become friends with Diego so he can monitor the artist\'s subversive life for the state. As Diego and David discuss politics, individuality and personal expression in Castro\'s Cuba, a genuine friendship develops between the two. But can it last? Strawberry and Chocolate became an instant hit when it was released, and has become a classic of Cuban cinema due to its charming and authentic exploration of a connection between two people under historical circumstances that seem levelled against them.', 1, 'https://image.tmdb.org/t/p/w500/7NdKNNrONwbmCOJgTO4wYjWzQyW.jpg', '2063-01-03', 'Released', 'Fresa y chocolate', 16),
(193, 6, 32000000, 107, NULL, 'tt0114214', b'0', 'en', 'A mysterious woman comes to compete in a quick-draw elimination tournament, in a town taken over by a notorious gunman.', 7, 'https://image.tmdb.org/t/p/w500/50ZzhAMO6nunlCp7FrGj7VoLxJV.jpg', '2065-02-10', 'Released', 'The Quick and the Dead', 431),
(194, 6, 55000000, 121, NULL, 'tt0111282', b'0', 'en', 'An interstellar teleportation device, found in Egypt, leads to a planet with humans resembling ancient Egyptians who worship the god Ra.', 13, 'https://image.tmdb.org/t/p/w500/39WsfbB5BshvdbPAYRFXdsjC481.jpg', '2064-10-28', 'Released', 'Stargate', 942),
(195, 6, 0, 101, NULL, 'tt0114594', b'0', 'en', 'A young, naive Hollywood studio assistant finally turns the tables on his incredibly abusive producer boss.', 5, 'https://image.tmdb.org/t/p/w500/jqsOhWIGccIJCe8zvHKQuWy5IJL.jpg', '2064-09-11', 'Released', 'Swimming with Sharks', 104),
(196, 7, 0, 92, NULL, 'tt0111149', b'0', 'en', 'Three friends discover their new flatmate dead but loaded with cash.', 8, 'https://image.tmdb.org/t/p/w500/qak9QuEiH5ENwqxyVEO0onegCx6.jpg', '2064-12-23', 'Released', 'Shallow Grave', 247),
(197, 6, 19000000, 117, NULL, 'tt0114272', b'0', 'en', 'An aspiring young physician, Robert Merivel found himself in the service of King Charles II and saves the life of someone close to the King. Merivel joins the King\'s court and lives the high life provided to someone of his position. Merivel is ordered to marry his King\'s mistress in order to divert the queens suspicions. He is given one order by the king and that is not to fall in love. The situation worsens when Merivel finds himself in love with his new wife. Eventually, the King finds out and relieves Merivel of his position and wealth. His fall from grace leaves Merivel where he first started. And through his travels and reunions with an old friend, he rediscovers his love for true medicine and what it really means to be a physician.', 10, 'https://image.tmdb.org/t/p/w500/aqQdEQ1ZVdzrREJxCoPzTlLgHVw.jpg', '2065-12-30', 'Released', 'Restoration', 30),
(198, 6, 0, 96, NULL, 'tt0108260', b'0', 'en', 'Brothers Vincent (rich) and Clay (poor) meet up for the first time after their father\'s funeral and remark on how similar they look. But unknown to Clay, who thinks his life is taking a turn for the better, Vince is actually plotting to kill him with a car bomb and pass the corpse off as his own, planning to start a new life elsewhere with his father\'s inheritance. But Clay survives the blast and has his face, memory and identity restored in hospital... but are they the right ones?', 1, 'https://image.tmdb.org/t/p/w500/xP4dO0TVsSvKXx8uwfLSqsbtfLM.jpg', '2063-09-16', 'Released', 'Suture', 7),
(199, 5, 0, 91, NULL, 'tt0113936', b'0', 'en', 'While on detention, a group of misfits and slackers have to write a letter to the President explaining what is wrong with the education system. There is only one problem, the President loves it! Hence, the group must travel to Washington to meet the Main Man.', 5, 'https://image.tmdb.org/t/p/w500/qfMbFIGNIQ76FEu7Wg48aEbxFh1.jpg', '2065-09-09', 'Released', 'Senior Trip', 23),
(200, 7, 0, 125, NULL, 'tt0110081', b'0', 'zh', 'Fugui and Jiazhen endure tumultuous events in China as their personal fortunes move from wealthy landownership to peasantry.', 5, 'https://image.tmdb.org/t/p/w500/kKZYobKNLPGoOt7p2pfTRggelgP.jpg', '2064-07-01', 'Released', 'æ´»ç', 62),
(201, 5, 25000000, 98, NULL, 'tt0114614', b'0', 'en', 'Based on the British cult comic-strip, our tank-riding anti-heroine fights a mega-corporation, which controls the world\'s water supply.', 7, 'https://image.tmdb.org/t/p/w500/n3QWQhb5oVJxTLNKMLmA9xC5XwB.jpg', '2065-04-01', 'Released', 'Tank Girl', 140),
(202, 6, 0, 92, NULL, 'tt0114608', b'0', 'en', 'A man on the run is hunted by a demon known as the Collector.', 9, 'https://image.tmdb.org/t/p/w500/8uD5yk0ECebJ59lhvhTBKhUojc.jpg', '2065-01-14', 'Released', 'Tales from the Crypt: Demon Knight', 96);
INSERT INTO `movie` (`movie_id`, `average_votes`, `budget`, `duration`, `homepage_link`, `imdb_id`, `is_adult`, `main_language`, `overview`, `popularity`, `poster_url`, `release_date`, `status`, `title`, `total_votes`) VALUES
(203, 6, 20000000, 106, NULL, 'tt0114681', b'0', 'en', 'Susan wants to work in television and will therefore do anything it takes, even if it means killing her husband. A very dark comedy from independent director Gus Van Sant with a brilliant Nicole Kidman in the leading role.', 10, 'https://image.tmdb.org/t/p/w500/zCREx8trzejNieDLUsRuwLU0cS3.jpg', '2065-05-21', 'Released', 'To Die For', 177),
(204, 6, 38000000, 118, NULL, 'tt0111280', b'0', 'en', 'Captain Jean-Luc Picard and the crew of the Enterprise-D find themselves at odds with the renegade scientist Soran who is destroying entire star systems. Only one man can help Picard stop Soran\'s scheme...and he\'s been dead for seventy-eight years.', 8, 'https://image.tmdb.org/t/p/w500/wjrXjlNpDq9U8vYmAwf420yDFtn.jpg', '2064-11-18', 'Released', 'Star Trek: Generations', 461),
(205, 5, 6000000, 98, NULL, 'tt0114609', b'0', 'en', 'A strange funeral director tells four strange tales of horror with an African American focus to three drug dealers he traps in his place of business.', 2, 'https://image.tmdb.org/t/p/w500/3OrapxFNr12AhRxupQ8Z2jP1D13.jpg', '2065-05-25', 'Released', 'Tales from the Hood', 33),
(206, 5, 0, 115, NULL, 'tt0111454', b'0', 'en', 'The story of the marriage of the poet TS Eliot to socialite Vivienne Haigh-Wood, which had to cope with her gynaeological and emotional problems and his growing fame.', 0, 'https://image.tmdb.org/t/p/w500/vLh2r5QyIooLhmYNYEaSZ4Jxsav.jpg', '2064-04-16', 'Released', 'Tom & Viv', 8),
(207, 6, 0, 97, NULL, 'tt0114694', b'0', 'en', 'Party animal Tommy Callahan is a few cans short of a six-pack. But when the family business starts tanking, it\'s up to Tommy and number-cruncher Richard Hayden to save the day.', 11, 'https://image.tmdb.org/t/p/w500/lbsuDUaTH9POXWb4Inyck8gZFck.jpg', '2065-04-01', 'Released', 'Tommy Boy', 321),
(208, 5, 0, 99, 'http://www.theofficialjohncarpenter.com/village-of-the-damned/', 'tt0114852', b'0', 'en', 'An American village is visited by some unknown life form which leaves the women of the village pregnant. Nine months later, the babies are born, and they all look normal, but it doesn\'t take the \"parents\" long to realize that the kids are not human or humane.', 6, 'https://image.tmdb.org/t/p/w500/iwmI6kZWPJ9TYC4PJ0fi80TNFx5.jpg', '2065-04-29', 'Released', 'Village of the Damned', 165),
(209, 6, 32, 100, NULL, 'tt0111309', b'0', 'en', '\"The Sum of Us\" is an Aussie story about a father and a son both searching for love and sharing an unconventional bond. Harry, the father, is the caring and open-minded \"mate\" that borders on annoyance. His son Jeff unsuccessfully searches for love, with the unwanted guidance of his father.', 1, 'https://image.tmdb.org/t/p/w500/rAQAUf6HHUyoT2Ii6jUmzMu5Ppf.jpg', '2064-07-13', 'Released', 'The Sum of Us', 21),
(210, 6, 0, 119, NULL, 'tt0111590', b'0', 'en', 'An uninterrupted rehersal of Chekhov\'s \"Uncle Vanya\" played out by a company of actors. The setting is their run down theater with an unusable stage and crumbling ceiling. The play is shown act by act with the briefest of breaks to move props or for refreshments. The lack of costumes, real props and scenery is soon forgotten.', 7, 'https://image.tmdb.org/t/p/w500/ii4bqnfm5aW3TxqGh0tcxS8nijK.jpg', '2064-09-14', 'Released', 'Vanya on 42nd Street', 15),
(211, 5, 6500000, 99, NULL, 'tt0114788', b'0', 'en', 'Michael Chambers has come home to Austin, Texas. To the mother who\'s starting a new life and the brother driven by old jealousies. To the places he remembers and the memories he can\'t forget. And to Rachel, the woman he married and then betrayed with his passion for gambling. Now she\'s together with Tommy Dundee, a man no one trifles with. He takes care of her in a way Michael never could, but there\'s a price for his attention and Rachel knows this. And when Michael devises a plan to get Rachel out from under Tommy\'s control, they become entangled in a web of intrigue, danger and desire from which no one escapes unscathed.', 2, 'https://image.tmdb.org/t/p/w500/xoMf6741KkVgHMqVWCvflqTHf09.jpg', '2065-04-29', 'Released', 'The Underneath', 15),
(212, 6, 10000000, 116, NULL, 'tt0113347', b'0', 'en', 'Soon-to-be-wed graduate student Finn Dodd develops cold feet when she suspects her fiancÃ© is cheating on her. In order to clear her head, Finn visits her grandmother, Hy, and great aunt, Glady Joe Cleary, in Grasse, Calif. There, Finn learns that Hy and Glady Joe are members of a group of passionate quilters, and over the course of her visit she is regaled with tales of love and life by women who have collected rich experiences and much wisdom.', 4, 'https://image.tmdb.org/t/p/w500/wnWAZHbjX5Wj6hyb0gGmFdMADZk.jpg', '2065-10-07', 'Released', 'How To Make An American Quilt', 38),
(213, 6, 55000000, 81, NULL, 'tt0114148', b'0', 'en', 'History comes gloriously to life in Disney\'s epic animated tale about love and adventure in the New World. Pocahontas is a Native American woman whose father has arranged for her to marry her village\'s best warrior. But a vision tells her change is coming, and soon she comes face to face with it in the form of Capt. John Smith.', 13, 'https://image.tmdb.org/t/p/w500/qk95miOV8wDABbO5gyCpCrvbVFu.jpg', '2065-06-15', 'Released', 'Pocahontas', 1509),
(214, 6, 0, 88, NULL, 'tt0114888', b'0', 'en', 'Five young marines on a suicide mission in Vietnam, struggle for survival in a jungle minefield. The mean streets of home did not prepare them for this.', 0, 'https://image.tmdb.org/t/p/w500/lP0YJPbtshhFHGVSgiQojuiC1im.jpg', '2065-02-25', 'Released', 'The Walking Dead', 4),
(215, 5, 30000000, 106, NULL, 'tt0114857', b'0', 'en', 'The Law Enforcement Technology Advancement Centre (LETAC) has developed SID version 6.7: a Sadistic, Intelligent, and Dangerous virtual reality entity which is synthesized from the personalities of more than 150 serial killers, and only one man can stop him.', 5, 'https://image.tmdb.org/t/p/w500/7vdg9lA1un8TrNLlLKsaQtVqs4a.jpg', '2065-08-05', 'Released', 'Virtuosity', 163),
(216, 6, 0, 126, NULL, 'tt0111667', b'0', 'en', 'The son of a Vietnam War Veteran must deal with neighborhood bullies as well as his dad\'s post-traumatic stress disorder while growing up in the deep south in the 1970\'s.', 3, 'https://image.tmdb.org/t/p/w500/neSgQuAS2zWZeqfHHNv41IEuR6v.jpg', '2064-11-05', 'Released', 'The War', 39),
(217, 7, 11000000, 118, NULL, 'tt0108550', b'0', 'en', 'Gilbert has to care for his brother Arnie and his obese mother, which gets in the way when love walks into his life.', 10, 'https://image.tmdb.org/t/p/w500/jQLoOPwNxyILwDbdhn9DsfQz0Sg.jpg', '2063-12-19', 'Released', 'What\'s Eating Gilbert Grape', 943),
(218, 6, 17000000, 103, NULL, 'tt0114924', b'0', 'en', 'A love story built on a misunderstanding. A transit worker pulls commuter Peter off the tracks after he\'s mugged. But while he\'s in a coma, his family mistakenly thinks she\'s Peter\'s fiancÃ©e, and she doesn\'t correct them. Things get more complicated when she falls for his brother, who\'s not quite sure that she\'s who she claims to be.', 15, 'https://image.tmdb.org/t/p/w500/9StV7DX4ZtRZGJs9VcVEPvxIKL6.jpg', '2065-04-22', 'Released', 'While You Were Sleeping', 340),
(219, 8, 33000000, 127, 'http://www.sevenmovie.com/', 'tt0114369', b'0', 'en', 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', 18, 'https://image.tmdb.org/t/p/w500/8zw8IL4zEPjkh8Aysdcd0FwGMb0.jpg', '2065-09-23', 'Released', 'Se7en', 5915),
(220, 8, 6000000, 106, 'http://www.mgm.com/#/our-titles/2083/The-Usual-Suspects', 'tt0114814', b'0', 'en', 'Held in an L.A. interrogation room, Verbal Kint attempts to convince the feds that a mythic crime lord, Keyser Soze, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor â leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lord\'s almost supernatural prowess.', 16, 'https://image.tmdb.org/t/p/w500/jgJoRWltoS17nD5MAQ1yK2Ztefw.jpg', '2065-07-20', 'Released', 'The Usual Suspects', 3334),
(221, 5, 0, 94, NULL, 'tt0112435', b'0', 'en', 'It\'s the story about seven very different best friends, and one summer that will bring them together like never before.', 2, 'https://image.tmdb.org/t/p/w500/1Hbz9SWu98m4LsMPxfRNFIGKxuT.jpg', '2065-08-19', 'Released', 'The Baby-Sitters Club', 23),
(222, 5, 0, 87, NULL, 'tt0109655', b'0', 'en', 'Jade Li is a feisty, 20-something Chinese Canadian, trying to achieve that happy medium between giving in to her parent\'s wishes and fulfilling her own needs and desires - double happiness. Naturally, something\'s got to give and when love beckons in the shape of Mark, a white university student, the facade of the perfect Chinese daughter begins to slip.', 0, 'https://image.tmdb.org/t/p/w500/i67S4uIrx8nV1ZYk4zugsw3xbZX.jpg', '2064-09-08', 'Released', 'Double Happiness', 2),
(223, 6, 3000000, 106, NULL, 'tt0110598', b'0', 'en', 'Murielâs Wedding is P.J. Hoganâs film debut. A humorous emancipation story of an unemployed woman who evolves from a dreamer into a self sustaining successful woman. An amusing comedy thatâs funny, silly, angry and serious.', 5, 'https://image.tmdb.org/t/p/w500/qoZShHm8QTrHAR80LypwI0SYp8I.jpg', '2064-09-30', 'Released', 'Muriel\'s Wedding', 104),
(224, 5, 0, 96, NULL, 'tt0114916', b'0', 'en', 'A prudish woman, working on tenure as a literacy professor at a large urban university, finds herself strangely attracted to a free-spirited, liberal woman whom works at a local carnival which comes to town.', 3, 'https://image.tmdb.org/t/p/w500/wnUuYc9XnWrTTAGz8YjjULA3Zmr.jpg', '2065-05-06', 'Released', 'When Night Is Falling', 10),
(225, 6, 0, 100, NULL, 'tt0106339', b'0', 'en', 'Chronicles the early days of The Beatles in Hamburg, Germany. The film focuses primarily on the relationship between Stuart Sutcliffe (played by Stephen Dorff) and John Lennon (played by Ian Hart), and also with Sutcliffe\'s German girlfriend Astrid Kirchherr (played by Sheryl Lee).', 2, 'https://image.tmdb.org/t/p/w500/zPhcqjKLThhzRPDoMEzVdjh431i.jpg', '2064-04-02', 'Released', 'Backbeat', 37),
(226, 7, 5000000, 139, NULL, 'tt0104779', b'0', 'en', 'An embittered husband, paralyzed and in a wheelchair, buttonholes a complete stranger and begins to tell him the story of his marriage. The stranger would like to escape, but cannot. For one thing he grows fascinated by the story. For another he is mesmerized by the man\'s wife, who has perfected that trick of looking a man boldly in the eye until, by looking away, he concedes sexual supremacy.', 11, 'https://image.tmdb.org/t/p/w500/sUiqWj0k5oPcThd1WaXvt9Vymzr.jpg', '2062-09-04', 'Released', 'Bitter Moon', 115),
(227, 6, 0, 93, NULL, 'tt0109950', b'0', 'en', 'Detective - turned - bodyguard Cynthia McKay (Cynthia Rothrock) is hired by a psychotic icy seductress, Nina Lindell (Lydie Denier), the same woman who killed Mckay\'s lover months earlier.  With vendetta in her heart McKay accompanies the flamboyantly playful womanizer through the glamourous world of the super-rich as his protector.  In a unique role reversal, it is the woman protecting the man from another woman, erupting into a deadly triangle of passion, suspense and action.', 0, 'https://image.tmdb.org/t/p/w500/hwbKoOSUuzuN2AQppnUxwwd4qOD.jpg', '2064-11-23', 'Released', 'Guardian Angel', 3),
(228, 6, 15000000, 86, NULL, 'tt0109040', b'0', 'en', 'He\'s Ace Ventura: Pet Detective. Jim Carrey is on the case to find the Miami Dolphins\' missing mascot and quarterback Dan Marino. He goes eyeball to eyeball with a man-eating shark, stakes out the Miami Dolphins and woos and wows the ladies. Whether he\'s undercover, under fire or underwater, he always gets his man . . . or beast!', 11, 'https://image.tmdb.org/t/p/w500/nZirljb8XYbKTWsRQTplDGhx39Q.jpg', '2064-02-06', 'Released', 'Ace Ventura: Pet Detective', 1684),
(229, 7, 0, 98, NULL, 'tt0109348', b'0', 'en', 'Set in 1920\'s New York City, this movie tells the story of idealistic young playwright David Shayne. Producer Julian Marx finally finds funding for the project from gangster Nick Valenti. The catch is that Nick\'s girl friend Olive Neal gets the part of a psychiatrist, and Olive is a bimbo who could never pass for a psychiatrist as well as being a dreadful actress. Agreeing to this first compromise is the first step to Broadway\'s complete seduction of David, who neglects longtime girl friend Ellen. Meanwhile David puts up with Warner Purcell, the leading man who is a compulsive eater, Helen Sinclair, the grand dame who wants her part jazzed up, and Cheech, Olive\'s interfering hitman / bodyguard. Eventually, the playwright must decide whether art or life is more important.', 5, 'https://image.tmdb.org/t/p/w500/tfplmiNdTDHHbZZ8AGmXBiB1xJj.jpg', '2064-10-15', 'Released', 'Bullets Over Broadway', 130),
(230, 6, 45000000, 119, NULL, 'tt0109446', b'0', 'en', 'A street-wise kid, Mark Sway, sees the suicide of Jerome Clifford, a prominent Louisiana lawyer, whose current client is Barry \'The Blade\' Muldano, a Mafia hit-man. Before Jerome shoots himself, he tells Mark where the body of a Senator is buried. Clifford shoots himself and Mark is found at the scene, and both the FBI and the Mafia quickly realize that Mark probably knows more than he says.', 15, 'https://image.tmdb.org/t/p/w500/bCWpxGGcP9DsCLwfNpnfcl1vLk8.jpg', '2064-07-21', 'Released', 'The Client', 287),
(231, 6, 15000000, 95, NULL, 'tt0113819', b'0', 'en', 'When Lenny and his wife, Amanda, adopt a baby, Lenny realizes that his son is a genius and becomes obsessed with finding the boy\'s biological mother in hopes that she will be brilliant too. But when he learns that Max\'s mother is Linda Ash, a kindhearted prostitute and porn star, Lenny is determined to reform her immoral lifestyle. A Greek chorus chimes in to relate the plot to Greek mythology in this quirky comedy.', 15, 'https://image.tmdb.org/t/p/w500/2NcPyb9vPehZ0aOjYayDAW1XeVy.jpg', '2065-09-14', 'Released', 'Mighty Aphrodite', 145),
(232, 6, 0, 115, NULL, 'tt0109484', b'0', 'en', 'When Manny Singer\'s wife dies, his young daughter Molly becomes mute and withdrawn. To help cope with looking after Molly, he hires sassy housekeeper Corrina Washington, who coaxes Molly out of her shell and shows father and daughter a whole new way of life. Manny and Corrina\'s friendship delights Molly and enrages the other townspeople.', 6, 'https://image.tmdb.org/t/p/w500/lUmJNC3RAW0OxAtDP8CDEld9pFq.jpg', '2064-08-13', 'Released', 'Corrina, Corrina', 83),
(233, 7, 15000000, 102, NULL, 'tt0109506', b'0', 'en', 'Exactly one year after young rock guitarist Eric Draven and his fiancÃ©e are brutally killed by a ruthless gang of criminals, Draven -- watched over by a hypnotic crow -- returns from the grave to exact revenge.', 15, 'https://image.tmdb.org/t/p/w500/vrQZSCP3WeYXCTXdJQ6mXgxb9L4.jpg', '2064-05-12', 'Released', 'The Crow', 980),
(234, 6, 62000000, 141, NULL, 'tt0109444', b'0', 'en', 'CIA Analyst Jack Ryan is drawn into an illegal war fought by the US government against a Colombian drug cartel.', 7, 'https://image.tmdb.org/t/p/w500/avRDucB3FLf1Xz5532hbOYd1giX.jpg', '2064-08-04', 'Released', 'Clear and Present Danger', 390),
(235, 7, 0, 116, NULL, 'tt0110299', b'0', 'it', 'Fiore, an Italian conman, arrives in post Communist Albania with Gino, his young apprentice, to set up a shoe factory that will never open. The con requires a native Albanian, so they designate Spiro, an impoverished and confused former political prisoner as chairman of the board. When Fiore returns to Italy to get government funds for the project, Spiro unexpectedly disappears and Gino sets out on a journey to find him. The search leads him to discover Spiro\'s tragic personal history and witness Albanian poverty firsthand.', 1, 'https://image.tmdb.org/t/p/w500/407nYlg60AOj95lqDZ4tvUTTm1k.jpg', '2064-01-03', 'Released', 'Lamerica', 11),
(236, 7, 0, 104, NULL, 'tt0109045', b'0', 'en', 'Two drag-queens and a transsexual contract to perform a drag show at a resort in Alice Springs, a resort town in the remote Australian desert. They head west from Sydney aboard their lavender bus, Priscilla. En route, it is discovered that the woman they\'ve contracted with is the wife of one of the drag queens. Their bus breaks down, and is repaired by Bob, who travels on with them.', 8, 'https://image.tmdb.org/t/p/w500/pmHRJPlAEiYATBIgKAa0IyY6Or7.jpg', '2064-06-01', 'Released', 'The Adventures of Priscilla, Queen of the Desert', 174),
(237, 6, 0, 128, NULL, 'tt0109450', b'0', 'en', 'Al Stump is a famous sports-writer chosen by Ty Cobb to co-write his official, authorized \'autobiography\' before his death. Cobb, widely feared and despised, feels misunderstood and wants to set the record straight about \'the greatest ball-player ever,\' in his words.', 2, 'https://image.tmdb.org/t/p/w500/k6FYPlBJbH6e7UrDQ9B6LTNDSkD.jpg', '2064-12-03', 'Released', 'Cobb', 29),
(238, 5, 46000000, 91, NULL, 'tt0109813', b'0', 'en', 'Modern Stone Age family the Flintstones hit the big screen in this live-action version of the classic cartoon. Fred helps Barney adopt a child. Barney sees an opportunity to repay him when Slate Mining tests its employees to find a new executive. But no good deed goes unpunished.', 15, 'https://image.tmdb.org/t/p/w500/dnYXJZgstixBsOjF4JJrPCDRd2n.jpg', '2064-05-27', 'Released', 'The Flintstones', 559),
(239, 8, 55000000, 142, NULL, 'tt0109830', b'0', 'en', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. \'Forrest Gump\' is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.', 48, 'https://image.tmdb.org/t/p/w500/yE5d3BUhE8hCnkMUJOo1QDoOGNz.jpg', '2064-07-07', 'Released', 'Forrest Gump', 8147),
(240, 5, 0, 100, NULL, 'tt0112499', b'0', 'en', 'In a depressed Texas town, British foreign exchange teacher Anna attempts to inject some life into her hopeless kids by introducing them to soccer. They\'re terrible at first, but Anna and her football-hero assistant whip them into shape. As they work overtime, the pair help kids build their self-esteem and also get involved in solving family squabbles.', 5, 'https://image.tmdb.org/t/p/w500/erWfSEcjO4LG69Tlm2mED5JMSqH.jpg', '2065-09-30', 'Released', 'The Big Green', 41),
(241, 6, 6000000, 117, 'http://workingtitlefilms.com/film.php?filmID=59', 'tt0109831', b'0', 'en', 'Four Weddings And A Funeral is a British comedy about a British Man named Charles and an American Woman named Carrie who go through numerous weddings before they determine if they are right for one another.', 8, 'https://image.tmdb.org/t/p/w500/md9kMKnLG8LG4pMDM98gy5x4K5L.jpg', '2064-03-10', 'Released', 'Four Weddings and a Funeral', 654),
(242, 6, 0, 127, NULL, 'tt0113305', b'0', 'en', 'Malik (Omar Epps) is an African-American student attending on a track scholarship; academics are not his strong suit, and he goes in thinking that his athletic abilities will earn him a free ride through college. Fudge (Ice Cube), a \"professional student\" who has been at Columbus for six years so far, becomes friendly with Malik and challenges his views about race and politics in America.', 7, 'https://image.tmdb.org/t/p/w500/cLeOjovcDq9kULToHuoXa1xmvET.jpg', '2065-01-12', 'Released', 'Higher Learning', 49),
(243, 5, 45000000, 123, NULL, 'tt0110093', b'0', 'en', 'Rival Chicago reporters Sabrina Peterson (Roberts) and Peter Brackett (Nolte) reluctantly join forces to uncover a train wreck conspiracy and bite off more than they can chew while pursuing the story and bickering along the way - and falling in love, despite the fact that he\'s many years older than she.Sabrina is an ambitious, gifted reporter willing to do whatever it takes to learn the truth about the train accident, which leads her into conflict, then reluctant partnership, with fading star newsman Peter who works for a rival paper. He is her polar opposite: he chases women, smokes cigars, and has just published his first novel. During their pursuit of the story, Peter and Sabrina clash over virtually everything - he also subjects Sabrina to indecent exposure in front of a group of boy scouts after he catches her skinny dipping.', 3, 'https://image.tmdb.org/t/p/w500/kOiWROfIm3Drk4EHr4XdNKNk5oZ.jpg', '2064-06-30', 'Released', 'I Love Trouble', 41),
(244, 6, 0, 104, NULL, 'tt0110091', b'0', 'en', 'Lisette and husband Chino face marital difficulties. She is fed up with the kids, while he has job troubles. His mother Rosaria hates Lisette and the neighborhood tramp has designs on Chino. Things get even worse when Chino goes to jail and Lisette gets a good job uptown. Can this marriage be saved?', 0, 'https://image.tmdb.org/t/p/w500/5KYvQJGgrvceGhsRe8ydSpU7A8a.jpg', '2064-10-15', 'Released', 'I Like It Like That', 4),
(245, 7, 0, 180, NULL, 'tt0107472', b'0', 'en', 'This documentary recounts the life and work of one of most famous, and yet reviled, German film directors in history, Leni Riefenstahl. The film recounts the rise of her career from a dancer, to a movie actor to the most important film director in Nazi Germany who directed such famous propaganda films as Triumph of the Will and Olympiad. The film also explores her later activities after Nazi Germany\'s defeat in 1945 and her disgrace for being so associated with it which includes her amazingly active life over the age of 90.', 0, 'https://image.tmdb.org/t/p/w500/lTiL9emewC7DLS9A9O5aZf7Ywum.jpg', '2063-09-13', 'Released', 'Die Macht der Bilder: Leni Riefenstahl', 5),
(246, 6, 0, 115, NULL, 'tt0113158', b'0', 'en', 'Sadie looks up to her older sister Georgia, a successful folk singer who\'s happily married with children, but can\'t break out of the bar-band circuit and hit the big time she desperately covets. It\'s in part due to her attraction to drugs and booze, and also to her own unwise choice in men. Finally, though, Sadie\'s Achilles heel is a rough, unlovely voice very different than her sister\'s crowd-pleasing singing.', 4, 'https://image.tmdb.org/t/p/w500/5OTTRuKfiso75xofN8Vl5mRXOQP.jpg', '2065-05-20', 'Released', 'Georgia', 15),
(247, 6, 0, 115, NULL, 'tt0109504', b'0', 'en', 'From Spike Lee comes this vibrant semi-autobiographical portrait of a school-teacher, her stubborn jazz-musician husband and their five kids living in \'70s Brooklyn.', 2, 'https://image.tmdb.org/t/p/w500/iFqe07F78SO0SIBzWcK4I5MwNvP.jpg', '2064-05-14', 'Released', 'Crooklyn', 31),
(248, 5, 0, 111, NULL, 'tt0110213', b'0', 'en', 'Raised by wild animals since childhood, Mowgli is drawn away from the jungle by the beautiful Kitty. But Mowgli must eventually face corrupt Capt. Boone, who wants both Kitty\'s hand and the treasures of Monkey City â a place only Mowgli can find.', 10, 'https://image.tmdb.org/t/p/w500/6BhybPISxk116taUo9J76tVo1hs.jpg', '2064-12-24', 'Released', 'The Jungle Book', 107),
(249, 6, 0, 101, NULL, 'tt0110167', b'0', 'en', 'Charlie Lang is a simple, kindhearted New York City cop. When he realizes he has no money to tip waitress Yvonne Biasi, Lang offers her half the winnings of his lottery ticket. Amazingly, the ticket happens to be a winner, in the sum of $4 million. True to his word, Lang proceeds to share the prize money with Biasi, which infuriates his greedy wife, Muriel. Not content with the arrangement, Muriel begins scheming to take all the money.', 11, 'https://image.tmdb.org/t/p/w500/4SSjiAa592zTqko7hHdKcj5d5cS.jpg', '2064-07-30', 'Released', 'It Could Happen to You', 154),
(250, 6, 14000000, 112, NULL, 'tt0111686', b'0', 'en', 'Freddy\'s back â¦ and he\'s badder than ever! Nancy, the historical nemesis of the man with the satanic snarl and pitchfork fingers, discovers that a new monstrous demon has taken on Freddy\'s persona. Can Nancy stop this new threat in time to save her son?', 9, 'https://image.tmdb.org/t/p/w500/oLEZibnraixTE68rTaYv4FEmvYd.jpg', '2064-10-14', 'Released', 'New Nightmare', 297),
(251, 3, 0, 89, NULL, 'tt0113541', b'0', 'en', 'Set in modern times, Alex finds King Arthur\'s sword Excalibur and must prove himself worthy of it.', 0, 'https://image.tmdb.org/t/p/w500/tL9ImxOccEshRlgmrKQabKH2tCd.jpg', '2067-07-10', 'Released', 'Kids of the Round Table', 1),
(252, 7, 0, 108, NULL, 'tt0110877', b'0', 'it', 'Simple Italian postman learns to love poetry while delivering mail to a famous poet; he uses this to woo local beauty Beatrice.', 10, 'https://image.tmdb.org/t/p/w500/qkq2JfINRQi4Iu9VTMMtQFfmGWZ.jpg', '2064-09-23', 'Released', 'Il postino', 181),
(253, 6, 0, 103, NULL, 'tt0113321', b'0', 'en', 'After losing her job, making out with her soon to be ex-boss, and finding out that her daughter plans to spend Thanksgiving with her boyfriend, Claudia Larson has to face spending the holiday with her family. She wonders if she can survive their crazy antics.', 8, 'https://image.tmdb.org/t/p/w500/97EKLaslQ4gzkvALtqGCDOmsGHk.jpg', '2065-11-03', 'Released', 'Home for the Holidays', 39),
(254, 6, 23000000, 101, NULL, 'tt0110475', b'0', 'en', 'When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.', 14, 'https://image.tmdb.org/t/p/w500/v8x8p441l1Bep8p82pAG6rduBoK.jpg', '2064-07-30', 'Released', 'The Mask', 2550),
(255, 6, 0, 125, NULL, 'tt0110588', b'0', 'en', 'Dorothy Parker remembers the heyday of the Algonquin Round Table, a circle of friends whose barbed wit, like hers, was fueled by alcohol and flirted with despair.', 4, 'https://image.tmdb.org/t/p/w500/bLmyaiin2zavjmTsIOaUMT4KC2X.jpg', '2064-09-08', 'Released', 'Mrs. Parker and the Vicious Circle', 20),
(256, 6, 30000000, 83, NULL, 'tt0110622', b'0', 'en', 'Frank Drebin is persuaded out of retirement to go undercover in a state prison. There he is to find out what top terrorist, Rocco, has planned for when he escapes. Frank\'s wife, Jane, is desperate for a baby.. this adds to Frank\'s problems. A host of celebrities at the Academy awards ceremony are humiliated by Frank as he blunders his way trying to foil Rocco.', 10, 'https://image.tmdb.org/t/p/w500/k3F8N3jeqXOpm1qjY7mL8O6vdx.jpg', '2064-03-19', 'Released', 'The Naked Gun 33âINSERT INTO `movie` (`movie_id`, `average_votes`, `budget`, `duration`, `homepage_link`, `imdb_id`, `is_adult`, `main_language`, `overview`, `popularity`, `poster_url`, `release_date`, `status`, `title`, `total_votes`) VALUES
(305, 7, 8000000, 95, 'http://www.theofficialjohncarpenter.com/in-the-mouth-of-madness/', 'tt0113409', b'0', 'en', 'With the disappearance of hack horror writer Sutter Cane, all Hell is breaking loose...literally! Author Cane, it seems, has a knack for description that really brings his evil creepy-crawlies to life. Insurance investigator John Trent is sent to investigate Cane\'s mysterious vanishing act and ends up in the sleepy little East Coast town of Hobb\'s End.', 8, 'https://image.tmdb.org/t/p/w500/xgrCUFFimv5gom3X01KpLIPVt1E.jpg', '2064-12-13', 'Released', 'In the Mouth of Madness', 307),
(306, 7, 3500000, 91, 'http://www.newline.com/properties/friday.html', 'tt0113118', b'0', 'en', 'Craig and Smokey are two guys in Los Angeles hanging out on their porch on a Friday afternoon, smoking and drinking, looking for something to do.', 14, 'https://image.tmdb.org/t/p/w500/kkoGT4bnK5oGiNbzGGcXzrXMSxn.jpg', '2065-04-27', 'Released', 'Friday', 513),
(307, 6, 0, 96, 'http://www.newline.com/properties/abovetherim.html', 'tt0109035', b'0', 'en', 'Story of a promising high school basketball star and his relationships with two brothers, one a drug dealer and the other a former basketball star fallen on hard times and now employed as a security guard.', 4, 'https://image.tmdb.org/t/p/w500/1ng4sowDKOPMJk9xO2G1g1c2DRs.jpg', '2064-03-24', 'Released', 'Above the Rim', 40),
(308, 7, 0, 105, NULL, 'tt0109021', b'0', 'en', 'This film chronicles the life of Lane Frost, 1987 PRCA Bull Riding World Champion, his marriage and his friendships with Tuff Hedeman (three-time World Champion) and Cody Lambert.', 1, 'https://image.tmdb.org/t/p/w500/dNkJp1oOZxiEYFSRyZfcEreGZNS.jpg', '2064-02-27', 'Released', '8 Seconds', 22),
(309, 4, 0, 84, NULL, 'tt0111804', b'0', 'en', 'Stand up comedy by Martin Lawrence, filmed in the Majestic Theater in New York City. Martin Lawrence talks about everything from racism, to relationships, to his childhood.', 0, 'https://image.tmdb.org/t/p/w500/sXoIo05zEY47L6ICjG0RqiVoDwj.jpg', '2064-04-28', 'Released', 'Martin Lawrence: You So Crazy', 4),
(310, 6, 0, 94, NULL, 'tt0106220', b'0', 'en', 'Siblings Wednesday and Pugsley Addams will stop at nothing to get rid of Pubert, the new baby boy adored by parents Gomez and Morticia. Things go from bad to worse when the new \"black widow\" nanny, Debbie Jellinsky, launches her plan to add Fester to her collection of dead husbands.', 17, 'https://image.tmdb.org/t/p/w500/zEwEXGDvJ8Ou2s6XbLMPvMTX53S.jpg', '2063-11-21', 'Released', 'Addams Family Values', 537),
(311, 6, 19000000, 108, 'http://www.miramax.com/movie/from-dusk-till-dawn/', 'tt0116367', b'0', 'en', 'Seth Gecko and his younger brother Richard are on the run after a bloody bank robbery in Texas. They escape across the border into Mexico and will be home-free the next morning, when they pay off the local kingpin. They just have to survive \'from dusk till dawn\' at the rendezvous point, which turns out to be a Hell of a strip joint.', 15, 'https://image.tmdb.org/t/p/w500/ce0d4kM5KxT4x1Oq8JkSuNYevri.jpg', '2066-01-20', 'Released', 'From Dusk Till Dawn', 1644),
(312, 4, 50000000, 91, NULL, 'tt0113010', b'0', 'en', 'Max Kirkpatrick is a cop who protects Kate McQuean, a civil law attorney, from a renegade KGB team out to terminate her', 5, 'https://image.tmdb.org/t/p/w500/ew0LrIN5fpxdimrErEy9Yry3Nn2.jpg', '2065-11-04', 'Released', 'Fair Game', 54),
(313, 7, 34000000, 139, NULL, 'tt0106226', b'0', 'en', 'Tale of 19th century New York high society in which a young lawyer falls in love with a woman separated from her husband, while he is engaged to the woman\'s cousin.', 8, 'https://image.tmdb.org/t/p/w500/xdkFwyufgtTR4E9rk4CL2r4l00a.jpg', '2063-09-19', 'Released', 'The Age of Innocence', 172),
(314, 5, 0, 92, NULL, 'tt0109068', b'0', 'en', 'The Lone Rangers have heavy-metal dreams and a single demo tape they can\'t get anyone to play. The solution: Hijack an AM rock station and hold the deejays hostage until they agree to broadcast the band\'s tape.', 7, 'https://image.tmdb.org/t/p/w500/jx06ghWxAC0BdrxUa03rti81RcY.jpg', '2064-08-06', 'Released', 'Airheads', 222),
(315, 6, 0, 92, NULL, 'tt0112702', b'0', 'en', 'Cosmo, an affectless mob bookie who lives in the basement of a retirement home, is promoted to hitman. He learns his new trade from Steve, a seasoned killer. He falls in love with a yoga teacher, Jasmine, and must figure out a way to leave the mob so they can be together.', 2, 'https://image.tmdb.org/t/p/w500/oRZRUO11vOnsSnHMQATeNM06Lsu.jpg', '2065-09-16', 'Released', 'Coldblooded', 13),
(316, 6, 3200000, 100, NULL, 'tt0109219', b'0', 'en', 'During the 1980s, uptight Ted Boynton is a salesman working in the Barcelona office of a Chicago-based company. He receives an unexpected visit from his cousin Fred, a naval officer who has come to Spain on a public relations mission for a U.S. fleet. Not exactly friends in the past, Ted and Fred strike up relationships with women in the Spanish city and experience conflicts -- Ted with his employer, and Fred with the Barcelona community.', 1, 'https://image.tmdb.org/t/p/w500/ykfnXaAvepoUeGpDlqQTLAcTjjr.jpg', '2064-07-30', 'Released', 'Barcelona', 20),
(317, 4, 0, 105, NULL, 'tt0106292', b'0', 'en', 'Chris and Bill are called upon for their excellent surveillance record to stakeout a lakeside home where a Mafia trial witness is believed to be heading or already hiding. Unlike their earlier _Stakeout_, this time they are accompanied by Gina Garret from the DA\'s office and her pet rottweiler \'Archie\'; their cover, husband and wife with son Bill.', 12, 'https://image.tmdb.org/t/p/w500/zDQrp5ZL29j98nOk1SKZENAfYs0.jpg', '2063-07-24', 'Released', 'Another Stakeout', 58),
(318, 5, 0, 93, NULL, 'tt0106400', b'0', 'en', 'Jed Clampett and kin move from Arkansas to Beverly Hills when he becomes a billionaire, after an oil strike. The country folk are very naive with regard to life in the big city, so when Jed starts a search for a new wife there are inevitably plenty of takers and con artists ready to make a fast buck', 5, 'https://image.tmdb.org/t/p/w500/idzXsphp93p4a2CurbjACcqTVMq.jpg', '2063-10-17', 'Released', 'The Beverly Hillbillies', 86),
(319, 6, 0, 88, NULL, 'tt0109279', b'0', 'en', 'The fates of horses, and the people who own and command them, are revealed as Black Beauty narrates the circle of his life.', 8, 'https://image.tmdb.org/t/p/w500/e8LdBWsUzjjvUjMwgfaAukQXg3i.jpg', '2064-07-30', 'Released', 'Black Beauty', 68),
(320, 5, 50000000, 104, NULL, 'tt0109254', b'0', 'en', 'Back in sunny southern California and on the trail of two murderers, Axel Foley again teams up with LA cop Billy Rosewood. Soon, they discover that an amusement park is being used as a front for a massive counterfeiting ring â and it\'s run by the same gang that shot Billy\'s boss.', 11, 'https://image.tmdb.org/t/p/w500/tw9gAhqQcBFX0X0XfVbWqUsmzoU.jpg', '2064-05-25', 'Released', 'Beverly Hills Cop III', 445),
(321, 5, 40000000, 122, NULL, 'tt0106379', b'0', 'en', 'One man must learn the meaning of courage across four lifetimes centuries apart.', 2, 'https://image.tmdb.org/t/p/w500/eFf8wEH273Bij2O9d9LCLDu4fdU.jpg', '2064-05-07', 'Released', 'Being Human', 15),
(322, 7, 0, 96, NULL, 'tt0113537', b'0', 'en', 'After college graduation, Grover\'s girlfriend Jane tells him she\'s moving to Prague to study writing. Grover declines to accompany her, deciding instead to move in with several friends, all of whom can\'t quite work up the inertia to escape their university\'s pull. Nobody wants to make any big decisions that would radically alter his life, yet none of them wants to end up like Chet, the professional student who tends bar and is in his tenth year of university studies.', 3, 'https://image.tmdb.org/t/p/w500/urPxxjylNUHmoNcGkMgHStMTxhF.jpg', '2065-10-07', 'Released', 'Kicking and Screaming', 36),
(323, 6, 0, 106, NULL, 'tt0109297', b'0', 'en', 'Emma is an attractive girl in her 20s who has been blind for 20 years. A new type of eye operation partially restores her sight, but she is having problems: sometimes she doesn\'t \"remember\" what she\'s seen until later. One night she is awakened by a commotion upstairs. Peering out of her door, she sees a shadowy figure descending the stairs. Convinced that her neighbour has been murdered she approaches the police, only to find that she is unsure if it was just her new eyes playing tricks on her.', 3, 'https://image.tmdb.org/t/p/w500/mmy2q3CoDlmVl3SmnlIdoGIo5MT.jpg', '2064-01-28', 'Released', 'Blink', 45),
(324, 6, 0, 121, 'http://www.mgm.com/#/our-titles/215/Blown-Away', 'tt0109303', b'0', 'en', 'Blown Away tells the story of Jimmy Dove who works for the Boston bomb squad. Shortly after Dove leaves the force his partner is killed by a bomb that Dove thinks might have been made by someone he knows.', 13, 'https://image.tmdb.org/t/p/w500/elDZEW6wkGHTAwIUDrNMARNgxPY.jpg', '2064-07-02', 'Released', 'Blown Away', 126),
(325, 5, 0, 108, NULL, 'tt0109305', b'0', 'en', 'Pete Bell, a college basketball coach is under a lot of pressure. His team aren\'t winning and he cannot attract new players. The stars of the future are secretly being paid by boosters. This practice is forbidden in the college game, but Pete is desperate and has pressures from all around.', 6, 'https://image.tmdb.org/t/p/w500/upew7DDF9ueZ0Wq9jT71fPpCtiK.jpg', '2064-02-20', 'Released', 'Blue Chips', 41),
(326, 5, 13000000, 87, NULL, 'tt0106452', b'0', 'en', 'When Environmental Protection Agency inspector Steve Malone travels to a remote military base in order to check for toxic materials, he brings his family along for the ride. After arriving at the base, his teenage daughter Marti befriends Jean Platt, daughter of the base\'s commander, General Platt. When people at the base begin acting strangely, Marti becomes convinced that they are slowly being replaced by plant-like aliens.', 6, 'https://image.tmdb.org/t/p/w500/4GLnErLrLfban9JDCOsxB9Xeegq.jpg', '2063-06-11', 'Released', 'Body Snatchers', 102),
(327, 6, 0, 101, NULL, 'tt0109306', b'0', 'en', 'Hank Marshall is a tough, square-jawed, straitlaced Army engineer and nuclear science expert, assigned to help conduct weapons-testing in 1950\'s America. Hank has become a thorn in the side of the Army, though, for a couple of very different reasons. He is an outspoken opponent of atmospheric testing, though his superiors hold contrary views and want to squelch his concerns...and his reports. The other problem is his wife, Carly. She is voluptuous and volatile, wreaking havoc in his personal life and stirring up intrigue at each new Army base.', 4, 'https://image.tmdb.org/t/p/w500/wTj6LHt0Q1ReMqLuehawOjXh0ch.jpg', '2064-09-17', 'Released', 'Blue Sky', 28),
(328, 6, 0, 175, NULL, 'tt0113828', b'0', 'fr', 'In France during World War II, a poor and illiterate man, Henri Fortin (Jean-Paul Belmondo), is introduced to Victor Hugo\'s classic novel Les MisÃ©rables and begins to see parallels between the book and his own life.', 1, 'https://image.tmdb.org/t/p/w500/ePJCk8puXx28CtvpSpmezpwfVt8.jpg', '2065-03-23', 'Released', 'Les misÃ©rables', 8),
(329, 4, 0, 107, NULL, 'tt0106471', b'0', 'en', 'A top surgeon is besotted with a beautiful woman who once ditched him. Unable to come to terms with life without her, he tries to convince her that they need each other. She has other ideas, but an horrific accident leaves her at his mercy. The plot is bizarre and perhaps sick at times, ending abruptly and with a twist.', 4, 'https://image.tmdb.org/t/p/w500/eEiCGxRMhU1pAZj03GmnjtVGEiR.jpg', '2063-06-20', 'Released', 'Boxing Helena', 59),
(330, 5, 0, 87, NULL, 'tt0115644', b'0', 'en', 'The seeds of love are planted when Lisa, a high-powered investment banker, receives flowers from a secret admirer. But when his fairy-tale fantasies clash with her workaholic ways, they soon find out that sometimes, it\'s harder than it seems for love to conquer all.', 10, 'https://image.tmdb.org/t/p/w500/kTEpzjzyeYER1WuCm7Seul4Fatc.jpg', '2066-01-27', 'Released', 'Bed of Roses', 27),
(331, 4, 0, 80, NULL, 'tt0109361', b'0', 'en', 'A foul-mouthed finishing school graduate mistakenly winds up on an ill-fated fishing boat, and faces the wrath of a crew that considers him bad luck.', 1, 'https://image.tmdb.org/t/p/w500/yO66Qjbj1Qlm3war4Z18hjXrYkV.jpg', '2064-01-09', 'Released', 'Cabin Boy', 28),
(332, 3, 13000000, 90, 'http://www.sonymoviechannel.com/movies/calendar-girl/details', 'tt0106505', b'0', 'en', 'Like many adolescent boys, Roy Darpinian had the hots for movie divas, and one in particular was his wet dream as half of America\'s in the 1950s: Marilyn Monroe. The difference is, one summer holiday he actually decided to enlist his spineless buddies, Scott Foreman and Ned Bleuer, to actually drive all the way to Hollywood and make as many desperate attempts as it takes to meet her or get arrested trying, and no setback or embarrassment (even publicly bare-ass) can stop or distract him. Against all odds, he finally even got a chance to help her...', 1, 'https://image.tmdb.org/t/p/w500/lr24NrKyzKjkAtFOi0uveKeqfIE.jpg', '2063-09-05', 'Released', 'Calendar Girl', 10),
(333, 4, 0, 99, NULL, 'tt0109198', b'0', 'en', 'Four former harlots try to leave the wild west (Colorado, to be exact) and head north to make a better life for themselves. Unfortunately someone from Cody\'s past won\'t let it happen that easily.', 14, 'https://image.tmdb.org/t/p/w500/eaGOVOI4BZG7xFOzMdDpfAhDOWJ.jpg', '2064-04-23', 'Released', 'Bad Girls', 61),
(334, 7, 30000000, 144, NULL, 'tt0106519', b'0', 'en', 'A Puerto-Rican ex-con, just released from prison, pledges to stay away from drugs and violence despite the pressure around him and lead on to a better life outside of NYC.', 8, 'https://image.tmdb.org/t/p/w500/tGPqPHuOCbyFxwllrYgKkPDu9xB.jpg', '2063-11-12', 'Released', 'Carlito\'s Way', 805),
(335, 5, 17080000, 107, NULL, 'tt0109067', b'0', 'en', 'Jimmy Dolan is a college basketball coach who wants a big promotion. To get it, he needs to make a dramatic find. He ends up deep in Africa, hoping to recruit Saleh, a huge basketball prodigy Jimmy glimpsed in a home movie. But Saleh is the chief\'s son and has responsibilities at home, since the tribe\'s land is threatened by a mining company with its own hotshot basketball team.', 1, 'https://image.tmdb.org/t/p/w500/9DqFILk5EHGRpBF1nM0lcFkjEdC.jpg', '2064-01-09', 'Released', 'The Air Up There', 42),
(336, 4, 0, 116, NULL, 'tt0109439', b'0', 'en', 'On Mitch Robbins 40th birthday begins quite well until he returns home and finds his brother Glen, the black sheep of the family, in his sofa. Nevertheless he is about to have a wonderful birthday-night with his wife when he discovers a treasure map of Curly by chance. Together with Phil and unfortunately with Glen he tries to find the hidden gold of Curly\'s father in the desert of Arizona.', 8, 'https://image.tmdb.org/t/p/w500/gh0lsyJARglhpbKmnY8i8M7V5bI.jpg', '2064-06-11', 'Released', 'City Slickers II: The Legend of Curly\'s Gold', 103),
(337, 5, 0, 107, NULL, 'tt0109443', b'0', 'en', 'Pogue is a private eye with a problem: every morning when he wakes up, he has total amnesia, waking up with a \'blank slate\'. Since he is in the middle of a hot investigation and has a developing romance, this is less than convenient.', 2, 'https://image.tmdb.org/t/p/w500/kAYsvQvBVshLHGTIDGHcj9jTJq0.jpg', '2064-05-07', 'Released', 'Clean Slate', 25),
(338, 7, 22000000, 121, NULL, 'tt0106489', b'0', 'en', 'Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngster\'s growing attraction - forbidden in his neighborhood - for a beautiful black girl.', 6, 'https://image.tmdb.org/t/p/w500/wlYIwDwk53R4h0uMnpK1NAhHqdg.jpg', '2063-09-16', 'Released', 'A Bronx Tale', 447),
