(340, 6, 70000000, 112, NULL, 'tt0106582', b'0', 'en', 'A year after losing his friend in a tragic 4,000-foot fall, former ranger Gabe Walker and his partner, Hal, are called to return to the same peak to rescue a group of stranded climbers, only to learn the climbers are actually thieving hijackers who are looking for boxes full of money.', 9, 'https://image.tmdb.org/t/p/w500/8XefYka77ypAnPJvaVlfUGBBs4a.jpg', '2063-05-30', 'Released', 'Cliffhanger', 600),
(341, 4, 0, 88, NULL, 'tt0106598', b'0', 'en', 'With enormous cone-shaped heads, robotlike walks and an appetite for toilet paper, aliens Beldar and Prymatt don\'t exactly blend in with the population of Paramus, N.J. But for some reason, everyone believes them when they say they\'re from France! As the odd \"Saturday Night Live\" characters settle into middle-class life in this feature-length comedy, a neighbor admires their daughter.', 10, 'https://image.tmdb.org/t/p/w500/9vuFI0xV1yZfsWr23evJlkRDL8j.jpg', '2063-07-25', 'Released', 'Coneheads', 228),
