(343, 5, 0, 93, NULL, 'tt0109480', b'0', 'en', 'Hard-as-nails cop Jake Stone moves in with the Robbersons so he can watch a hitman who has moved in next door. The Hitman is one thing, but can you survive the Robberson family.', 7, 'https://image.tmdb.org/t/p/w500/wnkWgFU5UcLwbExCp1YtCg5Ox4E.jpg', '2064-04-16', 'Released', 'Cops & Robbersons', 36),
