(345, 6, 20000000, 108, NULL, 'tt0114367', b'0', 'en', '(SIRIUS 6B, Year 2078) On a distant mining planet ravaged by a decade of war, scientists have created the perfect weapon: a blade-wielding, self-replicating race of killing devices known as Screamers designed for one purpose only -- to hunt down and destroy all enemy life forms.', 12, 'https://image.tmdb.org/t/p/w500/aFEs7D7IQ2IehTsniRIojDkiDl6.jpg', '2065-09-09', 'Released', 'Screamers', 154),
(346, 6, 0, 110, NULL, 'tt0106673', b'0', 'en', 'Bill Mitchell is the philandering and distant President of the United States. Dave Kovic is a sweet-natured and caring Temp Agency operator, who by a staggering coincidence looks exactly like the President. As such, when Mitchell wants to escape an official luncheon, the Secret Service hires Dave to stand in for him. Unfortunately, Mitchell suffers a severe stroke whilst having sex with one of his aides, and Dave finds himself stuck in the role indefinitely. The corrupt and manipulative Chief of Staff, Bob Alexander, plans to use Dave to elevate himself to the White House - but unfortunately, he doesn\'t count on Dave enjoying himself in office, using his luck to make the country a better place, and falling in love with the beautiful First Lady...', 13, 'https://image.tmdb.org/t/p/w500/d8RP3iz7QVlkPAuEX4y6jMd2rC2.jpg', '2063-05-09', 'Released', 'Dave', 205),
(347, 7, 6900000, 102, NULL, 'tt0106677', b'0', 'en', 'The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a \"no drugs\" pledge.', 6, 'https://image.tmdb.org/t/p/w500/ksw0G7zSM98rKZWNwl5EuEgpXpt.jpg', '2063-09-26', 'Released', 'Dazed and Confused', 588),
(348, 7, 0, 70, NULL, 'tt0113973', b'0', 'en', 'A look into the many lives of Christa PÃ¤ffgen, otherwise known as Nico; from cutie German mÃ¤dchen to the first of the supermodels, to glamorous diva of the Velvet Underground, to cult item, junkie and hag. Many faces for the same woman, whom, you realize, just couldn\'t bring herself to care enough to live.', 0, 'https://image.tmdb.org/t/p/w500/tuIDKBp92R4tGFOB46MofvakfiY.jpg', '2065-02-19', 'Released', 'Nico Icon', 3),
(349, 6, 57000000, 115, 'http://www.warnerbros.com/demolition-man', 'tt0106697', b'0', 'en', 'Simon Phoenix, a violent criminal cryogenically frozen in 1996, has escaped during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, John Spartan, who had also been cryogenically frozen when wrongfully accused of killing 30 innocent people while apprehending Phoenix.', 11, 'https://image.tmdb.org/t/p/w500/k0PN3Ho12cGGIVJW7SCS7apLYaP.jpg', '2063-10-10', 'Released', 'Demolition Man', 1018),
(350, 7, 0, 109, NULL, 'tt0109729', b'0', 'en', 'Bruce Brown, king of surfing documentaries, returns after nearly thirty years to trace the steps of two young surfers to top surfing spots around the world. Along the way we see many of the people and locales Bruce visited during the filming of Endless Summer (1966).', 0, 'https://image.tmdb.org/t/p/w500/uNWiRuJWa4yRd4DsjonnWn7gEQG.jpg', '2064-06-04', 'Released', 'The Endless Summer 2', 12),
(351, 5, 0, 108, NULL, 'tt0106660', b'0', 'en', 'A New York film director, working on his latest movie in Los Angeles, begins to reflect the actions in his movie and real life, especially when he begins an affair with the lead actress.', 2, 'https://image.tmdb.org/t/p/w500/uA33fZpS0EBDfo0v9dQ1oiOUSpf.jpg', '2063-11-21', 'Released', 'Dangerous Game', 9),
(352, 5, 0, 91, NULL, 'tt0106873', b'0', 'en', 'A spoof of the late 80s and early 90s suspense thrillers and murder mysteries, including Basic Instinct, Sleeping With The Enemy, Cape Fear and others. A cop/attorney (yes he\'s both) is seduced by a woman while his wife is having an affair with a mechanic. Lots of other sublots and visual gags in the style of Naked Gun.', 3, 'https://image.tmdb.org/t/p/w500/sZDp3eHwujNR71aNU0rLDz7phJA.jpg', '2063-10-31', 'Released', 'Fatal Instinct', 37),
(353, 4, 8000000, 96, NULL, 'tt0106834', b'0', 'en', 'Sissy Hankshaw (Uma Thurman) is born with enormous thumbs that help her hitchhiking through the US from a young age.  She becomes a model in advertising and her NY agent \'the Countess\' (John Hurt) sends her to his ranch in CA to shoot a commercial, set against the background of mating whooping cranes.  There, she befriends Bonanza Jellybean (Rain Phoenix), one of the cowgirls at the beauty- ranch.', 2, 'https://image.tmdb.org/t/p/w500/i6EHIy9L2OEWuEA0tnehi9PFkdi.jpg', '2064-05-14', 'Released', 'Even Cowgirls Get the Blues', 29),
(354, 7, 0, 171, NULL, 'tt0106332', b'0', 'zh', 'Abandoned by his prostitute mother in 1920, Douzi was raised by a theater troupe. There he meets Shitou and over the following years the two develop an act entitled, \"Farewell My Concubine,\" that brings them fame and fortune. When Shitou marries Juxian, Doutzi becomes jealous, the beginnings of the acting duo\'s explosive breakup and tragic fall take root.', 4, 'https://image.tmdb.org/t/p/w500/iQ7qq1MStTg5G7ID7vxW2rwfsdW.jpg', '2063-09-18', 'Released', 'é¸çå«å§¬', 98),
(355, 3, 0, 97, NULL, 'tt0109783', b'0', 'en', 'Kathy is married to Peter. Now she can\'t help but wonder how things could have been if she got together with her old boyfriend, Tom. Being married prevents from doing that so she asks her friend, Emily to go to him and see if she can sleep with him then tell Kathy how it was. When Emily tells Kathy that things were awesome, their friendship suffers, at the same so does Kathy\'s marriage. Things get even more complicated when Emily learns she\'s pregnant, and she\'s not certain if it\'s Tom\'s or her boyfriend, Elliot.', 1, 'https://image.tmdb.org/t/p/w500/eKpxCQllaktjfqR11ITbYstcHmD.jpg', '2064-04-30', 'Released', 'The Favor', 6),
(356, 6, 0, 122, NULL, 'tt0106881', b'0', 'en', 'After a terrible air disaster, survivor Max Klein emerges a changed person. Unable to connect to his former life or to wife Laura, he feels godlike and invulnerable. When psychologist Bill Perlman is unable to help Max, he has Max meet another survivor, Carla Rodrigo, who is racked with grief and guilt since her baby died in the crash which she and Max survived.', 9, 'https://image.tmdb.org/t/p/w500/mhJTfQiHdDXcx58dAcMwnq61k0L.jpg', '2063-10-17', 'Released', 'Fearless', 80),
(357, 6, 0, 103, NULL, 'tt0111732', b'0', 'en', 'Convinced he\'ll graduate with honors because of his thesis paper, a stuffy Harvard student finds his paper being held hostage by a homeless man, who might be the guy to school the young man in life.', 2, 'https://image.tmdb.org/t/p/w500/b4fwH4wTvm47P14NSXxaOeQvINM.jpg', '2064-04-30', 'Released', 'With Honors', 54),
(358, 4, 0, 101, NULL, 'tt0111712', b'0', 'en', 'Scandal and mystery reign following the arrival of Edwina in a small Irish town populated entirely by widows. Edwina quickly falls out with the locals while also falling in with the son of the community\'s leader', 0, 'https://image.tmdb.org/t/p/w500/xXyVUwvJesJJChzpvn7xj5cAOfm.jpg', '2064-05-14', 'Released', 'Widows\' Peak', 3),
(359, 6, 0, 126, NULL, 'tt0106926', b'0', 'en', 'Some thirty years after Arlis witnesses his father murdering a family, he runs into Kay, who happens to be the family\'s baby who was spared. Kay and Arlis suspect nothing about each other, but when his father returns, old wounds are reopened.', 1, 'https://image.tmdb.org/t/p/w500/3bSequ38Oi1tWElVTdOKiR24MPP.jpg', '2063-11-07', 'Released', 'Flesh and Bone', 22),
(360, 5, 30000000, 94, NULL, 'tt0106941', b'0', 'en', 'New York concierge Doug Ireland wants to go into business for himself and refurbish a hotel on Roosevelt Island, N.Y., but he needs an investor. With a few weeks left before his option on the site runs out, Doug agrees to help wealthy Christian Hanover conceal his affair with salesgirl Andy Hart from his wife. Despite his own attraction to Andy, Doug tries to stay focused on getting Christian to invest $3 million in his project.', 8, 'https://image.tmdb.org/t/p/w500/j6ETIHrcTYb6roZmnHhoQ0LDsu1.jpg', '2063-10-03', 'Released', 'For Love or Money', 77),
(361, 6, 42000000, 154, NULL, 'tt0106918', b'0', 'en', 'Mitch McDeere is a young man with a promising future in Law. About to sit his Bar exam, he is approached by \'The Firm\' and made an offer he doesn\'t refuse. Seduced by the money and gifts showered on him, he is totally oblivious to the more sinister side of his company. Then, two Associates are murdered. The FBI contact him, asking him for information and suddenly his life is ruined. He has a choice - work with the FBI, or stay with the Firm. Either way he will lose his life as he knows it. Mitch figures the only way out is to follow his own plan...', 9, 'https://image.tmdb.org/t/p/w500/ykoBRyHWvP3akdo98UcIxWAHXeu.jpg', '2063-07-02', 'Released', 'The Firm', 513),
(362, 5, 44000000, 118, NULL, 'tt0116731', b'0', 'en', 'With his gangster boss on trial for murder, a mob thug known as \"the Teacher\" tells Annie Laird she must talk her fellow jurors into a not-guilty verdict, implying that he\'ll kill her son Oliver if she fails. She manages to do this, but, when it becomes clear that the mobsters might want to silence her for good, she sends Oliver abroad and tries to gather evidence of the plot against her, setting up a final showdown.', 6, 'https://image.tmdb.org/t/p/w500/7aXOB0DyZPxNOYbaQ2oiNn64jm3.jpg', '2066-02-03', 'Released', 'The Juror', 91),
(363, 6, 20000000, 112, NULL, 'tt0106965', b'0', 'en', 'When maladjusted orphan Jesse vandalizes a theme park, he is placed with foster parents and must work at the park to make amends. There he meets Willy, a young Orca whale who has been separated from his family. Sensing kinship, they form a bond and, with the help of kindly whale trainer Rae Lindley, develop a routine of tricks. However, greedy park owner Dial soon catches wind of the duo and makes plans to profit from them.', 5, 'https://image.tmdb.org/t/p/w500/vIjiTSNA52VGGP9eeegNaMKXNhf.jpg', '2063-07-18', 'Released', 'Free Willy', 429),
(364, 7, 0, 114, NULL, 'tt0109842', b'0', 'en', 'Michael is a 12-year-old drug pusher who lives in a crowded house with his cousins and aunt. His father has become a street bum,but still meets with Fresh on occasion to play chess. Fresh is rather quiet in a crazy world. Fresh\'s sister is a junkie who sleeps with the dealers that Fresh sells for. As the story progresses Fresh realizes that he doesn\'t want to sell drugs anymore - he wants revenge.', 3, 'https://image.tmdb.org/t/p/w500/uXRIIUzjDZZdWR2cUzPJ9eAqaHv.jpg', '2064-08-25', 'Released', 'Fresh', 56),
(365, 7, 44000000, 130, NULL, 'tt0106977', b'0', 'en', 'Wrongfully accused of murdering his wife, Richard Kimble escapes from the law in an attempt to find her killer and clear his name. Pursuing him is a team of U.S. marshals led by Deputy Samuel Gerard, a determined detective who will not rest until Richard is captured. As Richard leads the team through a series of intricate chases, he discovers the secrets behind his wife\'s death and struggles to expose the killer before it is too late.', 10, 'https://image.tmdb.org/t/p/w500/3gzLGFBoJM1xlNk0Ulzp0cJ6uPp.jpg', '2063-08-08', 'Released', 'The Fugitive', 1240),
(366, 5, 35000000, 115, NULL, 'tt0107004', b'0', 'en', 'The Apache Indians have reluctantly agreed to settle on a US Government approved reservation. Not all the Apaches are able to adapt to the life of corn farmers. One in particular, Geronimo, is restless. Pushed over the edge by broken promises and necessary actions by the government, Geronimo and thirty or so other warriors form an attack team which humiliates the government by evading capture, whi', 4, 'https://image.tmdb.org/t/p/w500/cipYLKXoT3PRPIccwUN47bZvYhO.jpg', '2063-12-12', 'Released', 'Geronimo: An American Legend', 44),
(367, 5, 0, 115, NULL, 'tt0109890', b'0', 'en', 'Doc McCoy is put in prison because his partners chickened out and flew off without him after exchanging a prisoner with a lot of money. Doc knows Jack Benyon, a rich \"business\"-man, is up to something big, so he tells his wife (Carol McCoy) to tell him that he\'s for sale if Benyon can get him out of prison. Benyon pulls some strings and Doc McCoy is released again. Unfortunately he has to cooperate with the same person that got him to prison.', 14, 'https://image.tmdb.org/t/p/w500/aqASLZpqGK62bmUI1KLvvEIpKNk.jpg', '2064-02-13', 'Released', 'The Getaway', 81),
(368, 3, 0, 83, NULL, 'tt0109913', b'0', 'en', 'Max is a trendy, pretty, young lesbian, who is having trouble finding love. A friend sets her up with Ely, whom Max likes, but Ely is frumpy, homely, and older. Nor do they have much in common. Can Max learn to look past the packaging?', 0, 'https://image.tmdb.org/t/p/w500/dyKh0Kv9XmG22ZRioJINKMts262.jpg', '2064-06-11', 'Released', 'Go Fish', 5),
(369, 6, 8000000, 116, NULL, 'tt0114660', b'0', 'en', 'A mafia film in Tarantino style with a star-studded cast. Jimmyâs âThe Saintâ gangster career has finally ended. Yet now he finds him self doing favors for a wise godfather known as âThe Man with the Plan.â', 4, 'https://image.tmdb.org/t/p/w500/ysKIolKO0376Nl5DV1fDAAPudEq.jpg', '2065-12-02', 'Released', 'Things to Do in Denver When You\'re Dead', 87),
(370, 4, 30000000, 109, NULL, 'tt0109891', b'0', 'en', 'Ray, an ex-con and widower, is planning a coin heist with two accomplices to help him to buy his own bakery. However, he doesn\'t expect his son Timmy, who was living with Ray\'s sister, to show up at the house right in the middle of planning. Timmy is ignored and Ray and his buddies pull off the heist. Timmy gets his father\'s attention by stealing the coins and hiding them. To get them back, his father must take him to a number of different places and treat him like he enjoys his presence. They grow fond of each other but Timmy won\'t stay with his dad unless he gives up the coins.', 2, 'https://image.tmdb.org/t/p/w500/n8n8wp812DKzLOi9Eow5Ajomm67.jpg', '2064-06-18', 'Released', 'Getting Even with Dad', 43),
(371, 5, 0, 94, NULL, 'tt0109920', b'0', 'en', 'Morgan Leafy is a secretary to the British High Commissioner to an Africa nation. Leafy is a man that makes himself useful to his boss, the snobbish Arthur Fanshawe, who has no clue about what\'s going on around him, but who wants to use his secretary to carry on his dirty work, which involves getting one of the most powerful men in the country to do business with his country.The young secretary has an eye for beautiful women around him, especially Hazel, a native beauty, with whom he is having an affair. Things get complicated because Sam Adekunle, a man running for president of the country, wants a favor from Leafy in return after he has accepted the invitation to visit London. The proposition involves swaying a prominent doctor\'s opposition to a plan that will make Adenkule filthy rich.', 5, 'https://image.tmdb.org/t/p/w500/g5GtunDYY9jqUp2loU92IoTIKWy.jpg', '2064-07-15', 'Released', 'A Good Man in Africa', 11),
(372, 5, 0, 107, NULL, 'tt0107057', b'0', 'en', 'Before a criminal lawyer knows what has happened, she is forced to defend a wife killer she knows is guilty.', 5, 'https://image.tmdb.org/t/p/w500/hQwk4PZdDVJI6SYEEqxx4zqco0j.jpg', '2063-06-06', 'Released', 'Guilty as Sin', 21),
(373, 6, 18000000, 97, NULL, 'tt0107076', b'0', 'en', 'When a woman\'s father goes missing, she enlist a local to aid in her search.  The pair soon discover that her father has died at the hands of a wealthy sportsman who hunts homeless men as a form of recreation.', 7, 'https://image.tmdb.org/t/p/w500/6WEu60V7EzncuFJSVmGJzhFvs4I.jpg', '2063-08-22', 'Released', 'Hard Target', 237),
(374, 6, 25000000, 86, NULL, 'tt0107144', b'0', 'en', 'Topper Harley is found to be working as an odd-job-man in a monastery. The CIA want him to lead a rescue mission into Iraq, to rescue the last rescue team, who went in to rescue the last rescue team who... who went in to rescue hostages left behind after Desert Storm.', 13, 'https://image.tmdb.org/t/p/w500/oOXt9gmvsbnoNAx6s202GDTirfw.jpg', '2063-05-23', 'Released', 'Hot Shots! Part Deux', 463),
(375, 6, 33000000, 140, NULL, 'tt0107096', b'0', 'en', 'Le Ly lives in a small Vietnamese village whose serenity is shattered when war breaks out. Caught between the Viet Cong and the South Vietnamese army, the village is all but destroyed. After being both brutalized and raped, Le Ly resolves to flee. She leaves for the city, surviving desperate situations, but surviving nonetheless. Eventually she meets a U.S. Marine named Steve Butler who treats her kindly and tells her he would like to be married -- maybe to her.', 4, 'https://image.tmdb.org/t/p/w500/hXSUatA39pbfwaqOGFHFdwswAXc.jpg', '2063-12-26', 'Released', 'Heaven & Earth', 51),
(376, 6, 0, 111, NULL, 'tt0112744', b'0', 'en', 'After his daughter died in a hit and run, Freddy Gale has waited six years for John Booth, the man responsible, to be released from prison. On the day of release, Gale visits Booth and announces that he will kill him in one week. Booth uses his time to try and make peace with himself and his entourage, and even finds romance. Gale, whose life is spiraling down because of his obsession towards Booth, will bring himself on the very edge of sanity. At he end of the week, both men will find themselves on a collision course with each other.', 5, 'https://image.tmdb.org/t/p/w500/mMXL84GqES2HYpJ0Zt18I7m6mfU.jpg', '2065-11-16', 'Released', 'The Crossing Guard', 74),
(377, 4, 0, 95, NULL, 'tt0113674', b'0', 'en', 'A group of old friends at a Hens Night discuss their issues, uncertainties, fears and fantasies.', 2, 'https://image.tmdb.org/t/p/w500/Akk7MMkH2g95e6LghQBNrDzKiAy.jpg', '2065-12-09', 'Released', 'Live Nude Girls', 12),
(378, 6, 0, 99, NULL, 'tt0112966', b'0', 'en', 'When an English cartographer arrives in Wales to tell the residents of the Welsh village of Ffynnon Garw  that their \"mountain\" is only a hill, the offended community sets out to remedy the situation.  The film is based on a story heard by Christopher Monger from his grandfather about the real village of Taff\'s Well,  in the old county of Glamorgan, and its neighbouring Garth Hill. However, due to 20th century urbanisation of the area, it was filmed in the more rural Llanrhaeadr-ym-Mochnant and Llansilin areas in Powys.', 5, 'https://image.tmdb.org/t/p/w500/ls7KPoxNiy3IcAot3QB0oFuMtdW.jpg', '2065-05-13', 'Released', 'The Englishman Who Went Up a Hill But Came Down a Mountain', 83),
(379, 7, 0, 85, NULL, 'tt0112445', b'0', 'fa', 'Several people try to take advantage of a little girl\'s innocence to hustle money her mom gave to her to buy a goldfish with.', 1, 'https://image.tmdb.org/t/p/w500/96UDOJNgJXHmQMJqA79bKS9PR8i.jpg', '2065-01-02', 'Released', 'Ø¨Ø§Ø¯Ú©ÙÚ© Ø³ÙÛØ¯', 20),
(380, 4, 0, 100, NULL, 'tt0110064', b'0', 'en', 'Hip Hop duo Kid &amp; Play return in the second follow-up to their 1990 screen debut House Party. Kid (Christopher \"Kid\" Reid) is taking the plunge and marrying his girlfriend Veda (Angela Means), while his friend Play (Christopher Martin) is dipping his toes into the music business, managing a roughneck female rap act called Sex as a Weapon. Play books the ladies for a concert with heavy-hitting pr', 0, 'https://image.tmdb.org/t/p/w500/b6yh57uYZUvpYkH3RKL3ZIvoszl.jpg', '2064-01-03', 'Released', 'House Party 3', 11),
(381, 7, 30000000, 111, NULL, 'tt0110074', b'0', 'en', 'A naive business graduate is installed as president of a manufacturing company as part of a stock scam.', 7, 'https://image.tmdb.org/t/p/w500/olViHNQHPy18SOJvbAI1bXUjHXI.jpg', '2064-03-12', 'Released', 'The Hudsucker Proxy', 280),
(382, 4, 0, 91, NULL, 'tt0110123', b'0', 'en', 'Bones Conway and Jack Kaufman didn\'t really know what they were in for when they enlisted in the U.S. Army; they just wanted to get a job and make some money. But these new recruits are so hapless, they run the risk of getting kicked out before their military careers even begin. Soon, though, they\'re sent to the Middle East to fight for their country -- which they manage to do in their own wacky ways.', 6, 'https://image.tmdb.org/t/p/w500/j7306D476K6bIKKatGL7tLC26ro.jpg', '2064-08-13', 'Released', 'In the Army Now', 54),
(383, 4, 0, 115, NULL, 'tt0114039', b'0', 'en', 'This film relates the story of a tightly connected Afro-American community informally called Colored Town where the inhabitants live and depend on each other in a world where racist oppression is everywhere, as told by a boy called Cliff who spent his childhood there. Despite this, we see the life of the community in all its joys and sorrows, of those that live there while others decide to leave for a better life north. For those remaining, things come to a serious situation when one prominent businessman is being muscled out by a white competitor using racist intimidation. In response, the community must make the decision of whether to submit meekly like they always have, or finally fight for their rights.', 0, 'https://image.tmdb.org/t/p/w500/tsJSlkFSZPQhhVuKrYJXNClYaPD.jpg', '2066-01-27', 'Released', 'Once Upon a Time... When We Were Colored', 2),
(384, 5, 0, 88, NULL, 'tt0106880', b'0', 'en', 'Chronicling the controversial career of bad boys N.W.H. (Niggaz With Hats), this uproarious \'mockumentary\' lampoons all of hardcore rap\'s hot-button issues. This underground laugh riot recounts the rise, fall and resurrection of a clueless bunch of would-be rappers, Ice Cold, Tone-Def &amp; Tasty Taste performing as N.W.H.', 0, 'https://image.tmdb.org/t/p/w500/jrpkn4GuBDS1Kh0lyR1UcXgeMi9.jpg', '2064-10-29', 'Released', 'Fear of a Black Hat', 11),
(385, 5, 40000000, 115, NULL, 'tt0110097', b'0', 'en', 'Matt Hobbs is a talented but unsuccessful actor. When estranged (and strange) ex-wife Beth dumps their daughter Jeannie on Matt, father and daughter have a lot of adjusting to do. His budding relationship with attractive production assistant Cathy Breslow is made complicated, while the precocious child is overly accustomed to getting her own way. Matt eventually faces the choice of family vs career in a particularly difficult way.', 1, 'https://image.tmdb.org/t/p/w500/nTDUwFB9FlNxb6yMI6qJRPNrZcd.jpg', '2064-02-06', 'Released', 'I\'ll Do Anything', 18),
(386, 6, 40000000, 128, NULL, 'tt0107206', b'0', 'en', 'Veteran Secret Service agent Frank Horrigan is a man haunted by his failure to save President Kennedy while serving protection detail in Dallas. Thirty years later, a man calling himself \"Booth\" threatens the life of the current President, forcing Horrigan to come back to protection detail to confront the ghosts from his past.', 12, 'https://image.tmdb.org/t/p/w500/vXgWOXa7m3cEhOhYjR5q2UZCBBp.jpg', '2063-07-10', 'Released', 'In the Line of Fire', 392),
(387, 7, 13000000, 133, NULL, 'tt0107207', b'0', 'en', 'A small time thief from Belfast, Gerry Conlon, is falsely implicated in the IRA bombing of a pub that kills several people while he is in London. He and his four friends are coerced by British police into confessing their guilt. Gerry\'s father and other relatives in London are also implicated in the crime. He spends fifteen years in prison with his father trying to prove his innocence.', 7, 'https://image.tmdb.org/t/p/w500/22UfH59UppgMtDIMjD6DxhO8J2C.jpg', '2063-12-14', 'Released', 'In the Name of the Father', 363),
(388, 3, 0, 110, NULL, 'tt0110137', b'0', 'en', 'The Inkwell is about a 16-year-old boy coming of age on Martha\'s Vineyard in the summer of 1976.', 0, 'https://image.tmdb.org/t/p/w500/uINVYNlnCbSLCkqveGwj7j4oFTf.jpg', '2064-04-23', 'Released', 'The Inkwell', 5),
(389, 6, 0, 118, NULL, 'tt0108551', b'0', 'en', 'A film about the singer Tina Turner and how she rose to stardom with her abusive husband Ike Turner and how she gained the courage to break free.', 14, 'https://image.tmdb.org/t/p/w500/5Bl7O6zyv9Y1uWQ4gaCI2o7NrTE.jpg', '2063-06-11', 'Released', 'What\'s Love Got to Do with It', 75),
(390, 4, 30000000, 112, NULL, 'tt0110197', b'0', 'en', 'Jimmy Alto is an actor wannabe who stumbles into the role of a lifetime. He becomes a vigilante crime-fighter, aided by his sidekick William, who has suffered a head wound and has problems with short-term memory. Jimmy\'s vigilante alter ego soon becomes a media wonder--but Jimmy remains a total unknown and his long-suffering girl friend Lorraine is getting fed up with the whole situation.', 4, 'https://image.tmdb.org/t/p/w500/pMFMuAdQORx4GoGs6HuZyUepIkN.jpg', '2064-03-31', 'Released', 'Jimmy Hollywood', 17),
(391, 0, 0, 108, NULL, 'tt0113612', b'0', 'en', 'Filmed entirely on location in East Hampton, Long Island, \"Last Summer in the Hamptons\" concerns a large theatrical family spending the last weekend of their summer together at the decades-old family retreat which economic circumstances have forced them to put on the market. Victoria Foyt plays a young Hollywood actress whose visit wreaks havoc on the stellar group of family and friends - led by matriarch Viveca Lindfors and made up of an extraordinary mix of prominent New York actors, directors, and playwrights. In the course of a very unusual weekend, comic as well as serious situations arise, and the family\'s secrets - of which there are many - begin to unravel.', 0, 'https://image.tmdb.org/t/p/w500/pfgpkDNcwSi1x4jVzeLqvxTwX5a.jpg', '2065-11-23', 'Released', 'Last Summer in the Hamptons', 0),
(392, 6, 0, 110, NULL, 'tt0107286', b'0', 'en', 'While racing to a boxing match, Frank, Mike, John and Rey get more than they bargained for. A wrong turn lands them directly in the path of Fallon, a vicious, wise-cracking drug lord. After accidentally witnessing Fallon murder a disloyal henchman, the four become his unwilling prey in a savage game of cat &amp; mouse as they are mercilessly stalked through the urban jungle in this taut suspense drama', 5, 'https://image.tmdb.org/t/p/w500/lNXmgUrP6h1nD53gkFh4WDzT6RZ.jpg', '2063-10-17', 'Released', 'Judgment Night', 79),
(393, 7, 63000000, 127, 'http://www.jurassicpark.com/', 'tt0107290', b'0', 'en', 'A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.', 8, 'https://image.tmdb.org/t/p/w500/c414cDeQ9b6qLPLeKmiJuLDUREJ.jpg', '2063-06-13', 'Released', 'Jurassic Park', 4956),
(394, 6, 0, 118, NULL, 'tt0112365', b'0', 'en', 'In Victorian England, wealthy patriarch Sir Harald Alabaster invites an impoverished biologist, William Adamson, into his home. There, William tries to continue his work, but is distracted by Alabaster\'s seductive daughter, Eugenia. William and Eugenia begin a torrid romance, but as the couple become closer, the young scientist begins to realize that dark, disturbing things are happening behind the closed doors of the Alabaster manor.', 2, 'https://image.tmdb.org/t/p/w500/1QyCF6IFoX5WJIYHOkmLa3vzU0r.jpg', '2065-09-11', 'Released', 'Angels and Insects', 17),
(395, 7, 900000, 102, NULL, 'tt0112379', b'0', 'nl', 'After World War II, Antonia and her daughter, Danielle, go back to their Dutch hometown, where Antonia\'s late mother has bestowed a small farm upon her. There, Antonia settles down and joins a tightly-knit but unusual community. Those around her include quirky friend Crooked Finger, would-be suitor Bas and, eventually for Antonia, a granddaughter and great-granddaughter who help create a strong family of empowered women.', 2, 'https://image.tmdb.org/t/p/w500/bIQp2SJrVXiQttv9hXeqliQox0K.jpg', '2065-09-13', 'Released', 'Antonia', 26),
(396, 6, 25000000, 140, NULL, 'tt0107151', b'0', 'en', 'A rancher, his clairvoyant wife and their family face turbulent years in South America.', 10, 'https://image.tmdb.org/t/p/w500/zcm1tp34jNFbTltJhlr7bsvIvmh.jpg', '2063-10-21', 'Released', 'The House of the Spirits', 135),
(397, 6, 0, 103, NULL, 'tt0107322', b'0', 'en', 'Based on the Depression-era bildungsroman memoir of writer A. E. Hotchner, the film follows the story of a boy struggling to survive on his own in a hotel in St. Louis after his mother is committed to a sanatorium with tuberculosis. His father, a German immigrant and traveling salesman working for the Hamilton Watch Company, is off on long trips from which the boy cannot be certain he will return.', 4, 'https://image.tmdb.org/t/p/w500/HzTiZWfb0bdyJoM7Et6XCgfi9X.jpg', '2063-08-22', 'Released', 'King of the Hill', 33),
(398, 6, 0, 94, NULL, 'tt0110305', b'0', 'en', 'An update of the Lassie legend stars Thomas Guiry as a troubled city kid whose family retreats to the country, where he befriends the famous collie and changes for the better. Conflict develops when a ruthless sheep rancher causes trouble for everyone.', 3, 'https://image.tmdb.org/t/p/w500/7RebpDOVAPu28mdWzUGB8GSSQpq.jpg', '2064-07-23', 'Released', 'Lassie', 54),
(399, 6, 9000000, 117, 'http://www.mgm.com/#/our-titles/1024/Kalifornia', 'tt0107302', b'0', 'en', 'A journalist duo go on a tour of serial killer murder sites with two companions, unaware that one of them is a serial killer himself.', 8, 'https://image.tmdb.org/t/p/w500/2mKtsNtQ2yMZPrBL1wXWzolvxaZ.jpg', '2063-09-03', 'Released', 'Kalifornia', 209),
(400, 6, 85000000, 130, NULL, 'tt0107362', b'0', 'en', 'Danny is obsessed with a fictional movie character action hero Jack Slater. When a magical ticket transports him into Jack\'s latest adventure, Danny finds himself in a world where movie magic and reality collide. Now it\'s up to Danny to save the life of his hero and new friend.', 9, 'https://image.tmdb.org/t/p/w500/yeLurMF2Xy3nex17hBbxft6zGR0.jpg', '2063-06-20', 'Released', 'Last Action Hero', 725),
(401, 6, 38000000, 129, NULL, 'tt0118158', b'0', 'en', 'Teenage boys discover discipline and camaraderie on an ill-fated sailing voyage.', 9, 'https://image.tmdb.org/t/p/w500/3a5nomeyzJF4gG26HouCtce99ki.jpg', '2066-02-03', 'Released', 'White Squall', 86),
(402, 5, 0, 98, NULL, 'tt0110353', b'0', 'en', 'Lightning Jack Kane is an Australian outlaw in the wild west. During a bungled bank robbery he picks up mute Ben Doyle as a hostage. The two become good friends, with Jack teaching Ben how to rob banks, while they plan Jack\'s last heist.', 2, 'https://image.tmdb.org/t/p/w500/myB6eGNcJrBnFW2EtTQMX5zmn3M.jpg', '2064-03-12', 'Released', 'Lightning Jack', 40),
(403, 6, 0, 101, NULL, 'tt0107468', b'0', 'en', 'In 1960s China, French diplomat Rene Gallimard falls in love with an opera singer, Song Liling - but Song is not at all who Gallimard thinks.', 6, 'https://image.tmdb.org/t/p/w500/c7oXl40SpsPifAePUiI1KcGu0SX.jpg', '2063-09-11', 'Released', 'M. Butterfly', 35),
(404, 5, 22000000, 111, NULL, 'tt0107478', b'0', 'en', 'A young black woman discovers that her father was a sperm donor, and if that weren\'t bad enough, he\'s white.', 5, 'https://image.tmdb.org/t/p/w500/8swGX78Q5s7z47MRByf1E8MUNqP.jpg', '2063-05-29', 'Released', 'Made in America', 86),
(405, 5, 0, 107, NULL, 'tt0107497', b'0', 'en', 'A tale about a happily married couple who would like to have children. Tracy teaches infants, Andy\'s a college professor. Things are never the same after she is taken to hospital and operated upon by Jed, a \"know all\" doctor.', 9, 'https://image.tmdb.org/t/p/w500/dlTWhgLHdEgSmCa8nEFgN7Hfu05.jpg', '2063-10-01', 'Released', 'Malice', 105);
INSERT INTO `movie` (`movie_id`, `average_votes`, `budget`, `duration`, `homepage_link`, `imdb_id`, `is_adult`, `main_language`, `overview`, `popularity`, `poster_url`, `release_date`, `status`, `title`, `total_votes`) VALUES
(406, 6, 1500000, 96, NULL, 'tt0110265', b'0', 'en', 'Zed (Eric Stoltz) is an American vault-cracker who travels to Paris to meet up with his old friend Eric (Jean-Hugues Anglade). Eric and his gang have planned to raid the only bank in the city which is open on Bastille day. After offering his services, Zed soon finds himself trapped in a situation beyond his control when heroin abuse, poor planning and a call-girl named Zoe all conspire to turn the robbery into a very bloody siege.', 4, 'https://image.tmdb.org/t/p/w500/jAnpPlUUhBqztIfCfg3OKsTYMhu.jpg', '2063-10-03', 'Released', 'Killing Zoe', 111),
(407, 5, 0, 91, NULL, 'tt0107413', b'0', 'en', 'Michael Chapman was once a child TV star. But when he grew up, he couldn\'t get work. So he and his brother, Ed start their own talent agency that specializes in child acts. They can\'t seem to find the next big thing and they have to deal with another agency who\'s not above bribery to get the kids to sign with them. One day Michael meets a girl named Angie and she\'s a real spitfire. Michael thinks she could be what they are looking for. Problem is that she has a big chip on her shoulder.', 6, 'https://image.tmdb.org/t/p/w500/1SXdMpxVh8KFxZQRXxZaeZmVkEl.jpg', '2063-06-06', 'Released', 'Life With Mikey', 24),
(408, 6, 0, 87, NULL, 'tt0115697', b'0', 'en', 'When dignified Albert Donnelly runs for Governor, his team moves to keep his slow-witted and klutzy younger brother, Mike, out of the eye of the media. To baby-sit Mike, the campaign assigns sarcastic Steve, who gets the experience of a lifetime when he tries to take Mike out of town during the election.', 8, 'https://image.tmdb.org/t/p/w500/2wsaboVhKXpsLchoaXi0oWmQ7xM.jpg', '2066-02-02', 'Released', 'Black Sheep', 124),
(409, 7, 13500000, 104, NULL, 'tt0107507', b'0', 'en', 'A middle-aged couple suspects foul play when their neighbor\'s wife suddenly drops dead.', 8, 'https://image.tmdb.org/t/p/w500/6y04YdXDoSNxiJ5g0h92NBiatyv.jpg', '2063-08-20', 'Released', 'Manhattan Murder Mystery', 169),
(410, 5, 55000000, 133, NULL, 'tt0116253', b'0', 'en', 'Terrorists hijack a 747 inbound to Washington D.C., demanding the the release of their imprisoned leader. Intelligence expert David Grant (Kurt Russell) suspects another reason and he is soon the reluctant member of a special assault team that is assigned to intercept the plane and hijackers.', 13, 'https://image.tmdb.org/t/p/w500/wmgkFuEr8bHRAgs1HS5U46Rzo0I.jpg', '2066-03-17', 'Released', 'Executive Decision', 261),
(411, 7, 0, 91, NULL, 'tt0111689', b'0', 'en', 'Jackie and Michael are coworkers at a large law firm, who decide to meet at Jackie\'s for dinner one night.', 0, 'https://image.tmdb.org/t/p/w500/1uMZU6c8Uxlp2OiGQIwGmH4D9EZ.jpg', '2064-09-10', 'Released', 'What Happened Was...', 7),
(412, 6, 0, 105, NULL, 'tt0074102', b'0', 'ja', 'Based on a true story set in pre-war Japan, a man and one of his servants begin a torrid affair. Their desire becomes a sexual obsession so strong that to intensify their ardor, they forsake all, even life itself.', 8, 'https://image.tmdb.org/t/p/w500/ztLv3Co2uLZMV7YERWbPrTMUi03.jpg', '2046-05-17', 'Released', 'æã®ã³ãªã¼ã', 112),
(413, 6, 0, 114, NULL, 'tt0107501', b'0', 'en', 'The story of a relationship between a teacher and his troubled pupil. Justin McLeod is a former teacher who lives as a recluse on the edge of town. His face is disfigured from an automobile accident and fire ten years before in which a boy was incinerated and for which he was convicted of involuntary manslaughter. He is also suspected of being a pedophile. He is befriended by Chuck, causing the town\'s suspicion and hostility to be ignited. McLeod inculcates in his protege a love of justice and freedom from prejudice which sustains him beyond the end of the film.', 5, 'https://image.tmdb.org/t/p/w500/24QERLoucnNZIE0gGYdCFzi58IV.jpg', '2063-08-27', 'Released', 'The Man without a Face', 125),
(414, 6, 8169363, 90, NULL, 'tt0113972', b'0', 'en', 'Gene Watson is a public accountant who arrives on a train at Union Station in Los Angeles, accompanied by his 6-year-old daughter Lynn. Because of his ordinary looks, he is approached by a pair of sinister people named Smith and Jones.', 6, 'https://image.tmdb.org/t/p/w500/3kYcyD9yAjdjimYlIiGPfdMVbZb.jpg', '2065-11-23', 'Released', 'Nick of Time', 190),
(415, 7, 3500000, 97, NULL, 'tt0107554', b'0', 'en', 'Menace II Society is a coming of age tale detailing the summer after its protagonist Caine (Tyrin Turner) graduates from high school. This is Caine\'s story, which details real life in today\'s tough inner city.', 5, 'https://image.tmdb.org/t/p/w500/s1uQMgbK2tfaYltK6uDXU1xoYWA.jpg', '2063-05-28', 'Released', 'Menace II Society', 179),
(416, 7, 8000000, 111, NULL, 'tt0107616', b'0', 'en', 'In this Shakespearean farce, Hero and her groom-to-be, Claudio, team up with Claudio\'s commanding officer, Don Pedro, the week before their wedding to hatch a matchmaking scheme. Their targets are sharp-witted duo Benedick and Beatrice -- a tough task indeed, considering their corresponding distaste for love and each other. Meanwhile, meddling Don John plots to ruin the wedding.', 8, 'https://image.tmdb.org/t/p/w500/6qlYYvDZ0Tb5h0t7sLwy4sjGIwM.jpg', '2063-05-09', 'Released', 'Much Ado About Nothing', 194),
(417, 5, 0, 114, NULL, 'tt0107611', b'0', 'en', 'The story about the relationship between a manic depressive man, Mr Jones, and the female doctor who takes more than a professional interest in his treatment.', 6, 'https://image.tmdb.org/t/p/w500/yeSnOxbdYqHexjZMG91Ep4MAbr8.jpg', '2063-10-10', 'Released', 'Mr. Jones', 35),
(418, 5, 0, 98, NULL, 'tt0107613', b'0', 'en', 'Electrician Gus gets the chance to fulfill a childhood dream by buying an old bowling-alley with some of his friends.', 13, 'https://image.tmdb.org/t/p/w500/8TvSzxbrDvO3vtOC9G0wrBmwqG7.jpg', '2063-10-17', 'Released', 'Mr. Wonderful', 11),
(419, 5, 47000000, 104, NULL, 'tt0117002', b'0', 'en', 'A housemaid falls in love with Dr. Jekyll and his darkly mysterious counterpart, Mr. Hyde.', 12, 'https://image.tmdb.org/t/p/w500/Oesh4pN5J2ing4flkgkiVdxILP.jpg', '2066-02-24', 'Released', 'Mary Reilly', 77),
(420, 4, 12000000, 107, NULL, 'tt0110657', b'0', 'en', 'During a commemoration for Japanese soldiers fighting in the US Army during World War II, Mr. Miyagi meets the widow of his commanding officer. He gets to know her granddaughter Julie, an angry teenager who is still feeling the pain of losing both her parents in an accident and is having problems with her grandmother and her fellow pupils. Mr. Miyagi decides to teach her karate to get her through her pain and issues and back on the right path.', 9, 'https://image.tmdb.org/t/p/w500/gu5SOBWsoxDy6mWKAkOt20zTXOb.jpg', '2064-07-19', 'Released', 'The Next Karate Kid', 202),
(421, 4, 0, 112, NULL, 'tt0110649', b'0', 'en', 'Peter and Katherine Witner are Southern California super-yuppies with great jobs but no center to their lives. When they both lose their jobs and begin marital infidelities, their solution is to start their own business together. In order to find meaning to their empty lives, they follow various New Age gurus and other such groups. Eventually, they hit rock bottom and have make some hard decisions', 0, 'https://image.tmdb.org/t/p/w500/fhtW0cu3HXnftqasdt8ptKOQDjU.jpg', '2064-09-17', 'Released', 'The New Age', 5),
(422, 6, 20000000, 118, NULL, 'tt0110678', b'0', 'en', 'In the year 2022, a ruthless prison warden has created the ultimate solution for his most troublesome and violent inmates: Absolom, a secret jungle island where prisoners are abandoned and left to die. But Marine Captain John Robbins, convicted of murdering a commanding officer, is determined to escape the island in order to reveal the truth behind his murderous actions and clear his name.', 9, 'https://image.tmdb.org/t/p/w500/d2Q8jXe4dW4YKlemRb7oVlY6Msj.jpg', '2064-04-30', 'Released', 'No Escape', 86),
(423, 4, 14000000, 100, NULL, 'tt0114825', b'0', 'en', 'Maximillian, the lone survivor of a race of vampires, comes to Brooklyn in search of a way to live past the next full moon. His ticket to survival is Rita, a NYPD detective who doesn\'t know she\'s half vampire -- and Maximillian will do whatever\'s necessary to put her under his spell.', 9, 'https://image.tmdb.org/t/p/w500/bH1v8z12ZU7Y6zANgU1B00a86Co.jpg', '2065-10-27', 'Released', 'Vampire in Brooklyn', 113),
(424, 6, 0, 112, NULL, 'tt0115639', b'0', 'en', 'During a snowy winter in the small fictional town of Knight\"s Ridge, Massachusetts, a group of lifelong buddies hang out, drink and struggle to connect with the women who affect their decisions, dreams and desires.', 4, 'https://image.tmdb.org/t/p/w500/8leYqrAL6EubYjOCZuO6ELPdLYe.jpg', '2066-02-10', 'Released', 'Beautiful Girls', 103),
(425, 5, 50000000, 108, NULL, 'tt0115759', b'0', 'en', 'When rogue stealth-fighter pilot Vic Deakins deliberately drops off the radar while on maneuvers, the Air Force ends up with two stolen nuclear warheads -- and Deakins\'s co-pilot, Riley Hale, is the military\'s only hope for getting them back. Traversing the deserted canyons of Utah, Hale teams with park ranger Terry Carmichael to put Deakins back in his box.', 14, 'https://image.tmdb.org/t/p/w500/avqUG5RYB93rwSUNL5r16Vtbc9g.jpg', '2066-02-10', 'Released', 'Broken Arrow', 459),
(426, 7, 0, 99, NULL, 'tt0113403', b'0', 'en', 'Out of work actor Joe volunteers to help try and save his sister\'s local church for the community by putting on a Christmas production of Hamlet, somewhat against the advice of his agent Margaretta. As the cast he assembles are still available even at Christmas and are prepared to do it on a \'profit sharing\' basis (that is, they may not get paid anything) he cannot expect - and does not get - the cream of the cream. But although they all bring their own problems and foibles along, something bigger starts to emerge in the perhaps aptly named village of Hope.', 0, 'https://image.tmdb.org/t/p/w500/6u2N0gn6uUWF4cSdkXmVB8E8q2X.jpg', '2065-12-02', 'Released', 'A Midwinter\'s Tale', 6),
(427, 7, 25000000, 125, NULL, 'tt0107614', b'0', 'en', 'Loving but irresponsible dad Daniel Hillard, estranged from his exasperated spouse, is crushed by a court order allowing only weekly visits with his kids. When Daniel learns his ex needs a housekeeper, he gets the job -- disguised as an English nanny. Soon he becomes not only his children\'s best pal but the kind of parent he should have been from the start.', 11, 'https://image.tmdb.org/t/p/w500/jx4NvllNGN7o5bpIhcCMh26Xwaj.jpg', '2063-11-26', 'Released', 'Mrs. Doubtfire', 1638),
(428, 7, 3000000, 98, NULL, 'tt0113247', b'0', 'fr', 'Aimlessly whiling away their days in the concrete environs of their dead-end suburbia, Vinz, Hubert, and Said -- a Jew, African, and an Arab -- give human faces to France\'s immigrant populations, their bristling resentment at their social marginalization slowly simmering until it reaches a climactic boiling point. La Haine means Hate.', 12, 'https://image.tmdb.org/t/p/w500/jTzBED0leGPwWDqNewye11qzJgd.jpg', '2065-06-01', 'Released', 'La Haine', 695),
(429, 5, 16000000, 88, NULL, 'tt0116151', b'0', 'en', 'Hotel manager Robert Grant is forced by his boss to postpone his family vacation when a hotel critic checks in. Trouble is, the critic is really a villainous jewel thief with an orangutan assistant named Dunston. When Dunston gets loose and tries to escape a life of crime -- aided by Robert\'s sons -- havoc, hijinks and lots of laughs abound!', 4, 'https://image.tmdb.org/t/p/w500/lXSWbUA3T2o792SYdbfFKFTcSC1.jpg', '2066-01-13', 'Released', 'Dunston Checks In', 59),
(430, 5, 0, 105, NULL, 'tt0111173', b'0', 'en', 'A dark, hip, urban story of a barren and anonymous city where the underclass\' sport of choice is ram-raiding. An exciting game in which stolen cars are driven through shop windows to aid large-scale looting before the police arrive. For Tommy, it\'s a business, but for Billy and Jo, it\'s a labour of love. As the competition between Tommy and Billy grows more fierce, the stakes become higher and the \"shopping\" trips increasingly risky.', 2, 'https://image.tmdb.org/t/p/w500/jdYL6f0KXnYBcnWnwGtnanJtKlE.jpg', '2064-12-07', 'Released', 'Shopping', 13),
(431, 6, 0, 91, NULL, 'tt0113490', b'0', 'en', 'The Journey of August King is a multi-dimensional drama about a North Carolina farmer in 1815. August King, a widower, is on his way home as he does every year after selling his produce and purchasing the stock and goods he will need to survive the winter. On his journey, he comes upon a run-away slave, a young woman about 19 and August King must decide to violate the law and help this slave to freedom or else leave her to be hunted down and, ultimately, returned to her slave owner.', 0, 'https://image.tmdb.org/t/p/w500/hT5CF2RJPAVi9TE4iKxGYAufY4J.jpg', '2065-09-15', 'Released', 'The Journey of August King', 3),
(432, 6, 0, 106, 'http://www.nickbroomfield.com/heidifleiss.html', 'tt0113283', b'0', 'en', 'A documentary crew from the BBC arrives in L.A. intent on interviewing Heidi Fleiss, a year after her arrest for running a brothel but before her trial. Several months elapse before the interview, so the crew searches for anyone who\'ll talk about the young woman. Two people have a lot to say to the camera: a retired madam named Alex for whom Fleiss once worked and Fleiss\'s one-time boyfriend, Ivan Nagy, who introduced her to Alex. Alex and Nagy don\'t like each other, so the crew shuttles between them with \"she said\" and \"he said.\" When they finally interview Fleiss, they spend their time reciting what Alex and Nagy have had to say and asking her reaction.', 0, 'https://image.tmdb.org/t/p/w500/j9k3UTx7OZ0xoCws1oACYQZFF5N.jpg', '2065-12-28', 'Released', 'Heidi Fleiss: Hollywood Madam', 4),
(433, 6, 7000000, 91, NULL, 'tt0115734', b'0', 'en', 'Upon his release from a mental hospital following a nervous breakdown, the directionless Anthony joins his friend Dignan, who seems far less sane than the former. Dignan has hatched a hair-brained scheme for an as-yet-unspecified crime spree that somehow involves his former boss, the (supposedly) legendary Mr. Henry.', 6, 'https://image.tmdb.org/t/p/w500/iuO10cRKrMfql5yc8YTgdfHt7gR.jpg', '2066-02-22', 'Released', 'Bottle Rocket', 285),
(434, 6, 0, 111, NULL, 'tt0115907', b'0', 'en', 'The accidental shooting of a boy in New York leads to an investigation by the Deputy Mayor, and unexpectedly far-reaching consequences.', 4, 'https://image.tmdb.org/t/p/w500/ttdjD9NpxXsTJidPT3o1Gk0oTkG.jpg', '2066-02-17', 'Released', 'City Hall', 67),
(435, 3, 0, 96, NULL, 'tt0117102', b'0', 'en', 'A single and lonely woman finds the seemingly perfect man to date, but soon regrets it when his deranged and possessive other personality emerges and worst still, she cannot convince anyone else of his Jekyll/Hyde true nature.', 3, 'https://image.tmdb.org/t/p/w500/8oZW1loLEczN1BU60YobsJJFdSR.jpg', '2066-02-17', 'Released', 'Mr. Wrong', 16),
(436, 6, 12000000, 92, NULL, 'tt0116483', b'0', 'en', 'Failed hockey player-turned-golf whiz Happy Gilmore -- whose unconventional approach and antics on the grass courts the ire of rival Shooter McGavin -- is determined to win a PGA tournament so he can save his granny\'s house with the prize money. Meanwhile, an attractive tour publicist tries to soften Happy\'s image.', 9, 'https://image.tmdb.org/t/p/w500/pG5edeKkntnt5A799Y0UNI5hi9W.jpg', '2066-02-17', 'Released', 'Happy Gilmore', 767),
(437, 5, 18000000, 106, NULL, 'tt0118040', b'0', 'en', 'Ray Liotta stars as a medical examiner who has been acquitted for his wife\'s murder but many still question his innocence. Obsessed with finding his wife\'s killer, a possible solution presents itself in an experimental serum designed by a neurobiology Linda Fiorentino which has the ability to transfer memories from one person to another, but not without consequences. Liotta driven to solve the case injects himself with the serum, bringing him closer and closer to finding her killer but bringing him closer to death.', 2, 'https://image.tmdb.org/t/p/w500/qQek3X5Yv0iLZqQ98KWIKtE3x4m.jpg', '2066-02-24', 'Released', 'Unforgettable', 22),
(438, 7, 24000000, 135, NULL, 'tt0112579', b'0', 'en', 'Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.', 5, 'https://image.tmdb.org/t/p/w500/czRuGEx9Yhnh6nApirTLPToxHNu.jpg', '2065-05-29', 'Released', 'The Bridges of Madison County', 397),
(439, 5, 0, 104, NULL, 'tt0110251', b'0', 'de', 'No overview found.', 1, 'https://image.tmdb.org/t/p/w500/lnfMQ6K2EgJpn2JZTadnaufiwiR.jpg', '2064-11-08', 'Released', 'Keiner liebt mich', 5),
(440, 7, 0, 95, NULL, 'tt0112646', b'0', 'en', 'A documentary following Christy Turlington and other models during spring fashion week in Milan, Paris and New York.', 0, 'https://image.tmdb.org/t/p/w500/yhFcbTCnsWjg3nH3PLL6RoltjqS.jpg', '2065-12-09', 'Released', 'Catwalk', 2),
(441, 0, 0, 110, NULL, 'tt0113276', b'0', 'en', 'An ex-con holds a group of people hostage in a topless bar.', 0, 'https://image.tmdb.org/t/p/w500/tQ6HEWNxvbeF2WklTVEp3su446F.jpg', '2065-05-21', 'Released', 'Headless Body in Topless Bar', 0),
(442, 6, 0, 100, NULL, 'tt0117110', b'0', 'en', 'After telling the story of Flint\'s last journey to young Jim Hawkins, Billy Bones has a heart attack and dies just as Jim and his friends are attacked by pirates. The gang escapes into the town where they hire out a boat and crew to find the hidden treasure, which was revealed by Bones before he died. On their voyage across the seas, they soon find out that not everyone on board can be trusted.', 6, 'https://image.tmdb.org/t/p/w500/5A8gKzOrF9Z7tSUX6xd5dEx4NXf.jpg', '2066-02-17', 'Released', 'Muppet Treasure Island', 93),
(443, 6, 7500000, 91, NULL, 'tt0113326', b'0', 'cn', 'Keong comes from Hong Kong to visit New York for his uncle\'s wedding. His uncle runs a market in the Bronx and Keong offers to help out while Uncle is on his honeymoon. During his stay in the Bronx, Keong befriends a neighbor kid and beats up some neighborhood thugs who cause problems at the market. One of those petty thugs in the local gang stumbles into a criminal situation way over his head.', 12, 'https://image.tmdb.org/t/p/w500/y7AxKPPCtZyrGQKvxzn5zTQ8wFm.jpg', '2065-01-31', 'Released', 'ç´INSERT INTO `movie_collection` (`mv_collect_id`, `collection_id`, `movie_id`) VALUES
